{"title": "[\u78cb\u5546]\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe-\u6559\u5b66\u7c7b-\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c\u4e00\u3001\u4e8c\u3001\u4e09\u5305\uff09\u9879\u76ee\u7ec8\u6b62\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u7684\u59d4\u6258\uff0c\u5c31\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe\u2014\u6559\u5b66\u7c7b\u2014\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014306180917228\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u5e9f\u6807/\u6d41\u6807\u516c\u544a\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014306180917228</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe\u2014\u6559\u5b66\u7c7b\u2014\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u9ec4\u5f64\u3001\u9648\u601d\u9759</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a65915614\u300165913057\u300165244576</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u7ecf\u6d4e\u6280\u672f\u5f00\u53d1\u533a\u51c9\u6c34\u6cb3\u4e00\u88579\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a87220943</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u671d\u5185\u5927\u8857\u5357\u7af9\u6746\u80e1\u540c6\u53f7\u5317\u4eacINN3\u53f7\u697c9\u5c42</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u9ec4\u5f64\u3001\u9648\u601d\u9759\uff1b65915614\u300165913057\u300165244576\uff08\u4f20\u771f\uff1a65951037\uff09</p><p></p><p><strong>\u56db\u3001\u5e9f\u6807\u3001\u6d41\u6807\u7684\u539f\u56e0</strong></p><p></p><p style=\"line-height:150%;\">\u7ec8\u6b62\u539f\u56e0\uff1a\u5bf9\u7ade\u4e89\u6027\u78cb\u5546\u6587\u4ef6\u4f5c\u5b9e\u8d28\u6027\u54cd\u5e94\u7684\u4f9b\u5e94\u5546\u4e0d\u8db33\u5bb6</p><p></p><p><strong>\u4e94\u3001\u5e9f\u6807/\u6d41\u6807\u65e5\u671f</strong>\uff1a2018\u5e7409\u670830\u65e5</p><p></p><p><strong>\u516d\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p>\u5907\u6ce8\uff1a\u7531\u4e8e\u7cfb\u7edf\u8bbe\u7f6e\u539f\u56e0\uff0c\u672c\u516c\u544a\u5c5e\u4e8e\u7ec8\u6b62\u516c\u544a\u3002</p><p style=\"line-height:150%;\">\u9879\u76ee\u7f16\u53f7\uff1aBJJQ-2018-894</p><p>\u9996\u6b21\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670819\u65e5</p><p align=\"left\" style=\"text-indent:24pt;line-height:150%;\">\u672c\u516c\u544a\u540c\u65f6\u5728\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08http://www.ccgp.gov.cn\uff09\u3001\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08http://www.ccgp-beijing.gov.cn/\uff09\u4ee5\u53ca\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8\u7f51\u7ad9\uff08http://www.hcjq.net/\uff09\u53d1\u5e03\u3002</p><p></p><p></p>           <p></p>                                                                                                                                                                                                                                                                        