{"title": "[\u516c\u5f00]\u5317\u4eac\u5e02\u76d1\u72f1\u7ba1\u7406\u5c40\u672c\u7ea7\u5317\u4eac\u5e02\u76d1\u72f1\u7ba1\u7406\u5c40\u5e02\u5c40\u6307\u6325\u4e2d\u5fc3\u6574\u5408\u8fbe\u6807\u6539\u9020\u5de5\u7a0b\u5efa\u7b51\u5de5\u7a0b\u90e8\u5206\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u76d1\u72f1\u7ba1\u7406\u5c40\u672c\u7ea7\u7684\u59d4\u6258\uff0c\u5c31\u5317\u4eac\u5e02\u76d1\u72f1\u7ba1\u7406\u5c40\u5e02\u5c40\u6307\u6325\u4e2d\u5fc3\u6574\u5408\u8fbe\u6807\u6539\u9020\u5de5\u7a0b\u5efa\u7b51\u5de5\u7a0b\u90e8\u5206\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0000047102180903050\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0000047102180903050</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u76d1\u72f1\u7ba1\u7406\u5c40\u5e02\u5c40\u6307\u6325\u4e2d\u5fc3\u6574\u5408\u8fbe\u6807\u6539\u9020\u5de5\u7a0b\u5efa\u7b51\u5de5\u7a0b\u90e8\u5206</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u96f7\u5929\u5ba0\u3001\u5218\u5fb7\u5764</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a65170699\u300165173108</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u76d1\u72f1\u7ba1\u7406\u5c40\u672c\u7ea7</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u53f3\u5b89\u95e8\u4e1c\u8857\u4e03\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a53860316</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u8be6\u89c1\u9644\u4ef6\u3002</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u671d\u5185\u5927\u8857\u5357\u7af9\u6746\u80e1\u540c6\u53f7\u5317\u4eacINN3\u53f7\u697c9\u5c42</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u96f7\u5929\u5ba0\u3001\u5218\u5fb7\u5764\uff1b65170699\u300165173108</p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670805\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670826\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a77.5435920 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><p style=\"line-height:150%;\">\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\uff1a\u51ef\u57fa\u9f0e\u4e16\u5efa\u8bbe\u53d1\u5c55\u6709\u9650\u516c\u53f8</p><p style=\"margin-left:96.0pt;text-indent:-96.0pt;line-height:150%;\">\u4e2d\u6807\u4f9b\u5e94\u5546\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u671d\u9633\u8def67\u53f76\u53f7\u697c201\u5ba4</p><p style=\"line-height:150%;\">\u4e2d\u6807\u91d1\u989d\uff1a\u67d2\u62fe\u67d2\u4e07\u4f0d\u4edf\u8086\u4f70\u53c1\u62fe\u4f0d\u5143\u7396\u89d2\u8d30\u5206\uff08\u4eba\u6c11\u5e01\u5927\u5199\uff09</p><p style=\"line-height:150%;\"> \uffe5775435.92\u5143\uff08\u4eba\u6c11\u5e01\u5c0f\u5199\uff09</p><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a0.890265 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u8be6\u89c1\u62db\u6807\u6587\