{"title": "[\u78cb\u5546]\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe-\u6559\u5b66\u7c7b-\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c\u56db\u5305\uff1a\u5efa\u8bbe\u751f\u7269\u3001\u7ecf\u6d4e\u7ba1\u7406\u7c7b\u8bfe\u7a0b\u8d44\u6e90\uff09\u6210\u4ea4\u7ed3\u679c\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u7684\u59d4\u6258\uff0c\u5c31\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe\u2014\u6559\u5b66\u7c7b\u2014\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014306180917228\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u6210\u4ea4\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014306180917228</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe\u2014\u6559\u5b66\u7c7b\u2014\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u9ec4\u5f64\u3001\u9648\u601d\u9759</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a65915614\u300165913057\u300165244576</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u7ecf\u6d4e\u6280\u672f\u5f00\u53d1\u533a\u51c9\u6c34\u6cb3\u4e00\u88579\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a87220943</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u671d\u5185\u5927\u8857\u5357\u7af9\u6746\u80e1\u540c6\u53f7\u5317\u4eacINN3\u53f7\u697c9\u5c42</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u9ec4\u5f64\u3001\u9648\u601d\u9759\uff1b65915614\u300165913057\u300165244576\uff08\u4f20\u771f\uff1a65951037\uff09</p><p></p><p><strong>\u56db\u3001\u6210\u4ea4\u4fe1\u606f</strong></p><p>\u62db\u6807\u6587\u4ef6\u7f16\u53f7\uff1aBJJQ-2018-894-04</p><p>\u672c\u9879\u76ee\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670819\u65e5</p><p>\u6210\u4ea4\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u6210\u4ea4\u91d1\u989d\uff1a45.9800000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p>                <p>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u5730\u5740\u53ca\u6210\u4ea4\u91d1\u989d\uff1a</p><p></p><p style=\"line-height:150%;\">\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0\uff1a\u5317\u4eac\u667a\u521b\u4f18\u8f6f\u79d1\u6280\u6709\u9650\u516c\u53f8</p><p style=\"line-height:150%;\">\u6210\u4ea4\u4f9b\u5e94\u5546\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u9a9a\u5b50\u84251\u53f7\u966212\u5e62\u4e94\u5c42501\u623f\u95f4</p><p style=\"line-height:150%;\">\u6210\u4ea4\u91d1\u989d\uff1a</p><p style=\"line-height:150%;\">\u4eba\u6c11\u5e01\u5927\u5199\uff1a\u8086\u62fe\u4f0d\u4e07\u7396\u4edf\u634c\u4f70\u5143\u6574</p><p style=\"line-height:150%;\">\u4eba\u6c11\u5e01\u5c0f\u5199\uff1a\uffe5459800.00</p><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a0.69 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u8be6\u89c1\u7ade\u4e89\u6027\u78cb\u5546\u6587\u4ef6</p><p></p><p>\u8c08\u5224\u5c0f\u7ec4\u3001\u8be2\u4ef7\u5c0f\u7ec4\u3001\u78cb\u5546\u5c0f\u7ec4\u6210\u5458\u540d\u5355\u53ca\u5355\u4e00\u6765\u6e90\u91c7\u8d2d\u4eba\u5458\u540d\u5355\uff1a</p><p>\u5b63\u7ef4\u56fd\u3001\u5b54\u7965\u6e05\u3001\u6768\u7ef4\u82f1</p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u9879\u76ee\u7528\u9014\uff1a\u7528\u4e8e\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe-\u6559\u5b66\u7c7b-\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c\u56db\u5305\uff1a\u5efa\u8bbe\u751f\u7269\u3001\u7ecf\u6d4e\u7ba1\u7406\u7c7b\u8bfe\u7a0b\u8d44\u6e90\uff09</p><p>\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u4e3a\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe-\u6559\u5b66\u7c7b-\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c\u56db\u5305\uff1a\u5efa\u8bbe\u751f\u7269\u3001\u7ecf\u6d4e\u7ba1\u7406\u7c7b\u8bfe\u7a0b\u8d44\u6e90\uff09\u63d0\u4f9b\u4f18\u8d28\u7684\u670d\u52a1\uff08\u8be6\u89c1\u7ade\u4e89\u6027\u78cb\u5546\u6587\u4ef6\uff09</p><p>\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a\u8be6\u89c1\u5408\u540c</p><p></p><p><strong>\u516d\u3001\u6210\u4ea4\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</strong></p><p></p><p>\u8be6\u89c1\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"line-height:150%;\">\u91c7\u8d2d\u65b9\u5f0f\uff1a\u7ade\u4e89\u6027\u78cb\u5546</p><p style=\"line-height:150%;\">\u9009\u62e9\u8be5\u653f\u5e9c\u91c7\u8d2d\u65b9\u5f0f\u7684\u539f\u56e0\uff1a\u9002\u7528</p><p style=\"line-height:150%;\">\u786e\u5b9a\u6210\u4ea4\u7684\u65b9\u6cd5\u548c\u6807\u51c6\uff1a\u7efc\u5408\u8bc4\u5206\u6cd5</p><p style=\"line-height:150%;\">\u4e3b\u8981\u6210\u4ea4\u6807\u7684\uff1a</p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse:collapse;border:none;\"><tbody><tr style=\"height:10px;\"><td style=\"width:278px;border:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:10px;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u540d\u79f0</p></td><td style=\"width:92px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:10px;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u6570\u91cf</p></td><td style=\"width:198px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:10px;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u5355\u4ef7\u3001\u89c4\u683c\u578b\u53f7\u3001\u670d\u52a1\u8981\u6c42\u6216\u8005\u6807\u7684\u7684\u57fa\u672c\u6982\u51b5</p></td></tr><tr style=\"height:10px;\"><td style=\"width:278px;border:solid windowtext 1.0pt;border-top:none;padding:0cm 5.4pt 0cm 5.4pt;height:10px;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u5efa\u8bbe\u751f\u7269\u3001\u7ecf\u6d4e\u7ba1\u7406\u7c7b\u8bfe\u7a0b\u8d44\u6e90</p></td><td style=\"width:92px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:10px;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u4e00\u9879</p></td><td style=\"width:198px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:10px;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u8be6\u89c1\u6210\u4ea4\u6587\u4ef6</p></td></tr></tbody></table><p style=\"text-indent:30.0pt;line-height:150%;\">\u672c\u516c\u544a\u540c\u65f6\u5728\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08http://www.ccgp.gov.cn\uff09\u3001\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08http://www.ccgp-beijing.gov.cn/\uff09\u4ee5\u53ca\u5317\u4eac\u6c47\u8b