{"title": "[\u516c\u5f00]\u5317\u4eac\u5e02\u7b2c\u4e00\u4e2d\u7ea7\u4eba\u6c11\u6cd5\u9662\uff08\u672c\u7ea7\uff09\u5927\u8981\u6848\u5f31\u7535\u53ca\u4fe1\u606f\u7cfb\u7edf\u5efa\u8bbe\u9879\u76ee(\u7b2c4\u5305)\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u7b2c\u4e00\u4e2d\u7ea7\u4eba\u6c11\u6cd5\u9662\uff08\u672c\u7ea7\uff09\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5927\u8981\u6848\u5f31\u7535\u53ca\u4fe1\u606f\u7cfb\u7edf\u5efa\u8bbe\u9879\u76ee\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5927\u8981\u6848\u5f31\u7535\u53ca\u4fe1\u606f\u7cfb\u7edf\u5efa\u8bbe\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000931102180829014</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u97e9\u5148\u751f</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-87150241-8707</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u7b2c\u4e00\u4e2d\u7ea7\u4eba\u6c11\u6cd5\u9662\uff08\u672c\u7ea7\uff09</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u77f3\u666f\u5c71\u8def16\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-59891290</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u97e9\u5148\u751f  010-87150241-8707</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a417A</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-left:5.4pt;border-collapse:collapse;border:none;\"><tbody><tr style=\"height:5px;\"><td style=\"width:217px;border:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u9879\u76ee\u540d\u79f0</strong></p></td><td style=\"width:85px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u9884\u7b97\u603b\u91d1\u989d\uff08\u4e07\u5143\uff09</strong></p></td><td style=\"width:28px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u5305\u6570</strong></p></td><td style=\"width:76px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u9879\u76ee\u5185\u5bb9</strong></p></td><td style=\"width:38px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u7528\u9014</strong></p></td><td style=\"width:38px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u6570\u91cf</strong></p></td><td style=\"width:57px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u7b80\u8981\u6280\u672f\u8981\u6c42</strong></p></td><td style=\"width:85px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;height:5px;\"><p align=\"center\" style=\"text-align:center;\"><strong>\u662f\u5426\u5141\u8bb8\u91c7\u8d2d\u8fdb\u53e3\u4ea7\u54c1</strong></p></td></tr><tr style=\"height:12px;\"><td style=\"width:217px;border:solid windowtext 1.0pt;border-top:none;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">\u5927\u8981\u6848\u5f31\u7535\u53ca\u4fe1\u606f\u7cfb\u7edf\u5efa\u8bbe\u9879\u76ee</p></td><td style=\"width:85px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">467.219601</p></td><td style=\"width:28px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">4</p></td><td style=\"width:76px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">\u4fe1\u606f\u7cfb\u7edf</p></td><td style=\"width:38px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">\u5efa\u8bbe</p></td><td style=\"width:38px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">\u4e00\u6279</p></td><td style=\"width:57px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">\u884c\u4e1a</p><p align=\"center\" style=\"text-align:center;\">\u6807\u51c6</p></td><td style=\"width:85px;border-top:none;border-left:none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:12px;\"><p align=\"center\" style=\"text-align:center;\">\u5426</p></td></tr></tbody></table><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>1)\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u6ce8\u518c\uff0c\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\u548c\u7ecf\u8425\u8bb8\u53ef\uff0c\u5411\u91c7\u8d2d\u4eba\u63d0\u4f9b\u8d27\u7269\u548c\u670d\u52a1\u7684\u6cd5\u4eba\u3001\u5176\u4ed6\u7ec4\u7ec7\u6216\u81ea\u7136\u4eba\u30022)\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\u30023)\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\u30024)\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\u30025)\u8fd1\u4e09\u5e74\u5185\uff08\u672c\u9879\u76ee\u6295\u6807\u622a\u6b62\u671f\u524d\uff09\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\u30026)\u88ab\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u548c\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u7684\u3001\u88ab\u201c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u201d\u7f51\u7ad9\uff08www.ccgp.gov.cn\uff09\u5217\u5165\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\uff08\u5904\u7f5a\u671f\u9650\u5c1a\u672a\u5c4a\u6ee1\u7684\uff09\u7684\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u53c2\u4e0e\u672c\u9879\u76ee\u7684\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u30027)\u5355\u4f4d\u8d1f\u8d23\u4eba\u4e3a\u540c\u4e00\u4eba\u6216\u8005\u5b58\u5728\u76f4\u63a5\u63a7\u80a1\u3001\u7ba1\u7406\u5173\u7cfb\u7684\u4e0d\u540c\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u53c2\u52a0\u540c\u4e00\u5305\u7684\u6295\u6807\u6216\u8005\u672a\u5212\u5206\u5305\u7684\u540c\u4e00\u62db\u6807\u9879\u76ee\u7684\u6295\u6807\u30028)\u4e3a\u672c\u91c7\u8d2d\u9879\u76ee\u63d0\u4f9b\u8fc7\u6574\u4f53\u8bbe\u8ba1\u3001\u89c4\u8303\u7f16\u5236\u6216\u8005\u9879\u76ee\u7ba1\u7406\u3001\u76d1\u7406\u3001\u68c0\u6d4b\u7b49\u670d\u52a1\u7684\u4f9b\u5e94\u5546\u53ca\u5176\u9644\u5c5e\u673a\u6784\uff0c\u4e0d\u5f97\u518d\u53c2\u52a0\u672c\u91c7\u8d2d\u9879\u76ee\u7684\u6295\u6807\u6d3b\u52a8\u30029)\u6309\u7167\u62db\u6807\u516c\u544a\u8981\u6c42\u8d2d\u4e70\u4e86\u62db\u6807\u6587\u4ef6\u300210)\u7b26\u5408\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u8981\u6c42\u300211)\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a467.219601 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 17:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a417A\u5ba4</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 14:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 14:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u4e07\u5546\u82b1\u56ed\u9152\u5e977\u5c42\u7b2c\u4e00\u4f1a\u8bae\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p>\u67e5\u9605\u53ca\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u987b\u7531\u5176\u6cd5\u4eba\u6388\u6743\u4ee3\u8868\u643a\u5e26\u4ee5\u4e0b\u8d44\u6599:</p><p>\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\u7684\u8425\u4e1a\u6267\u7167\uff0c\u7ec4\u7ec7\u673a\u6784\u4ee3\u7801\uff08\u53d6\u5f97\u201c\u4e09\u8bc1\u5408\u4e00\u201d\u8425\u4e1a\u6267\u7167\u7684\u9664\u5916\uff09\uff0c\u7a0e\u52a1\u767b\u8bb0\u8bc1\uff08\u53d6\u5f97\u201c\u4e09\u8bc1\u5408\u4e00\u201d\u8425\u4e1a\u6267\u7167\u7684\u9664\u5916\uff09\uff0c\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u4e66\uff0c\u672c\u4eba\u8eab\u4efd\u8bc1\u590d\u5370\u4ef6\u7b49\u5e76\u88c5\u8ba2\u6210\u518c\u3002</p><p>\u672c\u516c\u544a\u4e3a\u5927\u8981\u6848\u5f31\u7535\u53ca\u4fe1\u606f\u7cfb\u7edf\u5efa\u8bbe\u9879\u76ee(\u7b2c4\u5305)</p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u2460\u8282\u80fd\u4ea7\u54c1\u5f3a\u5236\u91c7\u8d2d\uff1b\u2461\u8282\u80fd\u4ea7\u54c1\u3001\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u4f18\u5148\u91c7\u8d2d\uff1b\u2462\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\uff1b\u2463\u653f\u5e9c\u91c7\u8d2d\u9879\u76ee\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\uff1b\u2464\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\uff1b\u2465\u8fdb\u53e3\u4ea7\u54c1\u7ba1\u7406\uff1b\u2466\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a\uff1b</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                   