{"title": "[\u78cb\u5546]\u4e2d\u5171\u5317\u4eac\u5e02\u59d4\u5ba3\u4f20\u90e8\uff08\u79d1\u6280\u6587\u5316\uff09\u201c\u7231\u4e0a\u5317\u4eac\u201d\u591a\u8bed\u79cd\u7f51\u9875\u9879\u76ee\u7ec8\u6b62\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u8bda\u8dc3\u65b0\uff08\u5317\u4eac\uff09\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u4e2d\u5171\u5317\u4eac\u5e02\u59d4\u5ba3\u4f20\u90e8\uff08\u79d1\u6280\u6587\u5316\uff09\u7684\u59d4\u6258\uff0c\u5c31\u201c\u7231\u4e0a\u5317\u4eac\u201d\u591a\u8bed\u79cd\u7f51\u9875\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0001105002180415065\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u5e9f\u6807/\u6d41\u6807\u516c\u544a\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0001105002180415065</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u201c\u7231\u4e0a\u5317\u4eac\u201d\u591a\u8bed\u79cd\u7f51\u9875</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u82cf\u5973\u58eb</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-51201619 13124797529 </p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u4e2d\u5171\u5317\u4eac\u5e02\u59d4\u5ba3\u4f20\u90e8\uff08\u79d1\u6280\u6587\u5316\uff09</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u53f0\u57fa\u5382\u5927\u88573\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a010-64409813</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u4e2d\u8bda\u8dc3\u65b0\uff08\u5317\u4eac\uff09\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u96c5\u5b9d\u8def12\u53f7\u534e\u58f0\u56fd\u9645\u5927\u53a61608\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a010-51201619 13124797529 </p><p></p><p><strong>\u56db\u3001\u5e9f\u6807\u3001\u6d41\u6807\u7684\u539f\u56e0</strong></p><p></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%;\"><span style=\"line-height: 150%; font-family: \u5b8b\u4f53; font-size: 12pt;\"><font color=\"#000000\">\u7ec8\u6b62\u539f\u56e0\uff1a\u5728\u91c7\u8d2d\u8fc7\u7a0b\u4e2d\u7b26\u5408\u8981\u6c42\u7684\u4f9b\u5e94\u5546\u6570\u91cf\u4e0d\u8db3\u89c4\u5b9a\u8981\u6c42\u3002</font></span></p><p></p><p><strong>\u4e94\u3001\u5e9f\u6807/\u6d41\u6807\u65e5\u671f</strong>\uff1a2018\u5e7409\u670830\u65e5</p><p></p><p><strong>\u516d\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"line-height: 150%;\">\u672c\u516c\u544a\u671f\u9650\u4e3a1\u4e2a\u5de5\u4f5c\u65e5</p><p align=\"left\" style=\"text-align: left; line-height: 150%;\">\u672c\u9879\u76ee\u516c\u544a\u4ec5\u53d1\u5e03\u4e8e\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51(www.ccgp.gov.cn/)\u53ca\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u7f51(www.ccgp-beijing.gov.cn/),\u8f6c\u8f7d\u65e0\u6548\u3002</p><p style=\"line-height: 150%;\"></p><p style=\"line-height: 150%; text-indent: 312pt;\"></p><p align=\"right\" style=\"margin: 0cm -4.4pt 0pt 0cm; text-align: right; line-height: 150%;\"> \u4e2d\u8bda\u8dc3\u65b0\uff08\u5317\u4eac\uff09\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p align=\"right\" style=\"text-align: right; line-height: 150%;\"> 2018\u5e749\u670830\u65e5</p><p></p><p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                          