{"title": "[\u78cb\u5546]\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe-\u6559\u5b66\u7c7b-\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c\u4e00\u3001\u4e8c\u3001\u4e09\u5305\uff09\u7ade\u4e89\u6027\u78cb\u5546\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe\u2014\u6559\u5b66\u7c7b\u2014\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u8fdb\u884c\u7ade\u4e89\u6027\u78cb\u5546\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe\u2014\u6559\u5b66\u7c7b\u2014\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000014306180917228</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u9ec4\u5f64\u3001\u9648\u601d\u9759</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a65915614\u300165913057\u300165244576</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662</p><p></p>  <p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u7ecf\u6d4e\u6280\u672f\u5f00\u53d1\u533a\u51c9\u6c34\u6cb3\u4e00\u88579\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a87220943</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u9ec4\u5f64\u3001\u9648\u601d\u9759\uff1b65915614\u300165913057\u300165244576\uff08\u4f20\u771f\uff1a65951037\uff09</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u671d\u5185\u5927\u8857\u5357\u7af9\u6746\u80e1\u540c6\u53f7\u5317\u4eacINN3\u53f7\u697c9\u5c42</p><p></p>       <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p>\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\uff1a\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe-\u6559\u5b66\u7c7b-\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c\u4e00\u3001\u4e8c\u3001\u4e09\u5305\uff09<br>\u6570\u91cf\uff1a\u8be6\u89c1\u5176\u5b83\u8865\u5145\u4e8b\u5b9c<br>\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a\u4e3a\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\u4fc3\u8fdb\u9ad8\u6821\u5185\u6db5\u5efa\u8bbe-\u6559\u5b66\u7c7b-\u8bfe\u7a0b\u8d44\u6e90\u5e93\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c\u4e00\u3001\u4e8c\u3001\u4e09\u5305\uff09\u63d0\u4f9b\u4f18\u8d28\u7684\u670d\u52a1\uff08\u8be6\u89c1\u7ade\u4e89\u6027\u78cb\u5546\u6587\u4ef6\uff09</p><p><strong>\u4e8c\u3001\u5bf9\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\uff08\u4f9b\u5e94\u5546\u8d44\u683c\u6761\u4ef6\uff09:</strong></p><p>1\u3001\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u7b2c\u4e00\u6b3e\u89c4\u5b9a\uff1a1\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b2\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b3\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b4\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b5\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b6\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\u30022\u3001\u4f9b\u5e94\u5546\u4e0d\u5f97\u88ab\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u30023\u3001\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u3002</p><p></p><p><strong>\u4e09\u3001\u78cb\u5546\u548c\u54cd\u5e94\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9\u7b49:</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a150.0 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 09:30</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 17:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u671d\u5185\u5927\u8857\u5357\u7af9\u6746\u80e1\u540c6\u53f7\u5317\u4eacINN 3\u53f7\u697c9\u5c42\uff08\u5730\u94c12\u53f7\u7ebf\u30016\u53f7\u7ebf\uff0c\u671d\u9633\u95e8\u7ad9H\u53e3\u51fa\uff0c\u5411\u5357200\u7c73\uff09</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70\u6216\u90ae\u5bc4\u8d2d\u4e70\u3002\u6587\u4ef6\u552e\u4ef7\u6bcf\u5305\u4eba\u6c11\u5e01300\u5143\uff08\u542b\u7535\u5b50\u7248\uff09\uff0c\u552e\u540e\u4e0d\u9000\u3002\u82e5\u90ae\u8d2d\uff0c\u987b\u52a0\u4ed8EMS\u8d3950\u5143\u4eba\u6c11\u5e01\u3002</p><p>\u78cb\u5546\u6587\u4ef6\u552e\u4ef7\uff1a300.0  \u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 08:30\u81f32018\u5e7410\u670816\u65e5 09:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9\uff1a\u5317\u4eac\u7ecf\u6d4e\u6280\u672f\u5f00\u53d1\u533a\u51c9\u6c34\u6cb3\u4e00\u88579\u53f7\uff08\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\uff09\u884c\u653f\u697c517\u5ba4</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 09:30</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9\uff1a\u5317\u4eac\u7ecf\u6d4e\u6280\u672f\u5f00\u53d1\u533a\u51c9\u6c34\u6cb3\u4e00\u88579\u53f7\uff08\u5317\u4eac\u7535\u5b50\u79d1\u6280\u804c\u4e1a\u5b66\u9662\uff09\u884c\u653f\u697c517\u5ba4</p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p style=\"margin-right:-1.8pt;line-height:150%;text-autospace:none;vertical-align:bottom;\">\u9879\u76ee\u7f16\u53f7\uff1aBJJQ-2018-894</p><p style=\"margin-right:-1.8pt;line-height:150%;text-autospace:none;vertical-align:bottom;\">\u91c7\u8d2d\u65b9\u5f0f\uff1a\u7ade\u4e89\u6027\u78cb\u5546</p><p style=\"line-height:150%;\">\u91c7\u8d2d\u6570\u91cf\uff1a</p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse:collapse;border:none;\"><tbody><tr><td style=\"width:126px;border:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u5206\u5305\u53f7</p></td><td style=\"width:315px;border:solid windowtext 1.0pt;border-left:none;padding:0cm 5.4pt 0cm 5.4pt;\"><p align=\"center\" style=\"text-align:center;line-height:150%;\">\u670d\u52a1\u540d\u79f0</p></td><td style=\"width:127px;border:solid windowtext 1.0pt;bor