{"title": "[\u516c\u5f00]\u5317\u4eac\u5de5\u4e1a\u804c\u4e1a\u6280\u672f\u5b66\u9662\u4eba\u624d\u57f9\u517b\u9879\u76ee2018\uff0d\u5927\u7586\u65e0\u4eba\u673a\u5de5\u7a0b\u5e08\u5b66\u9662\u53ca\u6d4b\u91cf\u4e13\u4e1a\u73b0\u4ee3\u5b66\u5f92\u5236\u57fa\u5730\u5efa\u8bbe\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5de5\u4e1a\u804c\u4e1a\u6280\u672f\u5b66\u9662\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5317\u4eac\u5de5\u4e1a\u804c\u4e1a\u6280\u672f\u5b66\u9662\u4eba\u624d\u57f9\u517b\u9879\u76ee2018\uff0d\u5927\u7586\u65e0\u4eba\u673a\u5de5\u7a0b\u5e08\u5b66\u9662\u53ca\u6d4b\u91cf\u4e13\u4e1a\u73b0\u4ee3\u5b66\u5f92\u5236\u57fa\u5730\u5efa\u8bbe\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4eac\u5de5\u4e1a\u804c\u4e1a\u6280\u672f\u5b66\u9662\u4eba\u624d\u57f9\u517b\u9879\u76ee2018\uff0d\u5927\u7586\u65e0\u4eba\u673a\u5de5\u7a0b\u5e08\u5b66\u9662\u53ca\u6d4b\u91cf\u4e13\u4e1a\u73b0\u4ee3\u5b66\u5f92\u5236\u57fa\u5730\u5efa\u8bbe</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000014225180920363</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u96f7\u5929\u5ba0\u3001\u4efb\u82f1\u6770</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a65170699\u300165173108</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5de5\u4e1a\u804c\u4e1a\u6280\u672f\u5b66\u9662</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u77f3\u95e8\u8def368\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a51511151</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u96f7\u5929\u5ba0\u3001\u4efb\u82f1\u6770\uff1b65170699\u300165173108</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u671d\u5185\u5927\u8857\u5357\u7af9\u6746\u80e1\u540c6\u53f7\u5317\u4eacINN3\u53f7\u697c9\u5c42</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p>\u8be6\u89c1\u9644\u4ef6</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>1\u3001\u6295\u6807\u4eba\u5fc5\u987b\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u7b2c\u4e00\u6b3e\u7684\u89c4\u5b9a\uff1a1\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b2\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b3\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b4\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b5\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b6\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\u30022\u3001\u6295\u6807\u4eba\u4e0d\u5f97\u88ab\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u30023\u3001\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a186.8 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 17:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u671d\u5185\u5927\u8857\u5357\u7af9\u6746\u80e1\u540c6\u53f7\u5317\u4eacINN 3\u53f7\u697c9\u5c42\uff08\u5730\u94c12\u53f7\u7ebf\u30016\u53f7\u7ebf\uff0c\u671d\u9633\u95e8\u7ad9H\u53e3\u51fa\uff0c\u5411\u5357200\u7c73\uff09</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5300.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70\u3002\u6587\u4ef6\u552e\u4ef7\u6bcf\u672c\u4eba\u6c11\u5e01300\u5143\uff08\u542b\u7535\u5b50\u7248\uff09\uff0c\u552e\u540e\u4e0d\u9000\u3002</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5de5\u4e1a\u804c\u4e1a\u6280\u672f\u5b66\u9662\u98df\u5802\u4e94\u5c42\u4f1a\u8bae\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin-left:60.0pt;text-indent:-60.0pt;line-height:150%;\">\u9879\u76ee\u540d\u79f0\uff1a\u5317\u4eac\u5de5\u4e1a\u804c\u4e1a\u6280\u672f\u5b66\u9662\u4eba\u624d\u57f9\u517b\u9879\u76ee2018\uff0d\u5927\u7586\u65e0\u4eba\u673a\u5de5\u7a0b\u5e08\u5b66\u9662\u53ca\u6d4b\u91cf\u4e13\u4e1a\u73b0\u4ee3\u5b66\u5f92\u5236\u57fa\u5730\u5efa\u8bbe</p><p style=\"margin-left:60.0pt;text-indent:-60.0pt;line-height:150%;\">\u9879\u76ee\u7f16\u53f7\uff1aBJJQ-2018-922</p><p align=\"left\" style=\"line-height:150%;\">\u91c7\u8d2d\u9879\u76ee\u9884\u7b97\u91d1\u989d\uff1a\u4eba\u6c11\u5e01186.8\u4e07\u5143</p><p align=\"left\" style=\"line-height:150%;\">\u9762\u5411\u4f01\u4e1a\u7c7b\u578b\uff1a\u975e\u4e13\u95e8\u9762\u5411\u4e2d\u5c0f\u4f01\u4e1a</p><p align=\"left\" style=\"line-height:150%;\">\u8fdb\u53e3\u4ea7\u54c1\u89c4\u5b9a\uff1a\u4f9d\u636e\u8d22\u653f\u90e8\u5173\u4e8e\u5370\u53d1\u300a\u653f\u5e9c\u91c7\u8d2d\u8fdb\u53e3\u4ea7\u54c1\u7ba1\u7406\u529e\u6cd5\u300b\u7684\u901a\u77e5\uff08\u8d22\u5e93\u30142007\u3015119\u53f7\uff09\u7684\u89c4\u5b9a\uff0c\u672c\u9879\u76ee\u4e0d\u5141\u8bb8\u8fdb\u53e3\u4ea7\u54c1\u53c2\u52a0\u6295\u6807\u3002</p><p style=\"text-indent:24.1pt;line-height:150%;\"><strong>\u51e1\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u7684\u6295\u6807\u4eba\uff0c\u987b\u63d0\u4f9b\u4ee5\u4e0b\u8d44\u6599\u6587\u4ef6\uff1a</strong></p><ol><li value=\"NaN\"><strong>\u6709\u6548\u7684\u8425\u4e1a\u6267\u7167\u6216\u6cd5\u4eba\u8bc1\u4e66\u7b49\u8bc1\u660e\u6587\u4ef6\uff08\u590d\u5370\u4ef6\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\uff09\uff0c\u4ee5\u81ea\u7136\u4eba\u8eab\u4efd\u6295\u6807\u7684\u643a\u5e26\u81ea\u7136\u4eba\u7684\u8eab\u4efd\u8bc1\u660e\uff08\u590d\u5370\u4ef6\uff09\uff1b</strong></li><li value=\"NaN\"><strong>\u6cd5\u4eba\u6388\u6743\u59d4\u6258\u4e66\uff08\u539f\u4ef6\uff09\uff1b</strong></li><li value=\"NaN\"><strong>\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\uff08\u590d\u5370\u4ef6\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\uff09\u3002</strong></li></ol><p align=\"left\" style=\"text-indent:24pt;line-height:150%;\">\u672c\u516c\u544a\u540c\u65f6\u5728\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08http://www.ccgp.gov.cn\uff09\u3001\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08http://www.ccgp-beijing.gov.cn/\uff09\u4ee5\u53ca\u5317\u4eac\u6c47\u8bda\u91d1\u6865\u56fd\u9645\u62db\u6807\u6709\u9650\u516c\u53f8\u7f51\u7ad9\uff08http://www.hcjq.net/\uff09\u53d1\u5e03\uff0c\u516c\u544a\u671f\u9650\u4e3a5\u4e2a\u5de5\u4f5c\u65e5\u3002</p><p align=\"left\" style=\"line-height:150%;\">\u5176\u4ed6\u672a\u5c3d\u4e8b\u5b9c\u8be6\u89c1\u9644\u4ef6</p><p align=\"left\" style=\"line-height:150%;\"></p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p align=\"left\" style=\"line-height:150%;\">1\u3001\u8282\u80fd\u4ea7\u54c1\u5f3a\u5236\u91c7\u8d2d</p><p align=\"left\" style=\"line-height:150%;\">2\u3001\u8282\u80fd\u4ea7\u54c1\u3001\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u4f18\u5148\u91c7\u8d2d</p><p align=\"left\" style=\"line-height:150%;\">3\u3001\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55</p><p align=\"left\" style=\"line-height:150%;\">4\u3001\u653f\u5e9c\u91c7\u8d2d\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55</p><p align=\"left\" style=\"line-height:150%;\">5\u3001\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a</p><p align=\"left\" style=\"line-height:150%;\">6\u3001\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd</p><p style=\"margin-left:84.0pt;text-indent:-84.0pt;line-height:150%;\">7\u3001\u8fdb\u53e3\u4ea7\u54c1\u7ba1\u7406</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                        