{"title": "[\u516c\u5f00]\u5317\u4eac\u5e02\u57ce\u5e02\u9053\u8def\u517b\u62a4\u7ba1\u7406\u4e2d\u5fc32018\u5e74\u57ce\u5e02\u9053\u8def\u5927\u4fee\u6297\u88c2\u9632\u6ed1\u6ca5\u9752\u8def\u9762\u8bbe\u8ba1\u53ca\u65bd\u5de5\u5173\u952e\u6280\u672f\u7814\u7a76\u4e0e\u5e94\u7528\uff08\u4ea4\u901a\u79d1\u6280\uff09\u4e8c\u6b21\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u4eac\u535a\u901a\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u57ce\u5e02\u9053\u8def\u517b\u62a4\u7ba1\u7406\u4e2d\u5fc3\u7684\u59d4\u6258\uff0c\u5c312018\u5e74\u57ce\u5e02\u9053\u8def\u5927\u4fee\u6297\u88c2\u9632\u6ed1\u6ca5\u9752\u8def\u9762\u8bbe\u8ba1\u53ca\u65bd\u5de5\u5173\u952e\u6280\u672f\u7814\u7a76\u4e0e\u5e94\u7528\uff08\u4ea4\u901a\u79d1\u6280\uff09\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0170104230180726004\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0170104230180726004</p><p>\u9879\u76ee\u540d\u79f0\uff1a2018\u5e74\u57ce\u5e02\u9053\u8def\u5927\u4fee\u6297\u88c2\u9632\u6ed1\u6ca5\u9752\u8def\u9762\u8bbe\u8ba1\u53ca\u65bd\u5de5\u5173\u952e\u6280\u672f\u7814\u7a76\u4e0e\u5e94\u7528\uff08\u4ea4\u901a\u79d1\u6280\uff09</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5218\u5b87</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-53703795</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u57ce\u5e02\u9053\u8def\u517b\u62a4\u7ba1\u7406\u4e2d\u5fc3</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5357\u4e09\u73af\u897f\u8def19 \u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a010-83518291</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p style=\"line-height: 150%;\">\u7b80\u8981\u6280\u672f\u8981\u6c42/\u62db\u6807\u9879\u76ee\u7684\u6027\u8d28\uff1a</p><p style=\"line-height: 150%;\">\u901a\u8fc7\u62db\u6807\u65b9\u5f0f\u786e\u5b9a\u9879\u76ee\u5b9e\u65bd\u5355\u4f4d\uff1a</p><p style=\"line-height: 150%;\">\uff081\uff09\u521b\u65b0\u70b9\uff1a</p><p style=\"line-height: 150%;\">\u2460\u57fa\u4e8e\u526a\u5207\u75b2\u52b3\u7684\u6ca5\u9752\u8def\u9762\u5f00\u88c2\u673a\u7406\u4e0e\u6210\u56e0\u5206\u6790\uff1b</p><p style=\"line-height: 150%;\">\u2461\u5317\u4eac\u5e02\u4e3b\u5e72\u9053\u6ca5\u9752\u8def\u9762\u6297\u6ed1\u3001\u6297\u5f00\u88c2\u4e0e\u6297\u8f66\u8f99\u6027\u80fd\u5e73\u8861\u6280\u672f\u8981\u6c42\u4ee5\u53ca</p><p style=\"line-height: 150%;\">\u5178\u578b\u8def\u9762\u6750\u6599\u4e0e\u8def\u9762\u7ed3\u6784\uff1b</p><p style=\"line-height: 150%;\">\u2462\u57fa\u4e8e\u957f\u671f\u6027\u80fd\u7684\u8def\u9762\u7ed3\u6784\u5c42\u95f4\u5904\u6cbb\u63aa\u65bd\u4e0e\u5de5\u827a\uff1b</p><p style=\"line-height: 150%;\">\u2463\u6297\u88c2\u9632\u6ed1\u8def\u9762\u8bbe\u8ba1\u6307\u5357\u4e0e\u65bd\u5de5\u89c4\u7a0b\u3002</p><p style=\"line-height: 150%;\">\uff082\uff09\u4e3b\u8981\u7814\u7a76\u5185\u5bb9\uff1a</p><p style=\"line-height: 150%;\">\u672c\u9879\u76ee\u901a\u8fc7\u8c03\u7814\u3001\u8bd5\u9a8c\u3001\u5206\u6790\u7b49\u624b\u6bb5\uff0c\u4ece\u6750\u6599\u6280\u672f\u8981\u6c42\u4e0e\u9009\u62e9\u3001\u7ed3\u6784\u7ec4\u5408\u8bbe\u8ba1\u3001\u5c42\u95f4\u5904\u6cbb\u6280\u672f\u53ca\u65bd\u5de5\u7b49\u65b9\u9762\uff0c\u6df1\u5165\u5206\u6790\u5f00\u88c2\u53ca\u8f66\u8f99\u4ea7\u751f\u7684\u4e3b\u8981\u539f\u56e0\uff0c\u5e76\u5bf9\u6297\u5f00\u88c2\u4e0e\u6297\u8f66\u8f99\u6027\u80fd\u8fdb\u884c\u5e73\u8861\u8bbe\u8ba1\uff0c\u7531\u6b64\u63d0\u51fa\u7ecf\u6d4e\u6709\u6548\u7684\u517b\u62a4\u8bbe\u8ba1\u65b9\u6848\u4e0e\u5177\u6709\u9488\u5bf9\u6027\u7684\u8bbe\u8ba1\u65b9\u6848\u548c\u65bd\u5de5\u6307\u5357\uff0c\u4ee5\u6307\u5bfc\u9053\u8def\u5927\u4fee\uff0c\u63d0\u9ad8\u8def\u9762\u7684\u6297\u75c5\u5bb3\u80fd\u529b\uff0c\u8282\u7ea6\u517b\u62a4\u6210\u672c\uff0c\u63d0\u9ad8\u9053\u8def\u7684\u8212\u9002\u6027\u53ca\u5b89\u5168\u6027\u3002</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u4eac\u535a\u901a\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u5317\u82d1\u8def13\u53f7\u9662\u9886\u5730A\u5ea7502\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a010-53703795</p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670806\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a156.1000000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><p style=\"line-height: 150%;\">\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p style=\"line-height: 150%;\">\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\uff1a\u5317\u4eac\u5efa\u7b51\u5927\u5b66</p><p style=\"line-height: 150%;\">\u4e2d\u6807\u4f9b\u5e94\u5546\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5c55\u89c8\u9986\u8def1\u53f7</p><p style=\"line-height: 150%;\">\u4e2d\u6807\u91d1\u989d\uff1a\u4eba\u6c11\u5e01156.1\u4e07\u5143\u6574</p><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.9488 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6;\u53c2\u8003\u56fd\u5bb6\u8ba1\u59d4\u4ef7\u683c[2002]1980\u53f7\u6587\u53ca\u53d1\u6539\u529e\u4ef7\u683c[2003]857\u53f7\u6587\u4ef6\u89c4\u5b9a\u6807\u51c6</p><p></p><p>\u8bc4\u5ba1\u4e13\u5bb6\u540d\u5355\uff1a</p><p>\u6bb5\u6587\u5fd7\u3001\u5f20\u7acb\u4e7e\u3001\u767d\u8363\u3001\u5de9\u6e58\u519b\u3001\u5468\u957f\u6b66</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</p><p></p><p style=\"line-height: 150%;\">1\u3001\u6210\u679c\uff1a\u57ce\u5e02\u9053\u8def\u5927\u4fee\u6297\u88c2\u9632\u6ed1\u6ca5\u9752\u8def\u9762\u8bbe\u8ba1\u4e0e\u65bd\u5de5\u5173\u952e\u6280\u672f\u53ca\u8bbe\u8ba1\u4e0e\u65bd</p><p style=\"line-height: 150%;\">\u5de5\u6307\u5357</p><p style=\"line-height: 150%;\">2\u3001\u77e5\u8bc6\u4ea7\u6743\uff1a\u7f16\u5199\u8bbe\u8ba1\u6307\u53571\u90e8\uff1b\u7f16\u5199\u65bd\u5de5\u89c4\u7a0b1\u90e8\uff1b\u53d1\u8868\u5b66\u672f\u8bba\u65872\u7bc7\uff1b</p><p style=\"line-height: 150%;\">\u7533\u8bf7\u56fd\u5bb6\u53d1\u660e\u4e13\u52292\u9879\u3002</p><p></p><p><strong>\u516d\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p>    <p></p>     <p></p>       <p></p> <p></p> <p></p>       <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         