{"title": "[\u516c\u5f00]\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6-\u57fa\u7840\u8bbe\u65bd\u6539\u9020-2018\u5e74\u5317\u4eac\u6559\u80b2\u7f51\u7edc\u548c\u4fe1\u606f\u4e2d\u5fc3\u529e\u516c\u533a\u6d88\u9632\u6539\u9020\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6cfd\u5cb1\u62db\u6807\u4ee3\u7406\u6709\u9650\u8d23\u4efb\u516c\u53f8\u53d7\u5317\u4eac\u6559\u80b2\u7f51\u7edc\u548c\u4fe1\u606f\u4e2d\u5fc3\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6-\u57fa\u7840\u8bbe\u65bd\u6539\u9020-2018\u5e74\u5317\u4eac\u6559\u80b2\u7f51\u7edc\u548c\u4fe1\u606f\u4e2d\u5fc3\u529e\u516c\u533a\u6d88\u9632\u6539\u9020\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6-\u57fa\u7840\u8bbe\u65bd\u6539\u9020-2018\u5e74\u5317\u4eac\u6559\u80b2\u7f51\u7edc\u548c\u4fe1\u606f\u4e2d\u5fc3\u529e\u516c\u533a\u6d88\u9632\u6539\u9020</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000014257180906187</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u674e\u5973\u58eb</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-88856410</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u6559\u80b2\u7f51\u7edc\u548c\u4fe1\u606f\u4e2d\u5fc3</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u5730\u5b89\u95e8\u897f\u5927\u8857153\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-66521101</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u6cfd\u5cb1\u62db\u6807\u4ee3\u7406\u6709\u9650\u8d23\u4efb\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a010-88856410</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u671d\u9633\u533a\u5b89\u5916\u5c0f\u5173\u5317\u91cc43\u53f7\u6e14\u9633\u7f6e\u4e1a\u5927\u53a6B\u5ea77\u5c42708</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p>\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\uff1a\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6-2018\u5e74\u5317\u4eac\u6559\u80b2\u7f51\u7edc\u548c\u4fe1\u606f\u4e2d\u5fc3\u529e\u516c\u533a\u6d88\u9632\u6539\u9020</p><p>\u6570\u91cf\uff1a1</p><p><span style='font-family: \u5b8b\u4f53; font-size: 10.5pt; mso-bidi-font-family: \"Times New Roman\"; mso-font-kerning: 1.0pt; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;'><font color=\"#000000\">\u91c7\u8d2d\u7528\u9014\uff1a\u57fa\u7840\u8bbe\u65bd\u6539\u9020</font></span></p><p>\u62db\u6807\u8303\u56f4\uff1a\u56fe\u7eb8\u53ca\u5de5\u7a0b\u91cf\u6e05\u5355\u6240\u793a\u6d88\u9632\u5de5\u7a0b</p><p>\u8be6\u89c1\u9644\u4ef6\u3002</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>\uff081\uff09\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u6ce8\u518c\uff0c\u80fd\u591f\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\uff0c\u6709\u670d\u52a1\u80fd\u529b\u7684\u672c\u56fd\u4f9b\u5e94\u5546\uff0c\u5305\u62ec\u6cd5\u4eba\u3001\u5176\u4ed6\u7ec4\u7ec7\u3001\u81ea\u7136\u4eba\u3002\uff082\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b\uff083\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b\uff084\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b\uff085\uff09\u53c2\u52a0\u672c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b\uff086\uff09\u5355\u4f4d\u8d1f\u8d23\u4eba\u4e3a\u540c\u4e00\u4eba\u6216\u8005\u5b58\u5728\u63a7\u80a1\u3001\u7ba1\u7406\u5173\u7cfb\u7684\u4e0d\u540c\u5355\u4f4d\uff0c\u4e0d\u5f97\u53c2\u52a0\u540c\u4e00\u5305\u6295\u6807\u6216\u8005\u672a\u5212\u5206\u5305\u7684\u540c\u4e00\u9879\u76ee\uff1b                                                                   \uff087\uff09\u6839\u636e\u8d22\u653f\u90e8\u8d22\u5e93\u30142016\u3015125\u53f7\u300a\u8d22\u653f\u90e8\u8981\u6c42\u52a0\u5f3a\u653f\u91c7\u4fe1\u7528\u8bb0\u5f55\u67e5\u8be2\u53ca\u4f7f\u7528\u300b\u6587\u4ef6\u76f8\u5173\u89c4\u5b9a\uff0c\u6295\u6807\u4eba\u4e0d\u5f97\u4e3a\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u4e2d\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u548c\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u7684\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u4e3a\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.gov.cn\uff09\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u4e2d\u88ab\u8d22\u653f\u90e8\u95e8\u7981\u6b62\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u7684\u6295\u6807\u4eba\uff1b\uff088\uff09\u6295\u6807\u7533\u8bf7\u4eba\u5fc5\u987b\u5177\u5907\u5efa\u7b51\u88c5\u4fee\u88c5\u9970\u5de5\u7a0b\u4e13\u4e1a\u627f\u5305\u4e8c\u7ea7\u53ca\u4ee5\u4e0a\u6216\u5efa\u7b51\u88c5\u9970\u88c5\u4fee\u5de5\u7a0b\u8bbe\u8ba1\u4e0e\u65bd\u5de5\u4e09\u7ea7\u53ca\u4ee5\u4e0a\u8d44\u8d28\uff1b \uff089\uff09\u9879\u76ee\u7ecf\u7406\uff1a\u53d7\u8058\u4e8e\u6295\u6807\u7533\u8bf7\u4eba\u7684\u5df2\u53d6\u5f97\u5efa\u7b51\u5de5\u7a0b\u4e13\u4e1a\u4e8c\u7ea7\u5efa\u9020\u5e08\u6267\u4e1a\u8d44\u683c\u3001\u6709\u6548\u7684\u5b89\u5168\u751f\u4ea7\u8003\u6838\u5408\u683c\u8bc1\u4e66\uff08B\u672c\uff09\uff0c\u4e14\u6ce8\u518c\u8bc1\u4e66\u5728\u6709\u6548\u671f\u5185\u7684\u4eba\u5458\uff1b\uff0810\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\uff1b\uff0811\uff09\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a56.525792 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:30\u81f32018\u5e7410\u670812\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u5c0f\u5173\u5317\u91cc\u753243\u53f7\u6e14\u9633\u7f6e\u4e1a\u5927\u53a6B\u5ea77\u5c42708</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u62a5\u540d\u65f6\u6240\u9700\u643a\u5e26\u8d44\u6599\uff1a\uff081\uff09\u6709\u6548\u7684\u8425\u4e1a\u6267\u7167\u526f\u672c\uff08\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\uff09\uff1b\uff082\uff09\u6cd5\u4eba\u6388\u6743\u4e66\uff08\u539f\u4ef6\uff09\u53ca\u6cd5\u4eba\u8eab\u4efd\u8bc1\uff08\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\uff09\u3001\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\uff08\u539f\u4ef6\u53ca\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\uff09</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u671d\u9633\u533a\u5c0f\u5173\u5317\u91cc\u753243\u53f7\u6e14\u9633\u7f6e\u4e1a\u5927\u53a6B\u5ea77\u5c42708</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p><span style='font-family: \u5b8b\u4f53; font-size: 10.5pt; mso-bidi-font-family: \"Times New Roman\"; mso-font-kerning: 1.0pt; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-bidi-font-size: 10.0pt;'><font color=\"#000000\">\u516c\u544a\u671f\u9650\uff1a\u81ea\u516c\u544a\u53d1\u5e03\u4e4b\u65e5\u8d77<span lang=\"EN-US\">5</span>\u4e2a\u5de5\u4f5c\u65e5\u3002</font></span></p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p align=\"left\" style=\"text-align: left; line-height: 150%; text-indent: 10.5pt;\">1\uff09\u300a\u8d22\u653f\u90e8\u5173\u4e8e\u5f00\u5c55\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\u8bd5\u70b9\u5de5\u4f5c\u65b9\u6848\u300b\uff08\u8d22\u5e93\u30102011\u3011124\u53f7\uff09</p><p align=\"left\" style=\"text-align: left; line-height: 150%; text-indent: 10.5pt;\">2\uff09\u300a\u8d22\u653f\u90e8\u5173\u4e8e\u5728\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u4e2d\u67e5\u8be2\u53ca\u4f7f\u7528\u4fe1\u7528\u8bb0\u5f55\u6709\u5173\u95ee\u9898\u7684\u901a\u77e5\u300b\uff08\u8d22\u5e93\u30102016\u3011125\u53f7\uff09</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         