{"title": "[\u5927\u5174]\u5317\u4eac\u5efa\u7b51\u5927\u5b66\u9644\u5c5e\u4e2d\u5b66\u5316\u5b66\u6570\u5b57\u5316\u5b9e\u9a8c\u5ba4\u5efa\u8bbe\u9879\u76ee\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u534e\u91c7\u62db\u6807\u4ee3\u7406\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5efa\u7b51\u5927\u5b66\u9644\u5c5e\u4e2d\u5b66\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5317\u4eac\u5efa\u7b51\u5927\u5b66\u9644\u5c5e\u4e2d\u5b66\u5316\u5b66\u6570\u5b57\u5316\u5b9e\u9a8c\u5ba4\u5efa\u8bbe\u9879\u76ee\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4eac\u5efa\u7b51\u5927\u5b66\u9644\u5c5e\u4e2d\u5b66\u5316\u5b66\u6570\u5b57\u5316\u5b9e\u9a8c\u5ba4\u5efa\u8bbe\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>HCZB-2018-ZB0851</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5d14\u4e3d\u6d01\u3001\u5019\u6708\u9e4f\u3001\u5218\u5411\u524d</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-63509799-811</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5efa\u7b51\u5927\u5b66\u9644\u5c5e\u4e2d\u5b66</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u5927\u5174\u533a\u9ec4\u6751\u9547\u7ea2\u697c\u897f\u5df720\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-69244464</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u534e\u91c7\u62db\u6807\u4ee3\u7406\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u5d14\u4e3d\u6d01\u3001\u5019\u6708\u9e4f\u3001\u5218\u5411\u524d  010-63509799-811</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5e7f\u5b89\u8def9\u53f7\u56fd\u6295\u8d22\u5bcc\u5e7f\u573a6\u53f7\u697c1518\u5ba4</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p>\u5316\u5b66\u6570\u5b57\u5316\u5b9e\u9a8c\u5ba4\u5efa\u8bbe\uff08\u5177\u4f53\u8be6\u89c1\u62db\u6807\u6587\u4ef6\u7b2c\u56db\u7ae0\u6280\u672f\u9700\u6c42\uff09</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>\u6295\u6807\u4eba\u8d44\u683c\u8981\u6c42:\uff081\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b\uff082\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b\uff083\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b\uff084\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b\uff085\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b\uff086\uff09\u6295\u6807\u4eba\u5fc5\u987b\u4e3a\u672a\u88ab\u5217\u5165\u4fe1\u7528\u4e2d\u56fd\u7f51\u7ad9( www.creditchina.gov.cn)\u3001\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51( www.ccgp.gov.cn)\u6e20\u9053\u4fe1\u7528\u8bb0\u5f55\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u7684\u54cd\u5e94\u4eba\uff1b\uff087\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\uff1b\uff088\uff09\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a101.8418 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 16:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5e7f\u5b89\u8def9\u53f7\u56fd\u6295\u8d22\u5bcc\u5e7f\u573a6\u53f7\u697c1518\u5ba4</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5e7f\u5b89\u8def9\u53f7\u56fd\u6295\u8d22\u5bcc\u5e7f\u573a6\u53f7\u697c1502\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u8282\u80fd\u4ea7\u54c1\u5f3a\u5236\u91c7\u8d2d\uff1b\u8282\u80fd\u4ea7\u54c1\u3001\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u4f18\u5148\u91c7\u8d2d\uff1b\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\uff1b\u653f\u5e9c\u91c7\u8d2d\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\uff1b\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a\uff1b\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\uff1b\u8fdb\u53e3\u4ea7\u54c1\u7ba1\u7406\u7b49\u3002</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   