{"title": "[\u4e1c\u57ce]\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u4eba\u6c11\u653f\u5e9c\u5929\u575b\u8857\u9053\u529e\u4e8b\u5904\u5929\u575b\u8857\u9053\u91d1\u9c7c\u6c60\u4e1c\u533a\u73af\u5883\u63d0\u5347\u9879\u76ee\uff08\u76d1\u7406\uff09\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u4eba\u6c11\u653f\u5e9c\u5929\u575b\u8857\u9053\u529e\u4e8b\u5904\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5929\u575b\u8857\u9053\u91d1\u9c7c\u6c60\u4e1c\u533a\u73af\u5883\u63d0\u5347\u9879\u76ee\uff08\u76d1\u7406\uff09\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5929\u575b\u8857\u9053\u91d1\u9c7c\u6c60\u4e1c\u533a\u73af\u5883\u63d0\u5347\u9879\u76ee\uff08\u76d1\u7406\uff09</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>ZRDX-BJGP-201809032</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u4ed8\u5973\u58eb</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-87150241\u8f6c8706</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u4eba\u6c11\u653f\u5e9c\u5929\u575b\u8857\u9053\u529e\u4e8b\u5904</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u897f\u8349\u5e02\u885774\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-52171025</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u4ed8\u5973\u58eb 010-87150241\u8f6c8706</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p>\u8be6\u89c1\u9644\u4ef6</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>\uff081\uff09\u6295\u6807\u4eba\u5fc5\u987b\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u4e4b\u89c4\u5b9a\uff1b\uff082\uff09\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u5408\u6cd5\u6ce8\u518c\u7684\uff0c\u5177\u6709\u72ec\u7acb\u6cd5\u4eba\u8d44\u683c\uff0c\u8425\u4e1a\u6267\u7167\u5408\u683c\u6709\u6548\uff1b \uff083\uff09\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u5e94\u7b26\u5408\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u89c4\u5b9a\u7684\u76f8\u5e94\u6280\u672f\u3001\u8282\u80fd\u3001\u5b89\u5168\u3001\u73af\u4fdd\u6807\u51c6\uff1b\u5982\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u5bf9\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u6709\u5f3a\u5236\u6027\u89c4\u5b9a\u6216\u8981\u6c42\u7684\uff0c\u5219\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u5fc5\u987b\u7b26\u5408\u76f8\u5e94\u89c4\u5b9a\u6216\u8981\u6c42\uff1b \uff084\uff09\u5728\u6cd5\u5f8b\u4e0a\u548c\u8d22\u52a1\u4e0a\u72ec\u7acb\u3001\u5408\u6cd5\u8fd0\u4f5c\u5e76\u72ec\u7acb\u4e8e\u91c7\u8d2d\u4eba\u548c\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4e4b\u5916\uff1b \uff085\uff09\u6295\u6807\u4eba\u987b\u5177\u5907\u623f\u5c4b\u5efa\u7b51\u5de5\u7a0b\u76d1\u7406\u7532\u7ea7\u8d44\u8d28\uff0c\u9879\u76ee\u8d1f\u8d23\u4eba\u987b\u5177\u5907\u6ce8\u518c\u76d1\u7406\u5de5\u7a0b\u5e08\u8d44\u683c\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a8.582525 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 17:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8417A\u5ba4 \uff08\u5730\u94c1\u4e94\u53f7\u7ebf\u3001\u5341\u53f7\u7ebf\u3001\u4ea6\u5e84\u7ebf\u5b8b\u5bb6\u5e84\u7ad9E\u51fa\u53e3\uff0c\u5de6\u884c10\u7c73\uff09</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 13:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 13:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533aF419B\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u7b2c\u4e8c\u4f1a\u8bae\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin-left:21.0pt;text-indent:-21.0pt;\">\u67e5\u9605\u3001\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5747\u987b\u7531\u6cd5\u4eba\u6388\u6743\u4ee3\u8868\u63d0\u4ea4\u4ee5\u4e0b\u8d44\u6599<strong>\uff08\u590d\u5370\u4ef6\u987b\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\uff09</strong>\uff1a</p><p style=\"margin-left:36.75pt;text-indent:-26.25pt;\">\uff081\uff09 \u8425\u4e1a\u6267\u7167\u526f\u672c\u590d\u5370\u4ef6\uff1b</p><p style=\"text-indent:10.5pt;\">\uff082\uff09 \u6cd5\u4eba\u6388\u6743\u59d4\u6258\u4e66\uff08\u539f\u4ef6\uff09\uff1b</p><p style=\"text-indent:10.5pt;\">\uff083\uff09 \u672c\u4eba\u8eab\u4efd\u8bc1\u539f\u4ef6\u53ca\u590d\u5370\u4ef6\uff1b</p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p style=\"text-indent:15.75pt;\">\uff081\uff09\u8282\u80fd\u4ea7\u54c1\u5f3a\u5236\u91c7\u8d2d\uff1b\uff082\uff09\u8282\u80fd\u4ea7\u54c1\u3001\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u4f18\u5148\u91c7\u8d2d\uff1b\uff083\uff09\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\uff1b</p><p> \uff084\uff09\u653f\u5e9c\u91c7\u8d2d\u9879\u76ee\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\uff1b\uff085\uff09\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\uff1b\uff086\uff09\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              