{"title": "[\u4e30\u53f0]\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u804c\u4e1a\u6559\u80b2\u4e2d\u5fc3\u5b66\u6821\u5b89\u5168\u9690\u60a3\u4fee\u7f2e\u9879\u76ee\u7ade\u4e89\u6027\u78cb\u5546", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u804c\u4e1a\u6559\u80b2\u4e2d\u5fc3\u5b66\u6821\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u804c\u4e1a\u6559\u80b2\u4e2d\u5fc3\u5b66\u6821\u5b89\u5168\u9690\u60a3\u4fee\u7f2e\u9879\u76ee\u8fdb\u884c\u7ade\u4e89\u6027\u78cb\u5546\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u804c\u4e1a\u6559\u80b2\u4e2d\u5fc3\u5b66\u6821\u5b89\u5168\u9690\u60a3\u4fee\u7f2e\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>ZRDX-BJGP-201809016</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u97e9\u5148\u751f</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-87150241-8707</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u804c\u4e1a\u6559\u80b2\u4e2d\u5fc3\u5b66\u6821</p><p></p>  <p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u65b9\u5e84\u82b3\u53e4\u56ed\u4e8c\u533a9\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a010-67610944</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u97e9\u5148\u751f  010-87150241-8707</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a417A</p><p></p>       <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p>\u8be6\u89c1\u9644\u4ef6</p><p><strong>\u4e8c\u3001\u5bf9\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\uff08\u4f9b\u5e94\u5546\u8d44\u683c\u6761\u4ef6\uff09:</strong></p><p>1)\u9879\u76ee\u7ecf\u7406\u5230\u573a\u62a5\u540d(\u643a\u5e26\u9879\u76ee\u7ecf\u7406\u5e94\u4e3a\u53d7\u8058\u4e8e\u6295\u6807\u4eba\u7684\u5df2\u53d6\u5f97\u5efa\u7b51\u5de5\u7a0b\u4e8c\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u5efa\u9020\u5e08\u6ce8\u518c\u8bc1\u4e66\u4ee5\u53ca(\u7b80\u79f0B\u672c),\u52b3\u52a1\u5408\u540c,\u793e\u4fdd)2)\u6295\u6807\u4eba\u5177\u6709\u5efa\u7b51\u88c5\u4fee\u88c5\u9970\u5de5\u7a0b\u4e13\u4e1a\u627f\u5305\u4e8c\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u8d44\u8d283\uff09\u6295\u6807\u4eba\u5177\u6709\u300a\u5efa\u7b51\u65bd\u5de5\u5b89\u5168\u751f\u4ea7\u8bb8\u53ef\u8bc1\u300b4\uff09\u5982\u679c\u662f\u5916\u7701\u5e02\u4f01\u4e1a\u987b\u5728\u5317\u4eac\u5e02\u4f4f\u623f\u57ce\u4e61\u5efa\u8bbe\u59d4\u529e\u7406\u8fdb\u4eac\u5907\u6848\u5e76\u83b7\u5f97\u300a\u5317\u4eac\u5e02\u5efa\u7b51\u4f01\u4e1a\u6863\u6848\u7ba1\u7406\u624b\u518c\u300b5\uff09\u6295\u6807\u4eba\u7ecf\u8425\u72b6\u6001:\u5728\u8fd1\u4e09\u5e74\uff082015\u5e741\u6708\u81f3\u4eca\uff09\u5185\u6ca1\u6709\u9a97\u53d6\u4e2d\u6807\u548c\u4e25\u91cd\u8fdd\u7ea6\u53ca\u91cd\u5927\u5de5\u7a0b\u8d28\u91cf\u95ee\u9898\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff0c\u6ca1\u6709\u5904\u4e8e\u88ab\u8d23\u4ee4\u505c\u4e1a\uff0c\u6295\u6807\u8d44\u683c\u88ab\u53d6\u6d88\uff0c\u8d22\u4ea7\u88ab\u63a5\u7ba1\u3001\u51bb\u7ed3\uff0c\u7834\u4ea7\u72b6\u6001\uff1b6\uff09\u6295\u6807\u4eba\u5fc5\u987b\u5177\u6709\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b7\uff09\u6295\u6807\u4eba\u5fc5\u987b\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b8\uff09\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u5e94\u7b26\u5408\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u89c4\u5b9a\u7684\u76f8\u5e94\u6280\u672f\u3001\u8282\u80fd\u3001\u5b89\u5168\u548c\u73af\u4fdd\u6807\u51c6\uff1b\u5982\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u5bf9\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u6709\u5f3a\u5236\u6027\u89c4\u5b9a\u6216\u8981\u6c42\u7684\uff0c\u5219\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u5fc5\u987b\u7b26\u5408\u76f8\u5e94\u89c4\u5b9a\u6216\u8981\u6c42\uff1b9\uff09\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u5408\u6cd5\u6ce8\u518c\u7684\uff0c\u80fd\u591f\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\uff0c\u7ec4\u7ec7\u673a\u6784\u4ee3\u7801\u8bc1\u6709\u6548\u3001\u8425\u4e1a\u6267\u7167\u3001\u5728\u6cd5\u5f8b\u4e0a\u548c\u8d22\u52a1\u4e0a\u72ec\u7acb\u3001\u5408\u6cd5\u8fd0\u4f5c\u5e76\u72ec\u7acb\u4e8e\u91c7\u8d2d\u4eba\u548c\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4e4b\u5916\uff1b\u6295\u6807\u4eba\u5177\u6709\u826f\u597d\u7684\u8d22\u52a1\u72b6\u51b5\u548c\u8f83\u9ad8\u7684\u4fe1\u8a89\uff0c\u6240\u63d0\u4f9b\u7684\u4ea7\u54c1\u5fc5\u987b\u6709\u826f\u597d\u7684\u58f0\u8a89\u548c\u4e1a\u7ee9\uff1b10\uff09\u6295\u6807\u4eba\u5fc5\u987b\u5411\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\uff0c\u672a\u7ecf\u5411\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6f5c\u5728\u6295\u6807\u4eba\u5747\u65e0\u8d44\u683c\u53c2\u52a0\u672c\u6b21\u6295\u6807\u3002\uff08\u903e\u671f\u7684\u6295\u6807\u6587\u4ef6\u5c06\u88ab\u62d2\u7edd\uff09\u300211\uff09\u6295\u6807\u4eba\u5fc5\u987b\u6ee1\u8db3\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u4e8c\u5341\u4e8c\u6761\u4e4b\u89c4\u5b9a\uff1b12) \u5bf9\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u548c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.gov.cn\uff09\u4e2d\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u53ca\u5176\u4ed6\u4e0d\u7b26\u540813\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\uff1b</p><p></p><p><strong>\u4e09\u3001\u78cb\u5546\u548c\u54cd\u5e94\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9\u7b49:</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a228.506402 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 09:00</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 17:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a417A\u5ba4</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70</p><p>\u78cb\u5546\u6587\u4ef6\u552e\u4ef7\uff1a2000.0  \u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 09:00\u81f32018\u5e7410\u670816\u65e5 09:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9\uff1a\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\uff08\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a\u7b2c\u4e00\u4f1a\u8bae\u5ba4\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 09:00</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9\uff1a\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\uff08\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5b8b\u5bb6\u5e84\u4ea4\u901a\u67a2\u7ebd\u56db\u5c42\u4e09\u533a\u7b2c\u4e00\u4f1a\u8bae\u5ba4\uff09</p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p align=\"left\" style=\"line-height:150%;\">\u67e5\u9605\u53ca\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u987b\u7531\u5176\u6cd5\u4eba\u6388\u6743\u4ee3\u8868\u643a\u5e26\u4ee5\u4e0b\u6295\u6807\u7533\u8bf7\u8d44\u6599:</p><p align=\"left\" style=\"line-height:150%;\">\u52a0\u76d6\u4f9b\u5e94\u5546\u516c\u7ae0\u7684\u6709\u6548\u8425\u4e1a\u6267\u7167\uff0c\u7ec4\u7ec7\u673a\u6784\u4ee3\u7801\uff08\u53d6\u5f97\u201c\u4e09\u8bc1\u5408\u4e00\u201d\u8425\u4e1a\u6267\u7167\u7684\u9664\u5916\uff09\uff0c\u7a0e\u52a1\u767b\u8bb0\u8bc1\uff08\u53d6\u5f97\u201c\u4e09\u8bc1\u5408\u4e00\u201d\u8425\u4e1a\u6267\u7167\u7684\u9664\u5916\uff09\uff0c\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u4e66\uff0c\u672c\u4eba\u8eab\u4efd\u8bc1\u590d\u5370\u4ef6\u7b49\u5e76\u88c5\u8ba2\u6210\u518c\u3002\uff08\u62a5\u540d\u65f6\u4ee5\u4e0a\u8d44\u683c\u6587\u4ef6\u643a\u5e26\u8eab\u4efd\u8bc1\u539f\u4ef6\u548c\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u4e66\u539f\u4ef6\u53ca\u52a0\u76d6\u516c\u7ae0\u7684\u590d\u5370\u4ef6\u5404\u4e00\u4efd\uff0c\u8eab\u4efd\u8bc1\u539f\u4ef6\u73b0\u573a\u5ba1\u67e5\u540e\u5f52\u8fd8\uff0c\u590d\u5370\u4ef6\u62db\u6807\u516c\u53f8\u7559\u5b58\u3002\uff09</p><p align=\"left\" style=\"line-height:150%;\">\u9879\u76ee\u5206\u4e3a4\u5305\uff0c\u6bcf\u5305\u552e\u4ef7\u4eba\u6c11\u5e01500\u5143\u3002</p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u97e9\u5148\u751f</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-87150241-8707</p><p></p><p><strong>\u516d\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u8be6\u89c1\u9644\u4ef6</p><p></p><p></p>    <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             