{"title": "[\u901a\u5dde]\u5317\u4eac\u5e02\u901a\u5dde\u533a\u673a\u5173\u4e8b\u52a1\u670d\u52a1\u4e2d\u5fc3\u533a\u673a\u5173\u4e8b\u52a1\u670d\u52a1\u4e2d\u5fc3\u5173\u4e8e\u533a\u8d22\u653f\u5c40\u7a7a\u8c03\u7cfb\u7edf\u5b89\u5168\u8282\u80fd\u6539\u9020\u5de5\u7a0b\u9879\u76ee(\u76d1\u7406)\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u4e2d\u57ce\u5efa\u534e\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u901a\u5dde\u533a\u673a\u5173\u4e8b\u52a1\u670d\u52a1\u4e2d\u5fc3\u7684\u59d4\u6258\uff0c\u5c31\u533a\u673a\u5173\u4e8b\u52a1\u670d\u52a1\u4e2d\u5fc3\u5173\u4e8e\u533a\u8d22\u653f\u5c40\u7a7a\u8c03\u7cfb\u7edf\u5b89\u5168\u8282\u80fd\u6539\u9020\u5de5\u7a0b\u9879\u76ee(\u76d1\u7406)\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1a2018ZCZB-209-1\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1a2018ZCZB-209-1</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u533a\u673a\u5173\u4e8b\u52a1\u670d\u52a1\u4e2d\u5fc3\u5173\u4e8e\u533a\u8d22\u653f\u5c40\u7a7a\u8c03\u7cfb\u7edf\u5b89\u5168\u8282\u80fd\u6539\u9020\u5de5\u7a0b\u9879\u76ee(\u76d1\u7406)</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u7530\u7f8e </p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a18310722163</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u901a\u5dde\u533a\u673a\u5173\u4e8b\u52a1\u670d\u52a1\u4e2d\u5fc3</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u901a\u5dde\u533a\u9648\u5217\u9986\u8def537\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u738b\u5de567162911 </p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p style=\"line-height: 115%; text-indent: 24pt; margin: 0cm 0.85pt 0pt 24.05pt; layout-grid-mode: char\">3\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u672c\u9879\u76ee\u5de5\u7a0b\u76d1\u7406\u6267\u884c\u300a\u5de5\u7a0b\u5efa\u8bbe\u76d1\u7406\u89c4\u7a0b\u300b\uff08DBJ01-41-2002\uff09\u3001\u56fd\u5bb6\u548c\u5317\u4eac\u5e02\u73b0\u884c\u7684\u6709\u5173\u89c4\u8303\u3001\u89c4\u7a0b\u548c\u6280\u672f\u6807\u51c6\u3002</p><p style=\"line-height: 115%; text-indent: 42pt; layout-grid-mode: char\">4\u3001\u62db\u6807\u9879\u76ee\u6027\u8d28\uff1a\u76d1\u7406</p><p style=\"line-height: 115%; text-indent: -48pt; margin: 0cm 0cm 0pt 48pt; layout-grid-mode: char\"> 5\u3001\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a\u6309\u7167\u62db\u6807\u6587\u4ef6\u8981\u6c42\u6267\u884c</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u4e2d\u57ce\u5efa\u534e\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u5915\u7167\u5bfa\u8857\u5bcc\u745e\u82d1\u5927\u53a6407\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u7530\u7f8e18310722163 </p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7408\u670823\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a16.7615000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><p style=\"line-height: 115%; text-indent: -48pt; margin: 0cm 0cm 0pt 48pt; layout-grid-mode: char\">\u4e2d\u6807\u4eba\uff1a\u4e2d\u56fd\u4e2d\u8f7b\u56fd\u9645\u5de5\u7a0b\u6709\u9650\u516c\u53f8</p><p style=\"line-height: 115%; text-indent: -48pt; margin: 0cm 0cm 0pt 48pt; layout-grid-mode: char\">\u4e2d\u6807\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u767d\u5bb6\u5e84\u4e1c\u91cc42\u53f7</p><p style=\"line-height: 115%; text-indent: -48pt; margin: 0cm 0cm 0pt 48pt; layout-grid-mode: char\">\u4e2d\u6807\u91d1\u989d: \u4eba\u6c11\u5e01\u58f9\u62fe\u9646\u4e07\u67d2\u4edf\u9646\u4f70\u58f9\u62fe\u4f0d\u5143\u6574</p><p style=\"line-height: 115%; text-indent: 132pt; margin: 0cm 0cm 2.5pt; layout-grid-mode: char\">(RMB167615.00\u5143)</p><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a0.3016 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u4f9d\u636e\u56fd\u5bb6\u8ba1\u59d4\u8ba1\u4ef7\u683c[2002]1980\u53f7\u6587\u4ef6\u8ba1\u53d6</p><p></p><p>\u8bc4\u5ba1\u4e13\u5bb6\u540d\u5355\uff1a</p><p>\u5218\u4e1c\u3001\u4efb\u6b63\u5b89 \u3001\u90b9\u4e1c\u6656 \u3001\u5f20\u6770 \u3001\u738b\u4e49\u82f1</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</p><p></p><p style=\"line-height: 115%; text-indent: 18pt; margin: 0cm 0.85pt 0pt 24.05pt; layout-grid-mode: char\">1\u3001\u62db\u6807\u5185\u5bb9:\u533a\u8d22\u653f\u5c40\u7a7a\u8c03\u7cfb\u7edf\u5b89\u5168\u8282\u80fd\u6539\u9020\uff08\u5177\u4f53\u4ee5\u5de5\u7a0b\u91cf\u6e05\u5355\u4e3a\u51c6\uff09</p><p style=\"line-height: 115%; text-indent: 24pt; margin: 0cm 0.85pt 0pt 24.05pt; layout-grid-mode: char\">2\u3001\u91c7\u8d2d\u7528\u9014\uff1a\u7528\u4e8e\u533a\u673a\u5173\u4e8b\u52a1\u670d\u52a1\u4e2d\u5fc3\u5173\u4e8e\u533a\u8d22\u653f\u5c40\u7a7a\u8c03\u7cfb\u7edf\u5b89\u5168\u8282\u80fd\u6539\u9020\u5de5\u7a0b\u9879\u76ee(\u76d1\u7406)</p><p></p><p><strong>\u516d\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p>\u4e2d\u6807