{"title": "[\u4e1c\u57ce]\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6559\u80b2\u7814\u7a76\u4e2d\u5fc3\u4e1c\u57ce\u533a\u6559\u80b2\u65e0\u7ebf\u7f51\u5efa\u8bbe\u4e8c\u671f\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6559\u80b2\u7814\u7a76\u4e2d\u5fc3\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u4e1c\u57ce\u533a\u6559\u80b2\u65e0\u7ebf\u7f51\u5efa\u8bbe\u4e8c\u671f\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u4e1c\u57ce\u533a\u6559\u80b2\u65e0\u7ebf\u7f51\u5efa\u8bbe\u4e8c\u671f</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>ZRDX-BJGP-201808017</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u4ed8\u5973\u58eb </p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-87150241-8706</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6559\u80b2\u7814\u7a76\u4e2d\u5fc3</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u5915\u7167\u5bfa\u885713\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-67142327</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u4e2d\u6da6\u8fbe\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u4ed8\u5973\u58eb 010-87150241-8706</p><p>\u4ee3\u7406\u673a\u6784\u573