{"title": "[\u6d77\u6dc0]\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4eba\u6c11\u653f\u5e9c\u6e05\u6cb3\u8857\u9053\u529e\u4e8b\u5904\u6e05\u6cb3\u5236\u5462\u5382\u529e\u516c\u697c\u4fee\u7f2e\u5de5\u7a0b\u7ade\u4e89\u6027\u78cb\u5546", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6cdb\u534e\u56fd\u91d1\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4eba\u6c11\u653f\u5e9c\u6e05\u6cb3\u8857\u9053\u529e\u4e8b\u5904\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u6e05\u6cb3\u5236\u5462\u5382\u529e\u516c\u697c\u4fee\u7f2e\u5de5\u7a0b\u8fdb\u884c\u7ade\u4e89\u6027\u78cb\u5546\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u6e05\u6cb3\u5236\u5462\u5382\u529e\u516c\u697c\u4fee\u7f2e\u5de5\u7a0b</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>FG-DLP-2018-0926</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u8d75\u4e95</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a88504133-8026</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4eba\u6c11\u653f\u5e9c\u6e05\u6cb3\u8857\u9053\u529e\u4e8b\u5904</p><p></p>  <p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u6e05\u6cb3\u5c0f\u8425\u897f\u8def20\u53f7\u6e05\u6cb3\u5927\u53a6</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u91d1\u8001\u5e08     82710710</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u6cdb\u534e\u56fd\u91d1\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u8d75\u4e95  88504133-8026</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u961c\u5916\u4eae\u7532\u5e971\u53f7\u6069\u6d4e\u897f\u56ed\u4ea7\u4e1a\u56ed16A106</p><p></p>       <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p>\u91c7\u8d2d\u6570\u91cf\uff1a1\u9879<br>\u7528\u9014\uff1a\u65bd\u5de5\u56fe\u7eb8\u8303\u56f4\u5185\u571f\u65b9\u5de5\u7a0b\u3001\u7ed3\u6784\u52a0\u56fa\u5de5\u7a0b\u3001\u9632\u6c34\u5de5\u7a0b\u3001\u6728\u88c5\u4fee\u5de5\u7a0b\u3001\u6cb9\u9970\u5f69\u7ed8\u5de5\u7a0b\u7b49\u65bd\u5de5\u5de5\u4f5c\u3002<br>\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u8d28\u91cf\u6807\u51c6\u5408\u683c\u3002</p><p><strong>\u4e8c\u3001\u5bf9\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\uff08\u4f9b\u5e94\u5546\u8d44\u683c\u6761\u4ef6\uff09:</strong></p><p>\uff081\uff09\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c22\u6761\u8981\u6c42\uff1b\uff082\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b\uff083\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b\uff084\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b\uff085\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b\uff086\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b\uff087\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\u3002\uff088\uff09\u4f9b\u5e94\u5546\u5e94\u540c\u65f6\u5177\u6709\u5efa\u7b51\u5de5\u7a0b\u65bd\u5de5\u603b\u627f\u5305\u4e09\u7ea7\u53ca\u4ee5\u4e0a\u8d44\u8d28\u548c\u6587\u7269\u4fdd\u62a4\u5de5\u7a0b\u4e8c\u7ea7\u53ca\u4ee5\u4e0a\u65bd\u5de5\u8d44\u8d28\uff0c\u9879\u76ee\u7ecf\u7406\u540c\u65f6\u5177\u6709\u5efa\u7b51\u5de5\u7a0b\u4e13\u4e1a\u4e8c\u7ea7\u53ca\u4ee5\u4e0a\u5efa\u9020\u5e08\u6ce8\u518c\u8bc1\u4e66\u548c\u5b89\u5168\u751f\u4ea7\u8003\u6838\u8bc1\u4e66\uff08B\u672c\uff09\uff1b\uff089\uff09\u4f9b\u5e94\u5546\u4e0d\u5f97\u4e3a\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u4e2d\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u548c\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u7684\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u4e3a\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.gov.cn\uff09\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u4e2d\u88ab\u8d22\u653f\u90e8\u95e8\u7981\u6b62\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u7684\u4f9b\u5e94\u5546\uff08\u5904\u7f5a\u51b3\u5b9a\u89c4\u5b9a\u7684\u65f6\u95f4\u548c\u5730\u57df\u8303\u56f4\u5185\uff09\u3002</p><p></p><p><strong>\u4e09\u3001\u78cb\u5546\u548c\u54cd\u5e94\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9\u7b49:</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a191.349695 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7410\u670818\u65e5 09:30</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e7410\u670801\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 17:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4e1c\u5317\u65fa\u5357\u8def29\u53f7\u96624\u53f7\u697c\uff08\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u653f\u52a1\u670d\u52a1\u7ba1\u7406\u529e\u516c\u5ba4\uff09\u4e94\u5c42\u7ade\u6807\u5ba41</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65b9\u5f0f\uff1a\u8bf7\u767b\u5f55\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u516c\u5171\u8d44\u6e90\u4ea4\u6613\u4fe1\u606f\u7f51 (http://ggzyjy.bjhd.gov.cn/)\u514d\u8d39\u4e0b\u8f7d</p><p>\u78cb\u5546\u6587\u4ef6\u552e\u4ef7\uff1a0.0  \u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u65f6\u95f4\uff1a2018\u5e7410\u670818\u65e5 09:00\u81f32018\u5e7410\u670818\u65e5 09:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4e1c\u5317\u65fa\u5357\u8def29\u53f7\u96624\u53f7\u697c\uff08\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u653f\u52a1\u670d\u52a1\u7ba1\u7406\u529e\u516c\u5ba4\uff09\u4e94\u5c42\u7ade\u6807\u5ba41</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7410\u670818\u65e5 09:30</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4e1c\u5317\u65fa\u5357\u8def29\u53f7\u96624\u53f7\u697c\uff08\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u653f\u52a1\u670d\u52a1\u7ba1\u7406\u529e\u516c\u5ba4\uff09\u4e94\u5c42\u7ade\u6807\u5ba41</p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u8d75\u4e95</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a88504133-8026</p><p></p><p><strong>\u516d\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p><span lang=\"EN\" style='color: rgb(51, 51, 51); font-family: \"Calibri\",\"sans-serif\"; font-size: 10.5pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \u5b8b\u4f53; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN; mso-fareast-language: ZH-C