{"title": "[\u671d\u9633]\u5317\u4eac\u5e02\u671d\u9633\u533a\u73af\u5883\u536b\u751f\u670d\u52a1\u4e2d\u5fc3\u7b2c\u4e00\u6e05\u6d01\u8f66\u8f86\u573a\u5927\u4ef6\u5783\u573e\u62db\u6807\u5927\u7bb1\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u91d1\u62db\u6807\u6709\u9650\u8d23\u4efb\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u671d\u9633\u533a\u73af\u5883\u536b\u751f\u670d\u52a1\u4e2d\u5fc3\u7b2c\u4e00\u6e05\u6d01\u8f66\u8f86\u573a\u7684\u59d4\u6258\uff0c\u5c31\u5927\u4ef6\u5783\u573e\u62db\u6807\u5927\u7bb1\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1a0773-1841GNOAHWGK2730\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1a0773-1841GNOAHWGK2730</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u5927\u4ef6\u5783\u573e\u62db\u6807\u5927\u7bb1</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u725b\u680b\u3001\u5f20\u5983\u3001\u90b9\u5bb6\u6052</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-68405027</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u73af\u5883\u536b\u751f\u670d\u52a1\u4e2d\u5fc3\u7b2c\u4e00\u6e05\u6d01\u8f66\u8f86\u573a</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u671d\u9633\u95e8\u5916\u4e1c\u9ad8\u4e95</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u674e\u541b  010-85763026</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p align=\"left\" style=\"text-align: left; line-height: 130%;\">\u91c7\u8d2d\u7528\u9014\uff1a\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p align=\"left\" style=\"text-align: left; line-height: 130%;\">\u672c\u9879\u76ee\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a\u81ea\u5408\u540c\u7b7e\u8ba2\u4e4b\u65e5\u8d77\u3002</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u4e2d\u91d1\u62db\u6807\u6709\u9650\u8d23\u4efb\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u897f\u4e09\u73af\u5317\u8def21\u53f7\u4e45\u51cc\u5927\u53a615\u5c42</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u725b\u680b\u3001\u5f20\u5983\u3001\u90b9\u5bb6\u6052    010-68405027</p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670807\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670829\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a79.5000000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><p align=\"left\" style=\"text-align: left; line-height: 130%;\">\u4e2d\u6807\u4f9b\u5e94\u5546\uff1a\u5317\u4eac\u6210\u6797\u817e\u8fbe\u73af\u4fdd\u79d1\u6280\u6709\u9650\u516c\u53f8</p><p align=\"left\" style=\"text-align: left; line-height: 130%;\">\u4e2d\u6807\u91d1\u989d\uff1a\u4eba\u6c11\u5e01\u67d2\u62fe\u7396\u4e07\u4f0d\u4edf\u5143\u6574\uff08\u00a5795,000.00\uff09</p><p align=\"left\" style=\"text-align: left; line-height: 130%;\">\u4e2d\u6807\u4eba\u5730\u5740\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u987a\u901a\u8def75\u53f7</p><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.1925 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u53c2\u7167\u539f\u56fd\u5bb6\u8ba1\u59d4\u9881\u5e03\u7684\u300a\u62db\u6807\u4ee3