{"title": "[\u6d77\u6dc0]\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4eba\u6c11\u653f\u5e9c\u6d77\u6dc0\u8857\u9053\u529e\u4e8b\u5904\u4e2d\u5173\u6751\u897f\u533a\u79e9\u5e8f\u7ba1\u7406\u4eba\u5458\u52b3\u52a1\u6d3e\u9063\u5408\u540c(\u4e8c\u6b21)\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6cdb\u534e\u56fd\u91d1\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4eba\u6c11\u653f\u5e9c\u6d77\u6dc0\u8857\u9053\u529e\u4e8b\u5904\u7684\u59d4\u6258\uff0c\u5c31\u4e2d\u5173\u6751\u897f\u533a\u79e9\u5e8f\u7ba1\u7406\u4eba\u5458\u52b3\u52a1\u6d3e\u9063\u5408\u540c(\u4e8c\u6b21)\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aFG-DLP-2018-0808-07-1\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aFG-DLP-2018-0808-07-1</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u4e2d\u5173\u6751\u897f\u533a\u79e9\u5e8f\u7ba1\u7406\u4eba\u5458\u52b3\u52a1\u6d3e\u9063\u5408\u540c(\u4e8c\u6b21)</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u6167</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a13021232658</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4eba\u6c11\u653f\u5e9c\u6d77\u6dc0\u8857\u9053\u529e\u4e8b\u5904</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4e39\u68f1\u885710\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u6797\u79d1\u957f010-82669621</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u7528\u9014\uff1a\u81ea\u7528</p><p>\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p>\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a<span style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); font-style: normal; text-indent: 0px; letter-spacing: normal; display: inline !important; font-family: 'Microsoft YaHei', tahoma, ' Arial', Helvetica, sans-serif; white-space: normal; orphans: 2; float: none; color: rgb(51,51,51); font-size: 14px; font-weight: 400; word-spacing: 0px; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial\">2018-09-30\u81f32018-10-30</span></p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u6cdb\u534e\u56fd\u91d1\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u961c\u5916\u4eae\u7532\u5e971\u53f7\u6069\u6d4e\u897f\u56ed\u4ea7\u4e1a\u56ed16\u53f7\u697cA\u5ea7</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u5f20\u6167 13021232658</p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670807\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a143.8500000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td>\u5e8f\u53f7</td><td>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0</td><td>\u4e2d\u6807\u4f9b\u5e94\u5546\u8054\u7cfb\u5730\u5740</td><td>\u4e2d\u6807\u91d1\u989d(\u4e07\u5143)</td></tr><tr><td>1</td><td>\u4e2d\u519b\u519b\u5f18\u4fdd\u5b89\u670d\u52a1\u6709\u9650\u516c\u53f8</td><td>\u5317\u4eac\u5e02\u5927\u5174\u533a\u91d1\u82d1\u8def32\u53f73\u5e623\u5c42301\u5ba4</td><td>143.850000</td></tr></tbody></table><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.8508 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p> \u8ba1\u4ef7\u683c[2002]1980\u53f7\u6587\u3001\u53d1\u6539\u529e\u4ef7\u683c[2003]857\u53f7\u6587\u53ca\u53d1\u6539\u4ef7\u683c[2011]534\u53f7\u6587</p><p></p><p>\u8bc4\u5ba1\u4e13\u5bb6\u540d\u5355\uff1a</p><p>\u738b\u6d2a\u3001\u738b\u5b54\u4f1f\u3001\u5218\u4eac\u5e73\u3001\u5b59\u9633\u3001\u674e\u6b23</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</p><p></p><p style=\"margin: 5pt 0pt\"><span style=\"text-transform: none; letter-spacing: 0pt; background: rgb(255,255,255)\">\u540d\u79f0\uff1a</span><span style=\"text-transform: none; letter-spacing: 0pt; background: rgb(255,255,255)\">\u4e2d</span><span style=\"text-transform: none; letter-spacing: 0pt; background: rgb(255,255,255)\">\u5173\u6751\u897f\u533a\u79e9\u5e8f\u7ba1\u7406\u4eba\u5458\u52b3\u52a1\u6d3e\u9063\u5408\u540c(\u4e8c\u6b21)</span></p><p style=\"margin: 5pt 0pt\"><span style=\"text-transform: none; letter-spacing: 0pt; background: rgb(255,255,255)\">\u89c4\u683c\u578b\u53f7\uff1a\u65e0</span></p><p style=\"margin: 5pt 0pt\"><span style=\"text-transform: none; letter-spacing: 0pt; background: rgb(255,255,255)\">\u6570\u91cf\uff1a\u4e00\u6279</span></p><p style=\"margin: 5pt 0pt\"><span style=\"text-transform: none; letter-spacing: 0pt; background: rgb(255,255,255)\">\u5355\u4ef7\uff1a\u65e0</span></p><p style=\"margin: 5pt 0pt\"><span style=\"text-transform: none; letter-spacing: 0pt; background: rgb(255,255,255)\">\u670d\u52a1\u8981\u6c42\uff1a\u8be6\u89c1\u62db\u6807\u6587\u4ef6</span></p><p></p><p><strong>\u516d\u3001\u5176\u5