{"title": "[\u77f3\u666f\u5c71]\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u77f3\u666f\u5c71\u5206\u5c40\u201c\u57ce\u5e02\u516c\u5171\u670d\u52a1\u7c7b\u5c97\u4f4d\u5b89\u7f6e\u52e4\u52a1\u8f85\u8b66\u201d\u52b3\u52a8\u529b\u8f93\u51fa\u5355\u4f4d\u653f\u5e9c\u91c7\u8d2d\u9879\u76ee\u7ade\u4e89\u6027\u78cb\u5546", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u653f\u5e9c\u91c7\u8d2d\u4e2d\u5fc3\u53d7\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u77f3\u666f\u5c71\u5206\u5c40\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u77f3\u666f\u5c71\u5206\u5c40\u201c\u57ce\u5e02\u516c\u5171\u670d\u52a1\u7c7b\u5c97\u4f4d\u5b89\u7f6e\u52e4\u52a1\u8f85\u8b66\u201d\u52b3\u52a8\u529b\u8f93\u51fa\u5355\u4f4d\u653f\u5e9c\u91c7\u8d2d\u9879\u76ee\u8fdb\u884c\u7ade\u4e89\u6027\u78cb\u5546\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u77f3\u666f\u5c71\u5206\u5c40\u201c\u57ce\u5e02\u516c\u5171\u670d\u52a1\u7c7b\u5c97\u4f4d\u5b89\u7f6e\u52e4\u52a1\u8f85\u8b66\u201d\u52b3\u52a8\u529b\u8f93\u51fa\u5355\u4f4d\u653f\u5e9c\u91c7\u8d2d\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>SJSXM-201808021842</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u6731\u5f66\u8d85</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a68878644</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u77f3\u666f\u5c71\u5206\u5c40</p><p></p>  <p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u53e4\u57ce\u5357\u8def\u75321\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a13911525778</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u653f\u5e9c\u91c7\u8d2d\u4e2d\u5fc3</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u6731\u5f66\u8d85 68878644</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u516b\u89d2\u5357\u8def7\u53f7</p><p></p>       <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p>\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p><strong>\u4e8c\u3001\u5bf9\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\uff08\u4f9b\u5e94\u5546\u8d44\u683c\u6761\u4ef6\uff09:</strong></p><p>\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p></p><p><strong>\u4e09\u3001\u78cb\u5546\u548c\u54cd\u5e94\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9\u7b49:</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a708.2 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7409\u670818\u65e5 09:00</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e7409\u670818\u65e5 09:00\u81f32018\u5e7409\u670819\u65e5 17:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u653f\u5e9c\u91c7\u8d2d\u4e2d\u5fc3</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65b9\u5f0f\uff1a\u73b0\u573a\u9886\u53d6</p><p>\u78cb\u5546\u6587\u4ef6\u552e\u4ef7\uff1a0.0  \u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u65f6\u95f4\uff1a2018\u5e7409\u670819\u65e5 09:00\u81f32018\u5e7409\u670829\u65e5 09:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u653f\u5e9c\u91c7\u8d2d\u4e2d\u5fc3</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7409\u670818\u65e5 09:00</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u77f3\u666f\u5c71\u533a\u653f\u5e9c\u91c7\u8d2d\u4e2d\u5fc3</p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u6731\u5f66\u8d85</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a68878644</p><p></p><p><strong>\u516d\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p></p><p></p>    <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            