{"title": "[\u897f\u57ce]\u5317\u4eac\u5e02\u897f\u57ce\u533a\u4e2d\u5b66\u751f\u56fd\u9632\u6559\u80b2\u4e2d\u5fc3\u8d2d\u7f6e\u5b66\u751f\u519b\u8bad\u670d\u88c5\u6210\u4ea4\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u56fd\u91d1\u62db\u6807\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u897f\u57ce\u533a\u4e2d\u5b66\u751f\u56fd\u9632\u6559\u80b2\u4e2d\u5fc3\u7684\u59d4\u6258\uff0c\u5c31\u5317\u4eac\u5e02\u897f\u57ce\u533a\u4e2d\u5b66\u751f\u56fd\u9632\u6559\u80b2\u4e2d\u5fc3\u8d2d\u7f6e\u5b66\u751f\u519b\u8bad\u670d\u88c5\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aCFTC-BJ01-1809002\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u6210\u4ea4\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aCFTC-BJ01-1809002</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u4e2d\u5b66\u751f\u56fd\u9632\u6559\u80b2\u4e2d\u5fc3\u8d2d\u7f6e\u5b66\u751f\u519b\u8bad\u670d\u88c5</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5b8b\u68a6\u590f</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-56215050</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u4e2d\u5b66\u751f\u56fd\u9632\u6559\u80b2\u4e2d\u5fc3</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u623f\u5c71\u533a\u957f\u9633\u9547\u897f\u573a\u6751</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a010-60358144</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u56fd\u91d1\u62db\u6807\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u4e1c\u76f4\u95e8\u5357\u5927\u88579\u53f7\u534e\u666e\u82b1\u56edC\u5ea71705\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a010-56215050</p><p></p><p><strong>\u56db\u3001\u6210\u4ea4\u4fe1\u606f</strong></p><p>\u62db\u6807\u6587\u4ef6\u7f16\u53f7\uff1aCFTC-BJ01-1809002</p><p>\u672c\u9879\u76ee\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670818\u65e5</p><p>\u6210\u4ea4\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u6210\u4ea4\u91d1\u989d\uff1a94.4800000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p>                <p>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u5730\u5740\u53ca\u6210\u4ea4\u91d1\u989d\uff1a</p><p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td>\u5e8f\u53f7</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u8054\u7cfb\u5730\u5740</td><td>\u6210\u4ea4\u91d1\u989d(\u4e07\u5143)</td></tr><tr><td>1</td><td>\u5317\u4eac\u795e\u5a01\u65b0\u661f\u79d1\u8d38\u6709\u9650\u516c\u53f8</td><td>\u5317\u4eac\u5e02\u5bc6\u4e91\u533a\u7ecf\u6d4e\u5f00\u53d1\u533a\u9526\u7a0b\u88575\u53f7</td><td>94.480000</td></tr></tbody></table><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.4172 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u6536\u8d39\u6807\u51c6\u53c2\u8003\u56fd\u5bb6\u8ba1\u59d4\u8ba1\u4ef7\u683c[2002]1980\u53f7\u6587\u4e2d\u201c\u5dee\u989d\u5b9a\u7387\u7d2f\u8fdb\u201d\u8ba1\u8d39\u65b9\u5f0f\u6536\u53d6</p><p></p><p>\u8c08\u5224\u5c0f\u7ec4\u3001\u8be2\u4ef7\u5c0f\u7ec4\u3001\u78cb\u5546\u5c0f\u7ec4\u6210\u5458\u540d\u5355\u53ca\u5355\u4e00\u6765\u6e90\u91c7\u8d2d\u4eba\u5458\u540d\u5355\uff1a</p><p>\u9a6c\u8537\u3001\u5f20\u6c38\u7965\u3001\u5218\u535a</p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</stro