{"title": "[\u516c\u5f00]\u9996\u90fd\u533b\u79d1\u5927\u5b66\u9644\u5c5e\u5317\u4eac\u5929\u575b\u533b\u9662\u65b0\u9662\u8fc1\u5efa\u5de5\u7a0b\u4fe1\u606f\u5316\u5efa\u8bbe\uff08\u4e8c\u671f\uff09-\u836f\u54c1\u53ca\u9ad8\u503c\u8017\u6750\u667a\u6167\u5316\u7ba1\u7406\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u56fd\u9645\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u9996\u90fd\u533b\u79d1\u5927\u5b66\u9644\u5c5e\u5317\u4eac\u5929\u575b\u533b\u9662\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u65b0\u9662\u8fc1\u5efa\u5de5\u7a0b\u4fe1\u606f\u5316\u5efa\u8bbe\uff08\u4e8c\u671f\uff09-\u836f\u54c1\u53ca\u9ad8\u503c\u8017\u6750\u667a\u6167\u5316\u7ba1\u7406\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u65b0\u9662\u8fc1\u5efa\u5de5\u7a0b\u4fe1\u606f\u5316\u5efa\u8bbe\uff08\u4e8c\u671f\uff09-\u836f\u54c1\u53ca\u9ad8\u503c\u8017\u6750\u667a\u6167\u5316\u7ba1\u7406</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000193308171227096</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f90\u52bc\u660e</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-82372620</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u9996\u90fd\u533b\u79d1\u5927\u5b66\u9644\u5c5e\u5317\u4eac\u5929\u575b\u533b\u9662</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u5929\u575b\u897f\u91cc6\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u53f2\u8001\u5e08\uff0c010-67098239</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u56fd\u9645\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u5d14\u4e91\u9f99\uff0c010-82372620</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u5b66\u9662\u8def30\u53f7\u79d1\u5927\u5929\u5de5\u5927\u53a6A\u5ea7611\uff08\u8d2d\u4e70\u6807\u4e66\u5728608\uff09 </p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p>\u89c1\u9644\u4ef6\u4e0b\u8f7d</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>1. \u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u80fd\u529b\u7684\u4f9b\u5e94\u5546\uff0c\u5305\u62ec\u6cd5\u4eba\u3001\u5176\u4ed6\u7ec4\u7ec7\u6216\u8005\u81ea\u7136\u4eba\uff1b2. \u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff0c\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff0c\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b3. \u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b4. \u5355\u4f4d\u8d1f\u8d23\u4eba\u4e3a\u540c\u4e00\u4eba\u6216\u8005\u5b58\u5728\u76f4\u63a5\u63a7\u80a1\u3001\u7ba1\u7406\u5173\u7cfb\u7684\u4e0d\u540c\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u540c\u65f6\u53c2\u52a0\u540c\u4e00\u5305\u53f7\u7684\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\uff1b\u4e3a\u67d0\u4e00\u5305\u53f7\u63d0\u4f9b\u6574\u4f53\u8bbe\u8ba1\u3001\u89c4\u8303\u7f16\u5236\u6216\u8005\u9879\u76ee\u7ba1\u7406\u3001\u76d1\u7406\u3001\u68c0\u6d4b\u7b49\u670d\u52a1\u7684\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u518d\u53c2\u52a0\u8be5\u5305\u7684\u5176\u4ed6\u91c7\u8d2d\u6d3b\u52a8\uff1b5. \u901a\u8fc7\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u548c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.gov.cn\uff09\u67e5\u8be2\u4fe1\u7528\u8bb0\u5f55\uff08\u622a\u6b62\u65f6\u70b9\u4e3a\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff09\uff0c\u88ab\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u7684\u4f9b\u5e94\u5546\uff0c\u6ca1\u6709\u8d44\u683c\u53c2\u52a0\u672c\u9879\u76ee\u7684\u91c7\u8d2d\u6d3b\u52a8\uff1b6. \u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8fdb\u53e3\u4ea7\u54c1\u6295\u6807\uff1b7. \u5fc5\u987b\u6309\u89c4\u5b9a\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\uff0c\u5426\u5219\u6ca1\u6709\u8d44\u683c\u53c2\u4e0e\u6295\u6807\uff1b8. \u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a427.32 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 16:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u5b66\u9662\u8def30\u53f7\u79d1\u5927\u5929\u5de5\u5927\u53a6A\u5ea7608\u5ba4\uff08\u5317\u56db\u73af\u5b66\u9662\u6865\u4e1c\u5317\u89d2\uff09\u3002</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u89c1\u9644\u4ef6\u4e0b\u8f7d</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 14:00</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 14:00</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u5b66\u9662\u8def30\u53f7\u79d1\u5927\u5929\u5de5\u5927\u53a6B\u5ea7\u4e09\u5c42\u7b2c\u4e00\u4f1a\u8bae\u5ba4\uff08\u5317\u56db\u73af\u5b66\u9662\u6865\u4e1c\u5317\u89d2\uff09</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"text-indent:21.2pt;line-height:150%;\">\u73b0\u573a\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u65f6\u9700\u643a\u5e26\u4ee5\u4e0b\u8d44\u6599\uff08\u6750\u6599\u5747\u9700\u52a0\u76d6\u4f9b\u5e94\u5546\u516c\u7ae0\uff09\uff1a</p><p style=\"margin-left:47.8pt;text-indent:-12.4pt;line-height:150%;\">a.\u4f9b\u5e94\u5546\u8425\u4e1a\u6267\u7167\u590d\u5370\u4ef6\uff1b</p><p style=\"margin-left:47.8pt;text-indent:-12.4pt;line-height:150%;\">b.\u62db\u6807\u6587\u4ef6\u8d2d\u4e70\u4eba\u7684\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u59d4\u6258\u4e66\u539f\u4ef6\u53ca\u4f9b\u5e94\u5546\u6cd5\u5b9a\u4ee3\u8868\u4eba\u3001\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\u590d\u5370\u4ef6\uff1b</p><p style=\"margin-left:47.8pt;text-indent:-12.4pt;line-height:150%;\">c.\u62db\u6807\u6587\u4ef6\u8d2d\u4e70\u4eba2018\u5e74\u4ee5\u6765\u8fde\u7eed\u4e09\u4e2a\u6708\u5728\u4f9b\u5e94\u5546\u5355\u4f4d\u7684\u793e\u4fdd\u7f34\u7eb3\u8bc1\u660e\u6587\u4ef6\u3002</p><p style=\"margin-left:.1pt;text-indent:21.2pt;line-height:150%;\">\u5982\u7535\u6c47\u6216\u7f51\u94f6\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\uff0c\u987b\u5c06\u4e0a\u8ff0\u8d44\u6599\u4e8e2018\u5e7410\u670812\u65e5\u4e0b\u534816:30\u524d\uff0c\u626b\u63cf\u5e76\u53d1\u9001\u7535\u5b50\u90ae\u4ef6\u6216\u5feb\u9012/\u9001\u8fbe\u81f3\u6211\u516c\u53f8\uff0c\u5426\u5219\u89c6\u4e3a\u672a\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u3002</p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u89c1\u9644\u4ef6\u4e0b\u8f7d</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      