{"title": "[\u516c\u5f00]\u5317\u4eac\u5e02\u7edf\u8ba1\u5c40\uff08\u884c\u653f\uff09\u5317\u4eac\u5e02\u7b2c\u56db\u6b21\u5168\u56fd\u7ecf\u6d4e\u666e\u67e5\u4e2a\u4f53\u7ecf\u8425\u6237\u767b\u8bb0\u5165\u6237\u5ba3\u4f20\u54c1\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u6c38\u660e\u9879\u76ee\u7ba1\u7406\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u7edf\u8ba1\u5c40\uff08\u884c\u653f\uff09\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5317\u4eac\u5e02\u7b2c\u56db\u6b21\u5168\u56fd\u7ecf\u6d4e\u666e\u67e5\u4e2a\u4f53\u7ecf\u8425\u6237\u767b\u8bb0\u5165\u6237\u5ba3\u4f20\u54c1\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4eac\u5e02\u7b2c\u56db\u6b21\u5168\u56fd\u7ecf\u6d4e\u666e\u67e5\u4e2a\u4f53\u7ecf\u8425\u6237\u767b\u8bb0\u5165\u6237\u5ba3\u4f20\u54c1</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000031102180930055</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u90a2\u5973\u58eb\u3001\u524c\u5148\u751f</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-52474965</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u7edf\u8ba1\u5c40\uff08\u884c\u653f\uff09</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5e7f\u5b89\u95e8\u5357\u885736 \u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u5cb3\u5148\u751f\uff0cchengxiaomin@bjstats.gov.cn</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u6c38\u660e\u9879\u76ee\u7ba1\u7406\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a010-52474965</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u897f\u57ce\u533a\u5e7f\u5b89\u95e8\u5916\u5927\u8857248\u53f7\u673a\u68b0\u5927\u53a621\u5c422111\u5ba4</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p>\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u7b2c\u56db\u6b21\u5168\u56fd\u7ecf\u6d4e\u666e\u67e5\u4e2a\u4f53\u7ecf\u8425\u6237\u767b\u8bb0\u5165\u6237\u5ba3\u4f20\u54c1</p><p>\u6570\u91cf\uff1a100000\u4e2a</p><p>\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</p><p style=\"text-indent:0pt;vertical-align:middle;\">1\u3001\u80cc\u5305\u8981\u6c42\u53ef\u6298\u53e0\uff0c\u7d20\u8272\uff0c\u6574\u4f53\u8981\u6c42\u7f8e\u89c2\u5927\u65b9\uff0c\u8010\u7528\u3002</p><p style=\"text-indent:0pt;vertical-align:middle;\">2\u3001\u5c3a\u5bf8\uff1a\u80cc\u5305\u5c55\u5f00\u5c3a\u5bf8\u4e3a (45cm\u00b11cm)*( 33cm\u00b11cm)* 15cm(\u00b11cm)\uff1b\u80cc\u5305\u6298\u53e0\u540e\u5c3a\u5bf8\u4e3a(16cm\u00b11cm) * ( 23cm\u00b11cm)</p><p style=\"text-indent:0pt;vertical-align:middle;\">3\u3001\u6750\u8d28\uff1a\u80cc\u5305\u5916\u5c42\u8981\u6c42\u91c7\u7528420D\u7f51\u683c\u9632\u6c34\u5e03\u6599\uff0c\u5185\u5c42\u4e8c\u6b21\u73af\u4fddPU\u5904\u7406\uff0c\u8981\u6c42\u80f6\u9762\u6298\u53e0\u6469\u64e6\u540e\u67d4\u8f6f\u65e0\u6298\u75d5\uff0c\u540c\u65f6\u4e0d\u6389\u8272\uff0c\u65e0\u5f02\u5473\u3002</p><p style=\"text-indent:0pt;vertical-align:middle;\">4\u3001\u5916\u90e8\u7ed3\u6784\uff1a\u80cc\u5305\u53cc\u4fa7\u8bbe\u6709\u7f51\u5e03\u6c34\u74f6\u888b\uff0c\u4e24\u4fa7\u9644\u52a0\u6709\u53cd\u5149\u5b89\u5168\u6761\uff0c\u8bbe\u6709\u4e3a\u534a\u5f27\u5f62\u8d34\u515c\u5f0f\u524d\u515c\u3002\u4e66\u5305\u6253\u5f00\u6b63\u9762\u5370\u6709\u7b2c\u56db\u6b21\u5168\u56fd\u7ecf\u6d4e\u666e\u67e5\u7684\u5f69\u8272LOGO\u56fe\u6848\u3002</p><p style=\"text-indent:3.15pt;vertical-align:middle;\">5\u3001\u5de5\u827a\uff1a\u91c7\u7528\u6574\u4f53\u65e0\u62fc\u63a5\u5f0f\u7f1d\u5408\uff0c\u7acb\u4f53\u5f0f\u5168\u5305\u7f1d\u5408\uff1b\u5185\u90e8\u8bbe\u6709\u624b\u673a\u888b\u5168\u5305\u7f1d\u5408\u3002</p><p style=\"text-indent:0pt;vertical-align:middle;\">\u6267\u884c\u6807\u51c6 QB/T 1333-2010\u3002</p><p style=\"text-indent:0pt;vertical-align:middle;\">6\u3001\u80a9\u5e26\u548c\u8c03\u8282\u5e26\uff1a\u80a9\u5e26\u4e3a\u53cc\u5c42\u7ed3\u6784\uff0c\u5185\u4fa7\u91c7\u7528\u9ad8\u5bc6\u5ea6\u900f\u6c14\u7f51\u5e03\u5168\u5305\u7f1d\u5408\uff0c\u5916\u4fa7\u91c7\u7528420D\u578b\u7f51\u683c\u9632\u6c34\u5e03\u6599\u7f1d\u5408\u3002\u8c03\u8282\u5e26\u4e3a\u52a0\u5bc6\u7ec7\u5e26\uff0c\u5e76\u5185\u5305\u7ec7\u8fdb\u7f51\u5e03\u5185\u3002\u8c03\u8282\u9501\u6263\u4e3a\u73af\u4fdd\u3001\u52a0\u539a\u578b\uff0c\u5e76\u4e0e\u5176\u5b83\u914d\u4ef6\u7edf\u4e00\u4e3a\u7070\u8272\u3002</p><p style=\"text-indent:0pt;vertical-align:middle;\">7\u3001\u914d\u4ef6\uff1a\u6574\u4f53\u62c9\u94fe\u8981\u6c42\u987a\u6ed1\uff0c\u627f\u53d7\u6b63\u5e38\u4f7f\u7528\u7684\u538b\u529b\uff0c\u5927\u53e3\u888b\u62c9\u5934\u4e3a\u7cbe\u81f4\u7845\u80f6\u9632\u6ed1\u8fd0\u52a8\u62c9\u5934\uff1b\u5c0f\u53e3\u888b\u62c9\u5934\u4e3a\u53cc\u62c9\u8bbe\u8ba1\uff0c\u62c9\u724c\u4e3a\u5706\u5f62\u5408\u91d1pvc\u6750\u8d28\u3002</p><p style=\"text-indent:0pt;vertical-align:middle;\">8\u3001\u5305\u88c5: \u72ec\u7acb\u5305\u88c5\uff0c\u5916\u5305\u88c5\u4e3a\u53cc\u5c42\u5370\u5237\u52a0\u539aPE\u62c9\u94fe\u888b\uff0c\u62c9\u94fe\u5f0f\u5c01\u53e3\uff0c\u53ef\u91cd\u590d\u4f7f\u7528\uff0c\u5916\u5305\u88c5\u5e94\u5370\u6709\u2018\u5317\u4eac\u5e02\u7b2c\u56db\u6b21\u5168\u56fd\u7ecf\u6d4e\u666e\u67e5\u9886\u5bfc\u5c0f\u7ec4\u529e\u516c\u5ba4\u8d60\u2019\u5b57\u6837\u3002</p><p><strong>\u5230\u8d27\u65f6\u95f4\uff1a</strong>2018\u5e7412\u670815\u65e5\u524d\u5b8c\u6210\u751f\u4ea7\u6216\u91c7\u8d2d\u5168\u90e8\u7269\u8d44\uff0c\u5e76\u5c06\u7269\u8d44\u4ea4\u4ed8\u81f3\u6307\u5b9a\u5730\u70b9\u3002</p><p><strong>\u4ea4\u8d27\u5730\u70b9\uff1a</strong>\u5317\u4eac\u5e0216\u4e2a\u533a\u53ca\u7ecf\u6d4e\u6280\u672f\u5f00\u53d1\u533a,(\u5317\u4eac\u5e02\u7edf\u8ba1\u5c40\u6307\u5b9a\u5730\u70b9)\u3002</p><p><strong>\u662f\u5426\u5141\u8bb8\u8fdb\u53e3\u4ea7\u54c1\u6295\u6807\uff1a</strong>\u5426</p><p>\u8be6\u89c1\u62db\u6807\u6587\u4ef6\u7b2c\u4e09\u90e8\u5206\u6280\u672f\u9700\u6c42\u4e66\u3002</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>\u6295\u6807\u4eba\u8d44\u683c\u8981\u6c42\uff08\u987b\u540c\u65f6\u6ee1\u8db3\uff09\uff1a1)\u6709\u751f\u4ea7\u6216\u4f9b\u5e94\u80fd\u529b\u7684\u4f9b\u5e94\u5546\uff0c\u5305\u62ec\u6cd5\u4eba\u3001\u5176\u4ed6\u7ec4\u7ec7\u6216\u8005\u81ea\u7136\u4eba\uff1b2)\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u76f8\u5173\u89c4\u5b9a\uff0c\u5373\uff1a\uff081\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b\uff082\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b\uff083\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b\uff084\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b\uff085\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b\uff086\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\u30023)\u7b26\u5408\u300a\u8d22\u653f\u90e8\u5173\u4e8e\u5728\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u4e2d\u67e5\u8be2\u53ca\u4f7f\u7528\u4fe1\u7528\u8bb0\u5f55\u6709\u5173\u95ee\u9898\u7684\u901a\u77e5\u300b\uff08\u8d22\u5e93\u30142016\u3015125\u53f7\uff09\u7684\u76f8\u5173\u8981\u6c42\uff1b4)\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\uff1b5\uff09\u6295\u6807\u4eba\u5fc5\u987b\u5411\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\uff0c\u672a\u5411\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6f5c\u5728\u6295\u6807\u4eba\u5747\u65e0\u8d44\u683c\u53c2\u52a0\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a150.0 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7410\u670808\u65e5 09:00\u81f32018\u5e7410\u670816\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5e7f\u5b89\u95e8\u5916\u5927\u8857248\u53f7\u673a\u68b0\u5927\u53a621\u5c422111\u5ba4</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5200.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u62a5\u540d\u540e\u9886\u53d6\uff0c\u9886\u53d6\u62db\u6807\u6587\u4ef6\u65f6\u987b\u63d0\u4f9b\u4ee5\u4e0b\u8d44\u6599\uff08\u590d\u5370\u4ef6\u9700\u52a0\u76d6\u5355\u4f4d\u516c\u7ae0\uff09\uff1a 1)\u300a\u8425\u4e1a\u6267\u7167\u300b\u6216\u300a\u4e8b\u4e1a\u5355\u4f4d\u6cd5\u4eba\u8bc1\u4e66\u300b\u526f\u672c\u590d\u5370\u4ef6\uff1b 2\uff09\u6cd5\u4eba\u6388\u6743\u59d4\u6258\u4e66\uff08\u539f\u4ef6\uff09\u3001\u88ab\u6388\u6743\u4eba\u672c\u4eba\u8eab\u4efd\u8bc1\u539f\u4ef6\u53ca\u590d\u5370\u4ef6</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670825\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670825\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5e7f\u5b89\u95e8\u5916\u5927\u8857248\u53f7\u673a\u68b0\u5927\u53a621\u5c422111\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin-left:36.0000pt;\">\u672c\u516c\u544a\u540c\u65f6\u5728\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u3001\u5317\u4eac\u5e02\u8d22\u653f\u5c40\u7f51\u7ad9\u53d1\u5e03\u3002</p><p style=\"margin-left:36.0000pt;\">\u516c\u544a\u671f\u9650\uff1a\u81ea\u53d1\u5e03\u4e4b\u65e5\u8d775\u4e2a\u5de5\u4f5c\u65e5\u3002</p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u672c\u9879\u76ee\u6276\u6301\u4e2d\u5c0f\u4f01\u4e1a\u53ca\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\uff0c\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a,\u9f13\u52b1\u8282\u80fd\u73af\u4fdd\u4ea7\u54c1\u7b49\uff0c\u5177\u4f53\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\u843d\u5b9e\u60c5\u51b5\u8be6\u89c1\u62db\u6807\u6587\u4ef6\u3002</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           