{"title": "[\u516c\u5f00]\u5317\u4eac\u5e02\u65c5\u6e38\u54a8\u8be2\u670d\u52a1\u4e2d\u5fc3\u5e02\u7ea7\u54a8\u8be2\u7ad9\u8fd0\u8425\u9879\u76ee\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5e02\u4eac\u53d1\u62db\u6807\u6709\u9650\u516c\u53f8\uff08\u4e2d\u4ecb\uff09\u53d7\u5317\u4eac\u5e02\u65c5\u6e38\u54a8\u8be2\u670d\u52a1\u4e2d\u5fc3\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5e02\u7ea7\u54a8\u8be2\u7ad9\u8fd0\u8425\u9879\u76ee\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5e02\u7ea7\u54a8\u8be2\u7ad9\u8fd0\u8425\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000040212180930008</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u8d85</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a67169727</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u65c5\u6e38\u54a8\u8be2\u670d\u52a1\u4e2d\u5fc3</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u961c\u6210\u95e8\u5916\u5927\u8857\u753211\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a68055564</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u5e02\u4eac\u53d1\u62db\u6807\u6709\u9650\u516c\u53f8\uff08\u4e2d\u4ecb\uff09</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a67169727</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u5d07\u6587\u95e8\u5916\u5927\u885790\u53f7</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p style=\"text-indent: 21pt;\">\u4e3a\u8fdb\u4e00\u6b65\u89c4\u8303\u548c\u52a0\u5f3a\u5317\u4eac\u5e02\u65c5\u6e38\u54a8\u8be2\u670d\u52a1\u7ba1\u7406\u5de5\u4f5c\uff0c\u4fc3\u8fdb\u5317\u4eac\u65c5\u6e38\u54a8\u8be2\u670d\u52a1\u4f53\u7cfb\u5065\u5eb7\u53d1\u5c55\uff0c\u5b8c\u5584\u5168\u5e02\u65c5\u6e38\u516c\u5171\u670d\u52a1\u4f53\u7cfb\uff0c\u89c4\u8303\u548c\u5b8c\u5584\u5317\u4eac\u5730\u533a\u65c5\u6e38\u54a8\u8be2\u7ad9\u70b9\u7684\u7ba1\u7406\uff0c\u5e02\u65c5\u6e38\u59d4\u5728\u5317\u4eac\u91cd\u8981\u6838\u5fc3\u533a\u57df\u5efa\u7acb\u4e86\u5e02\u5c5e\u65c5\u6e38\u54a8\u8be2\u670d\u52a1\u7ad9\u3002</p><p>\u4e3a\u505a\u597d\u5e02\u5c5e\u65c5\u6e38\u54a8\u8be2\u7ad9\u7684\u8fd0\u8425\u5de5\u4f5c\uff0c\u63d0\u9ad8\u5317\u4eac\u65c5\u6e38\u54a8\u8be2\u670d\u52a1\u7684\u89c4\u8303\u5316\u3001\u4e13\u4e1a\u5316\u6c34\u5e73\uff0c\u73b0\u4ee5\u516c\u5f00\u62db\u6807\u7684\u65b9\u5f0f\u8fdb\u884c\u300a\u5e02\u7ea7\u54a8\u8be2\u7ad9\u8fd0\u8425\u9879\u76ee\u300b\u7684\u91c7\u8d2d\u3002</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>1\u3001\u4f9b\u5e94\u5546\u987b\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u6ce8\u518c\uff0c\u80fd\u591f\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\uff0c\u6709\u751f\u4ea7\u6216\u4f9b\u5e94\u80fd\u529b\u7684\u672c\u56fd\u4f9b\u5e94\u5546\uff0c\u5305\u62ec\u6cd5\u4eba\u3001\u5176\u4ed6\u7ec4\u7ec7\u3001\u81ea\u7136\u4eba\u30022\u3001\u4f9b\u5e94\u5546\u5177\u5907\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u89c4\u5b9a\u7684\u6761\u4ef6\uff1b\uff081\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b\uff082\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b\uff083\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b\uff084\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b\uff085\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b\uff086\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\u30023\u3001\u4f9b\u5e94\u5546\u4e0d\u80fd\u88ab\u5217\u5165\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u548c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.gov.cn\uff09\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\uff0c\u5426\u5219\u5176\u6295\u6807\u5c06\u88ab\u62d2\u7edd\u30024\u3001\u9700\u5411\u62db\u6807\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\uff0c\u672a\u5411\u62db\u6807\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6f5c\u5728\u4f9b\u5e94\u5546\u5747\u65e0\u8d44\u683c\u6295\u6807\uff1b5\u3001\u672c\u6b21\u62db\u6807\u662f\u5426\u63a5\u53d7\u8054\u5408\u4f53\u5f62\u5f0f\u7684\u6295\u6807\u4eba\uff1a  \u5426  \uff1b6\u3001\u662f\u5426\u4e13\u95e8\u9762\u5411\u4e2d\u5c0f\u4f01\u4e1a\u6216\u5c0f\u578b\u3001\u5fae\u578b\u4f01\u4e1a\u91c7\u8d2d\uff1a  \u5426  \uff1b</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a245.6 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u