{"title": "[\u516c\u5f00]\u5317\u4eac\u8d22\u8d38\u804c\u4e1a\u5b66\u9662\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6\u2014\u57fa\u7840\u8bbe\u65bd\u6539\u9020\u20142018\u5e74\u5b9a\u989d\u7ba1\u7406\u9879\u76ee2\u2014\u6dbf\u5dde\u6821\u533a\u914d\u7535\u5ba4\u589e\u5bb9\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u534e\u5ba1\u91d1\u5efa\u5de5\u7a0b\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u8d22\u8d38\u804c\u4e1a\u5b66\u9662\u7684\u59d4\u6258\uff0c\u5c31\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6\u2014\u57fa\u7840\u8bbe\u65bd\u6539\u9020\u20142018\u5e74\u5b9a\u989d\u7ba1\u7406\u9879\u76ee2\u2014\u6dbf\u5dde\u6821\u533a\u914d\u7535\u5ba4\u589e\u5bb9\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014260180807166\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014260180807166</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6\u2014\u57fa\u7840\u8bbe\u65bd\u6539\u9020\u20142018\u5e74\u5b9a\u989d\u7ba1\u7406\u9879\u76ee2\u2014\u6dbf\u5dde\u6821\u533a\u914d\u7535\u5ba4\u589e\u5bb9</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u5973\u58eb</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a01089533654</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u8d22\u8d38\u804c\u4e1a\u5b66\u9662</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u901a\u5dde\u533a\u5317\u5173\u5927\u885788\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u5f6d\u8001\u5e08010-89532207</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p>\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a\u8ba1\u5212\u5f00\u5de5\u65e5\u671f2018\u5e749\u670829\u65e5</p><p> \u8ba1\u5212\u7ae3\u5de5\u65e5\u671f2018\u5e7412\u670812\u65e5</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u534e\u5ba1\u91d1\u5efa\u5de5\u7a0b\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u65b0\u8857\u53e3\u5916\u5927\u88578\u53f7\u91d1\u4e30\u548c\u5546\u52a1\u82d1C\u5ea7607\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a17630523879\u300118910743308</p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7408\u670824\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a299.5759690 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td>\u5e8f\u53f7</td><td>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0</td><td>\u4e2d\u6807\u4f9b\u5e94\u5546\u8054\u7cfb\u5730\u5740</td><td>\u4e2d\u6807\u91d1\u989d(\u4e07\u5143)</td></tr><tr><td>1</td><td>\u5317\u4eac\u671d\u65b9\u4f9b\u7528\u7535\u5b89\u88c5\u6709\u9650\u516c\u53f8</td><td>\u5317\u4eac\u5e02\u671d\u9633\u533a\u8c46\u5404\u5e84\u4e61\u91d1\u7530\u516c\u56ed\u51858\u53f7</td><td>299.575969</td></tr></tbody></table><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a2.54113 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u62db\u6807\u4ee3\u7406\u670d\u52a1\u8d39\u6309\u7167\u300a\u56fd\u5bb6\u8ba1\u59d4\u30102002\u30111980\u53f7\u6587\u4ef6\u3001\u53d1\u6539\u4ef7\u683c{2011}534\u53f7\u300b\u8ba1\u7b97\uff0c\u6536\u8d39\u57fa\u6570\u4ee5\u6295\u8d44\u91d1\u989d\u8ba1\u7b97\u3002</p><p></p><p>\u8bc4\u5ba1\u4e13\u5bb6\u540d\u5355\uff1a</p><p>\u6d2a\u771f\u3001\u987e\u65b0\u6c11\u3001\u5218\u65b9\u8d35\u3001\u5218\u6653\u71d5\u3001\u738b\u5fd7\u5e74</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f0\uff1a<span style=\"background: white;\">\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6\u2014\u57fa\u7840\u8bbe\u65bd\u6539\u9020\u2014\u20142018</span>\u5e74\u5b9a\u989d\u7ba1\u7406\u9879\u76ee2\u2014\u6dbf\u5dde\u6821\u533a\u914d\u7535\u5ba4\u589e\u5bb9</p><p><span style=\"background: white;\">\u89c4\u683c\u578b\u53f7\u3001\u5355\u4ef7\u3001\u6570\u91cf\uff1a\u8be6\u89c1\u6295\u6807\u6587\u4ef6</span></p><p><span style=\"background: white;\">\u4e2d\u6807\u8303\u56f4\uff08\u670d\u52a1\u8981\u6c42\uff09\uff1a\u5305\u62ec10KV</span>\u7ebf\u7f06\u67b6\u8bbe\u3001\u9ad8\u4f4e\u538b\u53d8\u914d\u7535\u3001\u5ba4\u591610KV\u7535\u7f06\u6577\u8bbe\u7684\u8c03\u8bd5\u3001\u8fd0\u884c\u3001\u4fdd\u9a8c\u6536\u3001\u4fdd\u53d1\u7535\u3001\u7ef4\u4fee\u53ca\u65bd\u5de5\u8d44\u6599\u7684\u7f16\u5236\uff08\u5305\u62ec\u5c5e\u5730\u5c40\u8981\u6c42\u7684\u5185\u5bb9\uff09\u7b49\u56fe\u7eb8\u53ca\u62db\u6807\u5de5\u7a0b\u91cf\u6e05\u5355\u8303\u56f4\u5185\u7684\u5168\u90e8\u5185\u5bb9\u3002</p><p></p><p></p><p><strong>\u516d\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p>    <p></p>     <p></p>       <p></p> <p></p> <p></p>       <p></p>           <p></p>                                                                                                 