{"title": "[\u516c\u5f00]\u5317\u4eac\u8d22\u8d38\u804c\u4e1a\u5b66\u9662\u57fa\u7840\u8bbe\u65bd\u6539\u9020\u20142018\u6821\u5185\u91cd\u70b9\u9879\u76ee\u2014\u5bb6\u5c5e\u697c\u6c34\u7535\u8868\u66f4\u65b0\u53ca\u7535\u529b\u589e\u5bb9\uff081#2#3#\u5bb6\u5c5e\u697c\u9879\u76ee\uff09\u6d41\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u534e\u5ba1\u91d1\u5efa\u5de5\u7a0b\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u8d22\u8d38\u804c\u4e1a\u5b66\u9662\u7684\u59d4\u6258\uff0c\u5c31\u57fa\u7840\u8bbe\u65bd\u6539\u9020\u20142018\u6821\u5185\u91cd\u70b9\u9879\u76ee\u2014\u5bb6\u5c5e\u697c\u6c34\u7535\u8868\u66f4\u65b0\u53ca\u7535\u529b\u589e\u5bb9\uff081#2#3#\u5bb6\u5c5e\u697c\u9879\u76ee\uff09\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014260180914172\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u5e9f\u6807/\u6d41\u6807\u516c\u544a\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0000014260180914172</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u57fa\u7840\u8bbe\u65bd\u6539\u9020\u20142018\u6821\u5185\u91cd\u70b9\u9879\u76ee\u2014\u5bb6\u5c5e\u697c\u6c34\u7535\u8868\u66f4\u65b0\u53ca\u7535\u529b\u589e\u5bb9\uff081#2#3#\u5bb6\u5c5e\u697c\u9879\u76ee\uff09</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u5973\u58eb</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a17630523879\u300118910743308</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u8d22\u8d38\u804c\u4e1a\u5b66\u9662</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u901a\u5dde\u533a\u5317\u5173\u5927\u885788\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u5f6d\u8001\u5e08010-89532207</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u534e\u5ba1\u91d1\u5efa\u5de5\u7a0b\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u65b0\u8857\u53e3\u5916\u5927\u88578\u53f7\u91d1\u4e30\u548c\u5546\u52a1\u82d1C\u5ea7607\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a17630523879\u300118910743308</p><p></p><p><strong>\u56db\u3001\u5e9f\u6807\u3001\u6d41\u6807\u7684\u539f\u56e0</strong></p><p></p><p><span style='background: white; color: black; font-family: \u5b8b\u4f53; font-size: 10.5pt; mso-bidi-font-family: \"Times New Roman\"; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-bidi-font-size: 10.0pt; mso-ascii-font-family: \"Times New Roman\"; mso-hansi-font-family: \"Times New Roman\";'>\u5728\u6295\u6807\u62a5\u540d\u53ca\u62db\u6807\u6587\u4ef6\u53d1\u552e\u622a\u6b62\u65f6\u95f4\u6b62\uff0c\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u7684\u6f5c\u5728\u6295\u6807\u4eba\u4e0d\u8db3</span><span lang=\"EN-US\" style='background: white; color: black; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-bidi-font-size: 10.0pt; mso-fareast-font-family: \u5b8b\u4f53;'>3</span><span style='background: white; color: black; font-family: \u5b8b\u4f53; font-size: 10.5pt; mso-bidi-font-family: \"Times New Roman\"; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-bidi-font-size: 10.0pt; mso-ascii-font-family: \"Times New Roman\"; mso-hansi-font-family: \"Times New Roman\";'>\u5bb6\uff0c\u4e0d\u80fd\u6ee1\u8db3\u5f00\u6807\u6761\u4ef6\u3002</span></p><p></p><p><strong>\u4e94\u3001\u5e9f\u6807/\u6d41\u6807\u65e5\u671f</strong>\uff1a2018\u5e7409\u6708