{"title": "[\u78cb\u5546]\u56fd\u5bb6\u5927\u5267\u9662\u672c\u7ea7\u6b4c\u5267\u5e03\u666f\u5236\u4f5c\u6210\u4ea4\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5929\u6781\u62db\u6295\u6807\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u56fd\u5bb6\u5927\u5267\u9662\u672c\u7ea7\u7684\u59d4\u6258\uff0c\u5c31\u6b4c\u5267\u5e03\u666f\u5236\u4f5c\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aXM-0000181202180906148\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u6210\u4ea4\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aXM-0000181202180906148</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u6b4c\u5267\u5e03\u666f\u5236\u4f5c</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u80e1\u5148\u751f</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-58032030</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u56fd\u5bb6\u5927\u5267\u9662\u672c\u7ea7</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u897f\u957f\u5b89\u88572\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a010-65099337</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u5929\u6781\u62db\u6295\u6807\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u9a6c\u5bb6\u5821\u4e1c\u8def106\u53f72\u53f7\u697c8\u5c42819\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a010-58032030</p><p></p><p><strong>\u56db\u3001\u6210\u4ea4\u4fe1\u606f</strong></p><p>\u62db\u6807\u6587\u4ef6\u7f16\u53f7\uff1aBJTJ18101</p><p>\u672c\u9879\u76ee\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670810\u65e5</p><p>\u6210\u4ea4\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u6210\u4ea4\u91d1\u989d\uff1a117.0000000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p>                <p>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u5730\u5740\u53ca\u6210\u4ea4\u91d1\u989d\uff1a</p><p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td>\u5e8f\u53f7</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u8054\u7cfb\u5730\u5740</td><td>\u6210\u4ea4\u91d1\u989d(\u4e07\u5143)</td></tr><tr><td>1</td><td>\u5317\u4eac\u4e1c\u65b9\u534e\u7f8e\u6587\u5316\u4f20\u5a92\u6709\u9650\u516c\u53f8</td><td>\u5317\u4eac\u5e02\u901a\u5dde\u533a\u5b8b\u5e84\u9547\u6e2f\u5317\u6751\u6751\u59d4\u4f1a\u5357500\u7c73</td><td>117.000000</td></tr></tbody></table><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.587 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u672c\u9879\u76ee\u7684\u62db\u6807\u4ee3\u7406\u670d\u52a1\u8d39\u4f9d\u636e\u300a\u56fd\u5bb6\u8ba1\u59d4\u5173\u4e8e\u5370\u53d1\u62db\u6807\u4ee3\u7406\u670d\u52a1\u6536\u8d39\u7ba1\u7406\u6682\u884c\u529e\u6cd5\u7684\u901a\u77e5\u300b\u8ba1\u4ef7\u683c\u30102002\u30111980\u53f7\u6587\u4ef6\u3001\u56fd\u5bb6\u53d1\u6539\u59d4\u53d1\u6539\u529e\u4ef7\u683c\u30102003\u3011857\u53f7\u6587\u4ef6\u7684\u89c4\u5b9a\u8ba1\u53d6\uff0c\u7531\u4e2d\u6807\u4eba\u652f\u4ed8\u3002\u4ee3\u7406\u670d\u52a1\u8d39\u4e2d\u6263\u9664\u4e0b\u8ff0\u8bc4\u5ba1\u4e13\u5bb6\u52b3\u52a1\u8d39\u7528\u3002\u4f9d\u636e\u4eac\u8d22\u91c7\u8d2d\u30102017\u3011554\u53f7\u201c\u5317\u4eac\u5e02\u8d22\u653f\u5c40\u5173\u4e8e\u5370\u53d1\u300a\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u8bc4\u5ba1\u4e13\u5bb6\u52b3\u52a1\u62a5\u916c\u652f\u4ed8\u6807\u51c6\u300b\u7684\u901a\u77e5\u201d\u672c\u9879\u76ee\u7684\u8bc4\u5ba1\u4e13\u5bb6\u52b3\u52a1\u8d39\u6309\u5b9e\u9645\u53d1\u751f\u989d\u7531\u91c7\u8d2d\u4eba\u652f\u4ed8\u3002</p><p></p><p>\u8c08\u5224\u5c0f\u7ec4\u3001\u8be2\u4ef7\u5c0f\u7ec4\u3001\u78cb\u5546\u5c0f\u7ec4\u6210\u5458\u540d\u5355\u53ca\u5355\u4e00\u6765\u6e90\u91c7\u8d2d\u4eba\u5458\u540d\u5355\uff1a</p><p>\u78cb\u5546\u5c0f\u7ec4\u6210\u5458\uff1a\u5218\u5d2d\u3001\u6c88\u806a\u3001\u8d75\u5de5\u661f</p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u91c7\u8d2d\u7528\u9014\uff1a\u81ea\u7528</p><p></p><p>\u7b80\u8981\u6280\u672f\u8981\u6c42/\u78cb\u5546\u9879\u76ee\u7684\u6027\u8d28\uff1a\u6b4c\u5267\u300a\u5510\u749c\u300b\u7684\u821e\u7f8e\u5e03\u666f\u5236\u4f5c\u76f8\u5173\u4e8b\u9879</p><p>\u5408\u540c\u5c65\u884c\u671f\uff1a2018\u5e7410\u67081\u65e5\u20142018\u5e7410\u670830\u65e5</p><p></p><p><strong>\u516d\u3001\u6210\u4ea4\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</strong></p><p></p><p>\u9644\u4f53\u5185\u5bb9\u8be6\u89c1\u9644\u4ef6</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p></p><p></p>  <p></p> <p></p> <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        