                      <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>                                          <p>                                                                                      </p>    </div>", "province": "\u5317\u4eac", "id": "beijing_t20180930_1034699", "source_url": "http://ccgp-beijing.gov.cn/xxgg/sjzfcggg/t20180930_1034699.html", "publish_time": "2018-10-1538729954 16:59:14"}
{"title": "[\u516c\u5f00]\u5317\u4eac\u7535\u5f71\u5b66\u9662\u5c0f\u5267\u573a\u97f3\u54cd\u8bbe\u5907\u66f4\u65b0\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u5929\u4fe1\u8fdc\u56fd\u9645\u62db\u6295\u6807\u54a8\u8be2\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u7535\u5f71\u5b66\u9662\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5c0f\u5267\u573a\u97f3\u54cd\u8bbe\u5907\u66f4\u65b0\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5c0f\u5267\u573a\u97f3\u54cd\u8bbe\u5907\u66f4\u65b0</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000014220180926111</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u6885\u96e8\u6da6\u3001\u848b\u8427\u60a6</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-51909075</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u7535\u5f71\u5b66\u9662</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u897f\u571f\u57ce\u8def4\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u738b\u8001\u5e08010-51908151</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u4e2d\u5929\u4fe1\u8fdc\u56fd\u9645\u62db\u6295\u6807\u54a8\u8be2\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u6885\u96e8\u6da6\u3001\u848b\u8427\u60a6010-51909075</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u671d\u9633\u533a\u5357\u78e8\u623f\u8def37\u53f7\u534e\u817e\u5317\u642a\u5546\u52a1\u5927\u53a61103\u5ba4</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"border: currentColor; border-image: none; width: 105.98%; border-collapse: collapse;\" width=\"105%\"><tbody><tr><td style=\"padding: 0cm 5.4pt; border: 1pt solid windowtext; border-image: none; width: 40.44%;\"><p align=\"center\" style=\"text-align: center;\">\u4e3b\u8981\u91c7\u8d2d\u8d27\u7269\u540d\u79f0</p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 9.86%;\"><p align=\"center\" style=\"text-align: center;\">\u6570\u91cf</p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 30.92%;\"><p align=\"center\" style=\"text-align: center;\">\u9884\u7b97\u91d1\u989d\uff08\u4e07\u5143\uff09</p><p align=\"center\" style=\"text-align: center;\">\u53ca\u9884\u7b97\u7f16\u53f7</p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 18.78%;\"><p align=\"center\" style=\"text-align: center;\">\u662f\u5426\u63a5\u53d7\u8fdb\u53e3</p></td></tr><tr style=\"height: 38px;\"><td style=\"border-width: 0px 1pt 1pt; border-style: none solid solid; padding: 0cm 5.4pt; border-image: none; width: 40.44%; height: 38px;\"><p align=\"center\" style=\"text-align: center;\">\u25b2\u4e3b\u6269\u8c03\u97f3\u53f0</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 9.86%; height: 38px;\"><p align=\"center\" style=\"text-align: center;\">2\u53f0</p></td><td rowspan=\"5\