u53f7\u697c1518\u5ba4\uff09</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670826\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670826\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u5e7f\u5b89\u8def9\u53f7\u56fd\u6295\u8d22\u5bcc\u5e7f\u573a6\u53f7\u697c1502\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin: 0pt;\"><span style='font-family: \u5b8b\u4f53; font-size: 12pt; mso-spacerun: \"yes\"; mso-bidi-font-family: \"Times New Roman\"; mso-font-kerning: 1.0000pt;'><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u672c\u9879\u76ee\u62db\u6807\u516c\u544a\u5728\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08</font><font color=\"#000000\">http://www.ccgp.gov.cn/\uff09\u3001\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08</font></span><font color=\"#000000\"><span style='font-family: \u5b8b\u4f53; font-size: 12pt; mso-spacerun: \"yes\"; mso-bidi-font-family: \"Times New Roman\"; mso-font-kerning: 1.0000pt;'>http://www.ccgp-beijing.gov.cn/</span><span style='font-family: \u5b8b\u4f53; font-size: 12pt; mso-spacerun: \"yes\"; mso-bidi-font-family: \"Times New Roman\"; mso-font-kerning: 1.0000pt;'><font face=\"\u5b8b\u4f53\">\uff09\u7f51\u4e0a\u53d1\u5e03\u3002</font></span></font></p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p style=\"margin: 0pt;\"><span style='color: rgb(0, 0, 0); font-family: \u5b8b\u4f53; font-size: 12pt; mso-spacerun: \"yes\"; mso-font-kerning: 0.0000pt;'><font face=\"\u5b8b\u