{"title": "[\u516c\u5f00]\u5317\u4eac\u7535\u5f71\u5b66\u9662\u7535\u5f71\u5236\u4f5c\u7cfb\u7edf\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u5929\u4fe1\u8fdc\u56fd\u9645\u62db\u6295\u6807\u54a8\u8be2\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u7535\u5f71\u5b66\u9662\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u7535\u5f71\u5236\u4f5c\u7cfb\u7edf\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u7535\u5f71\u5236\u4f5c\u7cfb\u7edf</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000014220180929116</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u6885\u96e8\u6da6\u3001\u848b\u8427\u60a6</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-51909075</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u7535\u5f71\u5b66\u9662</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u897f\u571f\u57ce\u8def4\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u738b\u8001\u5e08010-51908151</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u4e2d\u5929\u4fe1\u8fdc\u56fd\u9645\u62db\u6295\u6807\u54a8\u8be2\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u6885\u96e8\u6da6\u3001\u848b\u8427\u60a6010-51909075</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u671d\u9633\u533a\u5357\u78e8\u623f\u8def37\u53f7\u534e\u817e\u5317\u642a\u5546\u52a1\u5927\u53a61103\u5ba4</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse: collapse;\" width=\"659\"><tbody><tr style=\"height: 57px;\"><td style=\"padding: 0cm 5.4pt; border: 1pt solid windowtext; border-image: none; width: 158px; height: 57px;\"><p align=\"center\" style=\"text-align: center;\">\u660e\u7ec6\u9879\u76ee\u540d\u79f0</p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 66px; height: 57px;\"><p align=\"center\" style=\"text-align: center;\">\u6570\u91cf</p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 331px; height: 57px;\"><p align=\"center\" style=\"text-align: center;\">\u9884\u7b97\u91d1\u989d</p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 104px; height: 57px;\"><p align=\"center\" style=\"text-align: center;\">\u662f\u5426\u63a5\u53d7</p><p align=\"center\" style=\"text-align: center;\">\u8fdb\u53e3\u8bbe\u5907</p></td></tr><tr style=\"height: 57px;\"><td style=\"border-width: 0px 1pt 1pt; border-style: none solid solid; padding: 0cm 5.4pt; border-image: none; width: 158px; height: 57px;\"><p align=\"center\" style=\"text-align: center;\">\u7535\u5f71\u5236\u4f5c\u7cfb\u7edf</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 66px; height: 57px;\"><p align=\"center\" style=\"text-align: center;\">1\u6279</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 331px; height: 57px;\"><p align=\"center\" style=\"text-align: center; line-height: 150%;\">\u9884\u7b97\u91d1\u989d\uff1a173\u4e07\u5143</p><p align=\"center\" style=\"text-align: center; line-height: 150%;\">XM-0000014220180929116</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 104px; height: 57px;\"><p align=\"center\" style=\"text-align: center;\">\u63a5\u53d7</p></td></tr></tbody></table><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>\u6295\u6807\u65b9\u5e94\u9075\u5b88\u6709\u5173\u7684\u4e2d\u56fd\u6cd5\u5f8b\u3001\u6cd5\u89c4\u548c\u6761\u4f8b\uff0c\u5177\u5907\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u4e8c\u5341\u4e8c\u6761\u3001\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u5b9e\u65bd\u6761\u4f8b\u300b\u548c\u672c\u6587\u4ef6\u4e2d\u89c4\u5b9a\u7684\u6761\u4ef6\uff1a1.\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b2.\u8d22\u52a1\u72b6\u51b5\u62a5\u544a\uff0c\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u76f8\u5173\u6750\u6599\uff1b3.\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u3001\u4e13\u4e1a\u6280\u672f\u548c\u65b9\u6848\u5b9e\u65bd\u80fd\u529b\uff1b4.\u53c2\u52a0\u672c\u6b21\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b5.\u5177\u5907\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\u7684\u8bc1\u660e\u6750\u6599\uff1b6.\u4e0d\u540c\u6f5c\u5728\u6295\u6807\u4eba\u7684\u6cd5\u4eba\u3001\u5355\u4f4d\u8d1f\u8d23\u4eba\u4e0d\u662f\u540c\u4e00\u4eba\u4e5f\u4e0d\u5b58\u5728\u76f4\u63a5\u63a7\u80a1\u3001\u7ba1\u7406\u5173\u7cfb\uff1b7.\u8fd1\u4e09\u5e74\u672a\u88ab\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\u53ca\u201c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u201d\u7f51\u7ad9\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\uff1b8.\u672a\u53c2\u4e0e\u672c\u9879\u76ee\u6574\u4f53\u8bbe\u8ba1\u3001\u89c4\u8303\u7f16\u5236\u6216\u8005\u9879\u76ee\u7ba1\u7406\u3001\u76d1\u7406\u3001\u68c0\u6d4b\u7b49\u670d\u52a1\uff1b9.\u6295\u6807\u4eba\u5df2\u9886\u53d6\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\uff0c\u672a\u5411\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u9886\u53d6\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6f5c\u5728\u6295\u6807\u4eba\u5747\u65e0\u8d44\u683c\u53c2\u52a0\u672c\u6b21\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a173.0 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 17:28\u81f32018\u5e7410\u670812\u65e5 16:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u5357\u78e8\u623f\u8def37\u53f7\u534e\u817e\u5317\u642a\u5546\u52a1\u5927\u53a61103\u5ba4</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u53ea\u63a5\u53d7\u73b0\u573a\u62a5\u540d</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u671d\u9633\u533a\u5357\u78e8\u623f\u8def37\u53f7\u534e\u817e\u5317\u642a\u5546\u52a1\u5927\u53a61113\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"line-height: 180%;\">\u672c\u9879\u76ee\u516c\u544a\u671f\u9650\u4e3a5\u4e2a\u5de5\u4f5c\u65e5\u3002</p><p style=\"line-height: 180%;\">\u9879\u76ee\u7f16\u53f7\uff1a<span lang=\"EN-US\" style='font-family: \u5b8b\u4f53; font-size: 12pt; mso-bidi-font-family: \"Times New Roman\"; mso-font-kerning: 1.0pt; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;'><font color=\"#000000\">ZTXY-2018-H28897</font></span></p><p style=\"line-height: 180%;\">\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u65f6\u9700\u643a\u5e26\u8d44\u6599\uff1a</p><p style=\"line-height: 180%; text-indent: 24pt;\">1.\u6cd5\u4eba\u6216\u8005\u5176\u4ed6\u7ec4\u7ec7\u7684\u4f01\u4e1a\u8425\u4e1a\u6267\u7167\u7b49\u8bc1\u660e\u6587\u4ef6\uff0c\u81ea\u7136\u4eba\u7684\u8eab\u4efd\u8bc1\u660e\u590d\u5370\u4ef6(\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0)\u3002</p><p style=\"line-height: 180%; text-indent: 24pt;\">2.\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u4e66\u539f\u4ef6\u53ca\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\u539f\u4ef6\uff08\u6cd5\u4eba\u7b7e\u5b57\u5e76\u52a0\u76d6\u672c\u5355\u4f4d\u516c\u7ae0\uff09\u3002</p><p style=\"line-height: 180%; text-indent: 24pt;\">3.\u5f00\u6237\u8bb8\u53ef\u8bc1\uff08\u590d\u5370\u4ef6\u5e76\u52a0\u76d6\u672c\u5355\u4f4d\u516c\u7ae0\uff09\u3002</p><p style=\"line-height: 180%;\"></p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p style=\"margin: 0cm 0cm 0pt; line-height: 180%;\"><span style=\"line-height: 180%; font-family: \u5b8b\u4f53; font-size: 12pt;\"><font color=\"#000000\">\u8282\u80fd\u4ea7\u54c1\u5f3a\u5236\u91c7\u8d2d\u3001\u8282\u80fd\u4ea7\u54c1\u3001\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u4f18\u5148\u91c7\u8d2d\u3001\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\u3001\u653f\u5e9c\u91c7\u8d2d\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\u3001\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\u3001\u8fdb\u53e3\u4ea7\u54c1\u7ba1\u7406\u3001\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a\u3001\u6276\u6301\u4e0d\u53d1\u8fbe\u5730\u533a\u548c\u5c11\u6570\u6c11\u65cf\u5730\u533a\u7b49\u3002</font></span></p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               