{"title": "[\u516c\u5f00]\u9996\u90fd\u4f53\u80b2\u5b66\u9662\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6-\u8bbe\u5907\u8d2d\u7f6e-\u6ed1\u96ea\u6559\u5b66\u5668\u6750\u8d2d\u7f6e\uff08\u5e02\u7ea7\uff09\u66f4\u6b63\u516c\u544a\uff08\u7b2c\u4e09\u6b21\uff09", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6-\u8bbe\u5907\u8d2d\u7f6e-\u6ed1\u96ea\u6559\u5b66\u5668\u6750\u8d2d\u7f6e\uff08\u5e02\u7ea7\uff09</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000014206180904100</p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u51af\u5973\u58eb</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-69943418</p><p></p><p><strong>\u4e8c\u3001\u539f\u516c\u544a\u540d\u79f0\u53ca\u5730\u5740\u65f6\u95f4\u7b49\uff1a</strong></p><p>\u9996\u6b21\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670806\u65e5</p><p>\u672c\u6b21\u53d8\u66f4\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u539f\u516c\u544a\u9879\u76ee\u540d\u79f0\uff1a\u6539\u5584\u529e\u5b66\u4fdd\u969c\u6761\u4ef6-\u8bbe\u5907\u8d2d\u7f6e-\u6ed1\u96ea\u6559\u5b66\u5668\u6750\u8d2d\u7f6e\uff08\u5e02\u7ea7\uff09</p><p>\u539f\u516c\u544a\u5730\u5740\uff1ahttp://www.ccgp.gov.cn/cggg/dfgg/gkzb/201809/t20180906_10639439.htm</p><p></p><p><strong>\u4e09\u3001\u66f4\u6b63\u4e8b\u9879\u3001\u5185\u5bb9\uff1a</strong></p><p></p><p style=\"margin-left:0.7500pt;text-indent:-0.7500pt;line-height:20.0000pt;\"><strong>\uff081\uff09\u539f\u62db\u6807\u516c\u544a\u53ca\u62db\u6807\u6587\u4ef6\u4e2d\uff1a</strong></p><p style=\"margin-left:0.7500pt;text-indent:-0.7000pt;line-height:20.0000pt;\">\u6295\u6807\u6587\u4ef6\u9012\u4ea4\u622a\u6b62\u65f6\u95f4\u53ca\u5f00\u6807\u65f6\u95f4\uff1a2018\u5e7410\u670810\u65e5\u4e0a\u534809:30(\u5317\u4eac\u65f6\u95f4)</p><p style=\"margin-left:0.7500pt;text-indent:-0.7500pt;line-height:20.0000pt;\"><strong>\u73b0\u66f4\u6b63\u4e3a\uff1a</strong></p><p style=\"margin-left:0.7500pt;text-indent:-0.7000pt;line-height:20.0000pt;\">\u6295\u6807\u6587\u4ef6\u9012\u4ea4\u622a\u6b62\u65f6\u95f4\u53ca\u5f00\u6807\u65f6\u95f4\uff1a2018\u5e7410\u670817\u65e5\u4e0a\u534809:30(\u5317\u4eac\u65f6\u95f4)</p><p><strong>\uff082\uff09\u539f\u62db\u6807\u6587\u4ef6\u7b2c78\u9875\u7b2c14\u6761\u201c\u6ed1\u96ea\u8ba1\u65f6\u8ba1\u5206\u7cfb\u7edf\u201d\uff1a</strong>\u2605<strong>1.</strong>\u8ba1\u65f6\u4e3b\u673a\u4e00\u5957\u3001\u26052.\u5207\u5149\u5668<strong>\u4e24\u9879</strong>\u4e2d\u5220\u9664\u201c\u901a\u8fc7\u56fd\u9645\u96ea\u8054FIS\u8ba4\u8bc1\u201d\u3002</p><p style=\"line-height:20.0000pt;\"><strong>\uff083\uff09\u539f\u62db\u6807\u6587\u4ef6\u4e2d\u6295\u6807\u8d44\u6599\u8868\u7b2c9\u9875\u7b2c15.4\u6761\uff1a</strong></p><p style=\"margin-left:-0.7500pt;line-height:20.0000pt;\">\u5efa\u8bae\u4efb\u4f55\u5f62\u5f0f\u9012\u4ea4\u7684\u6295\u6807\u4fdd\u8bc1\u91d1\u4e8e2018\u5e7410\u670808\u65e5\u4e0a\u534812:00\u65f6\u524d\u5168\u989d\u5230\u8d26\u3002</p><p style=\"margin-left:-0.7500pt;line-height:20.0000pt;\"><strong>\u73b0\u66f4\u6b63\u4e3a\uff1a</strong></p><p style=\"margin-left:-0.7500pt;line-height:20.0000pt;\">\u5efa\u8bae\u4efb\u4f55\u5f62\u5f0f\u9012\u4ea4\u7684\u6295\u6807\u4fdd\u8bc1\u91d1\u4e8e2018\u5e7410\u670812\u65e5\u4e0a\u534812:00\u65f6\u524d\u5168\u989d\u5230\u8d26\u3002</p><p style=\"line-height:20.0000pt;\"><strong>\uff084\uff09\u5176\u4ed6\u62db\u6807\u5185\u5bb9\u4e0d\u53d8\u3002</strong></p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p>CEITCL-BJ13-1808105-01</p><p>\u540d\u79f0\u3001\u6570\u91cf\u53ca\u7b80\u8981\u6280\u672f\u9700\u6c42\uff1a\u8be6\u89c1\u9644\u4ef6</p><p></p><p><strong>\u4e94\u3001\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u9996\u90fd\u4f53\u80b2\u5b66\u9662</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u5317\u4e09\u73af\u897f\u8def11\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u738b\u8001\u5e08010-82099138</p><p></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u4e2d\u7ecf\u56fd\u9645\u62db\u6807\u96c6\u56e2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6ee8\u6cb3\u8def1\u53f7\u822a\u5929\u4fe1\u606f\u5927\u53a6\u4e03-\u516b\u5c42</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a010-69943418</p><p></p><p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      <p>                                                                                      </p>                                          <p>                                                                                      </p>