{"title": "[\u660c\u5e73]\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4f4f\u623f\u548c\u57ce\u4e61\u5efa\u8bbe\u59d4\u5458\u4f1a\u539f\u533a\u7eaa\u59d4\u529e\u516c\u697c\u6539\u9020\u5de5\u7a0b\u7ade\u4e89\u6027\u78cb\u5546", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u4f73\u76ca\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4f4f\u623f\u548c\u57ce\u4e61\u5efa\u8bbe\u59d4\u5458\u4f1a\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u539f\u533a\u7eaa\u59d4\u529e\u516c\u697c\u6539\u9020\u5de5\u7a0b\u8fdb\u884c\u7ade\u4e89\u6027\u78cb\u5546\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u539f\u533a\u7eaa\u59d4\u529e\u516c\u697c\u6539\u9020\u5de5\u7a0b</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>JYZB-2018-038</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5546\u8001\u5e08     \u803f\u8001\u5e08</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-69713269</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4f4f\u623f\u548c\u57ce\u4e61\u5efa\u8bbe\u59d4\u5458\u4f1a</p><p></p>  <p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u660c\u5e73\u533a\u592a\u5b89\u80e1\u540c5\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u674e\u8001\u5e0880110101</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u4f73\u76ca\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u5546\u8001\u5e08     \u803f\u8001\u5e08010-69713269</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u660c\u5e73\u533a\u84dd\u90e1\u5e95\u5546\u897f\u73af\u8def29-12</p><p></p>       <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p>\u539f\u533a\u7eaa\u59d4\u529e\u516c\u697c\u6539\u9020\u7b49\uff0c\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p><strong>\u4e8c\u3001\u5bf9\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\uff08\u4f9b\u5e94\u5546\u8d44\u683c\u6761\u4ef6\uff09:</strong></p><p>\uff081\uff09\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u5408\u6cd5\u6ce8\u518c\u7684\uff0c\u5177\u6709\u72ec\u7acb\u6cd5\u4eba\u8d44\u683c\u3002\uff082\uff09\u6ee1\u8db3\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u62db\u6807\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u89c4\u5b9a\u7684\u6240\u6709\u6761\u4ef6\u3002\uff083\uff09\u5177\u6709\u5efa\u7b51\u88c5\u4fee\u88c5\u9970\u5de5\u7a0b\u4e13\u4e1a\u627f\u5305\u4e09\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u65bd\u5de5\u8d44\u8d28\u3002\uff084)\u62df\u6d3e\u7684\u9879\u76ee\u7ecf\u7406\u5e94\u5177\u5907\u623f\u5c4b\u5efa\u7b51\u5de5\u7a0b\u4e13\u4e1a\u4e8c\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u6ce8\u518c\u5efa\u9020\u5e08\u8d44\u683c\u53ca\u5efa\u7b51\u5b89\u5168\u8003\u6838\u8bc1\u4e66\uff08\u5b89\u5168B\u672c\uff09\uff0c\u4e14\u4e1a\u7ee9\u3001\u4fe1\u8a89\u826f\u597d\u3002\uff085\uff09\u6295\u6807\u65b9\u5fc5\u987b\u914d\u5907\u65bd\u5de5\u5458\u3001\u8d28\u68c0\u5458\u3001\u5b89\u5168\u5458\u3001\u6750\u6599\u5458\u3001\u9884\u7b97\u5458\u7b49\u4e3b\u8981\u65bd\u5de5\u7ba1\u7406\u4eba\u5458\uff0c\u4e0a\u8ff0\u65bd\u5de5\u7ba1\u7406\u4eba\u5458\u5fc5\u987b\u6301\u6709\u4e0a\u5c97\u8bc1\u4e66\u3002\uff086\uff09\u6295\u6807\u65b9\u6240\u914d\u5907\u7684\u9879\u76ee\u7ecf\u7406\u3001\u6280\u672f\u8d1f\u8d23\u4eba\u53ca\u4e3b\u8981\u65bd\u5de5\u7ba1\u7406\u4eba\u5458\u4e0d\u5f97\u53c2\u4e0e\u672c\u5de5\u7a0b\u4ee5\u5916\u7684\u5176\u4ed6\u5de5\u7a0b\u7684\u6295\u6807\u3002\uff087\uff09\u5916\u5730\u8fdb\u4eac\u5efa\u7b51\u4f01\u4e1a\u9700\u6301\u6709\u300a\u5317\u4eac\u5e02\u5efa\u7b51\u4e1a\u4f01\u4e1a\u6863\u6848\u7ba1\u7406\u624b\u518c\u300b\uff1b\uff088\uff09\u672c\u5de5\u7a0b\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\uff1b</p><p></p><p><strong>\u4e09\u3001\u78cb\u5546\u548c\u54cd\u5e94\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9\u7b49:</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a145.108991 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7410\u670819\u65e5 08:30</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670811\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u84dd\u90e1\u5e95\u5546\u897f\u73af\u8def29-12</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65b9\u5f0f\uff1a\uff081\uff09\u4f01\u4e1a\u8425\u4e1a\u6267\u7167\uff1b\uff082\uff09\u4f01\u4e1a\u8d44\u8d28\u8bc1\u4e66\uff1b\uff083\uff09\u5b89\u5168\u751f\u4ea7\u8bb8\u53ef\u8bc1\uff1b\uff084\uff09\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u4e66\u3001\u88ab\u6388\u6743\u4eba\u793e\u4fdd\u8bc1\u660e\uff08\u539f\u4ef6\uff09\uff1b\u6cd5\u5b9a\u4ee3\u8868\u4eba\u548c\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\u539f\u4ef6\u53ca\u76d6\u7ae0\u590d\u5370\u4ef6\uff1b\uff085\uff09\u9879\u76ee\u8d1f\u8d23\u4eba\u5efa\u9020\u5e08\u6267\u4e1a\u8bc1\u3001\u6ce8\u518c\u8bc1\u3001\u5b89\u5168B\u672c\uff1b\uff086\uff09\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08\u672a\u88ab\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u540d\u5355\uff09\u67e5\u8be2\u8bb0\u5f55\uff087\uff09\u201c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u201d\u7f51\u7ad9\u62db\u6807\u516c\u544a\u53d1\u51fa\u65e5\u671f\u4e4b\u540e\u67e5\u8be2\u8bb0\u5f55\uff08\u4ee5\u4e0a\u4f01\u4e1a\u8d44\u683c\u6750\u6599\u63d0\u4f9b\u539f\u4ef6\u53ca\u76d6\u516c\u7ae0\u590d\u5370\u4ef6\uff0c\u539f\u4ef6\u5ba1\u6838\u540e\u9000\u56de\uff09\uff1b\uff1f</p><p>\u78cb\u5546\u6587\u4ef6\u552e\u4ef7\uff1a500.0  \u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u65f6\u95f4\uff1a2018\u5e7410\u670819\u65e5 08:00\u81f32018\u5e7410\u670819\u65e5 08:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u84dd\u90e1\u5e95\u5546\u897f\u73af\u8def29-12</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7410\u670819\u65e5 08:30</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u84dd\u90e1\u5e95\u5546\u897f\u73af\u8def29-12</p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5546\u8001\u5e08     \u803f\u8001\u5e08</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-69713269</p><p></p><p><strong>\u516d\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u7b26\u5408\u6cd5\u5f8b\u6cd5\u89c4\u8981\u6c42</p><p></p><p></p>    <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                        