{"title": "[\u516c\u5f00]\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u516c\u5b89\u4ea4\u901a\u7ba1\u7406\u5c40\u672c\u7ea72019\u5e74\u91c7\u8d2d\u5370\u5237\u7eb8\u5f20\u53ca\u8f85\u6599\u9879\u76ee\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u8bda\u8dc3\u65b0\uff08\u5317\u4eac\uff09\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u516c\u5b89\u4ea4\u901a\u7ba1\u7406\u5c40\u672c\u7ea7\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf92019\u5e74\u91c7\u8d2d\u5370\u5237\u7eb8\u5f20\u53ca\u8f85\u6599\u9879\u76ee\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>2019\u5e74\u91c7\u8d2d\u5370\u5237\u7eb8\u5f20\u53ca\u8f85\u6599\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000007102180910227</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u82cf\u5973\u58eb</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-68398366  </p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u516c\u5b89\u4ea4\u901a\u7ba1\u7406\u5c40\u672c\u7ea7</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u961c\u6210\u95e8\u5317\u5927\u88571\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-68398366  </p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u4e2d\u8bda\u8dc3\u65b0\uff08\u5317\u4eac\uff09\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a010-51201619 13124797529</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u671d\u9633\u533a\u96c5\u5b9d\u8def12\u53f7\u534e\u58f0\u56fd\u9645\u5927\u53a61608\u5ba4</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%;\"><span style='font-family: \u5b8b\u4f53; font-size: 12pt; mso-font-kerning: 1.0pt; mso-bidi-font-family: \"Times New Roman\"; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;'><font color=\"#000000\">\u91c7\u8d2d\u9879\u76ee\u540d\u79f0\uff1a<span lang=\"EN-US\">2019</span>\u5e74\u91c7\u8d2d\u5370\u5237\u7eb8\u5f20\u53ca\u8f85\u6599\u9879\u76ee</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%;\"><span style=\"line-height: 150%; font-family: \u5b8b\u4f53; font-size: 12pt;\"><font color=\"#000000\">\u91c7\u8d2d\u6570\u91cf\uff1a\u4e00\u6279</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%;\"><span style=\"line-height: 150%; font-family: \u5b8b\u4f53; font-size: 12pt;\"><font color=\"#000000\">\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a\u672c\u6b21\u62db\u6807\u91c7\u8d2d\u662f\u4e3a\u5317\u4eac\u5e02\u516c\u5b89\u5c40\u516c\u5b89\u4ea4\u901a\u7ba1\u7406\u5c40\u91c7\u8d2d\u5370\u5237\u8017\u6750\uff0c\u4f9b\u5e94\u5546\u5e94\u6839\u636e\u62db\u6807\u6587\u4ef6\u6240\u63d0\u51fa\u7684\u6280\u672f\u89c4\u683c\u548c\u670d\u52a1\u8981\u6c42\uff0c\u7efc\u5408\u8003\u8651\u8bbe\u5907\u7684\u9002\u7528\u6027\uff0c\u9009\u62e9\u9700\u8981\u6700\u4f73\u6027\u80fd\u4ef7\u683c\u6bd4\u7684\u8d27\u7269\u524d\u6765\u6295\u6807\u3002\u4f9b\u5e94\u5546\u5e94\u4ee5\u6280\u672f\u5148\u8fdb\u7684\u8d27\u7269\u3001\u4f18\u826f\u7684\u670d\u52a1\u548c\u4f18\u60e0\u7684\u4ef7\u683c\uff0c\u5145\u5206\u663e\u793a\u81ea\u5df1\u7684\u7ade\u4e89\u5b9e\u529b\u3002</font></span></p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>\uff081\uff09\u5177\u5907\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u89c4\u5b9a\u7684\u6761\u4ef6\u3002\uff082\uff09\u88ab\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u7684\uff0c\u4e0d\u5f97\u53c2\u52a0\u672c\u6b21\u91c7\u8d2d\u3002\uff083\uff09\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a340.0 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u96c5\u5b9d\u8def12\u53f7\u534e\u58f0\u56fd\u9645\u5927\u53a61608\u5ba4</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u8be6\u89c1\u5176\u4ed6\u8865\u5145\u4e8b\u5b9c</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670825\u65e5 14:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670825\u65e5 14:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u671d\u9633\u533a\u96c5\u5b9d\u8def12\u53f7\u534e\u58f0\u56fd\u9645\u5927\u53a61006\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin: 0cm 0cm 0pt -0.95pt; line-height: 150%; text-indent: 0.7pt;\">\u62db\u6807\u6587\u4ef6\u53d1\u552e\u65f6\u95f4\uff1a2018\u5e749\u670830\u65e5\u81f32018\u5e7410\u670812\u65e5(\u8282\u5047\u65e5\u9664\u5916)\uff0c\u4e0a\u53489:00\u81f3\u4e0b\u534816:00\uff08\u5317\u4eac\u65f6\u95f4\uff09\u3002</p><p style=\"line-height: 150%;\">\u62db\u6807\u6587\u4ef6\u53d1\u552e\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u96c5\u5b9d\u8def12\u53f7\u534e\u58f0\u56fd\u9645\u5927\u53a61608\u5ba4</p><p style=\"margin: 0cm 0cm 0pt 78pt; line-height: 150%; text-indent: -78pt;\">\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\u6bcf\u5957\u4eba\u6c11\u5e01500\u5143\uff1b\u62db\u6807\u6587\u4ef6\u552e\u540e\u4e0d\u9000\u3002\u672a\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u4e0d\u5f97\u53c2\u52a0\u6295\u6807\u3002</p><p style=\"line-height: 150%;\"><strong>\u6ce8\uff1a\u8d2d\u4e70\u6587\u4ef6\u65f6\uff0c\u987b\u63d0\u4f9b\u4ee5\u4e0b\u8d44\u6599\u67e5\u9a8c\uff0c\u5ba1\u6838\u5408\u683c\u540e\u5177\u5907\u8d2d\u4e70\u6587\u4ef6\u7684\u8d44\u683c\uff1a</strong></p><p style=\"line-height: 150%;\">1\u3001\u8425\u4e1a\u6267\u7167\uff08\u65b0\u7248\uff09\u526f\u672c\uff08\u52a0\u76d6\u516c\u7ae0\u590d\u5370\u4ef6\uff09\uff1b</p><p style=\"line-height: 150%;\">2\u3001\u5982\u62a5\u540d\u4eba\u4e3a\u6cd5\u5b9a\u4ee3\u8868\u4eba\uff1a\u4f9b\u5e94\u5546\u5355\u4f4d\u5f00\u5177\u7684\u6cd5\u4eba\u8eab\u4efd\u8bc1\u660e\u539f\u4ef6\u3001\u6cd5\u4eba\u672c\u4eba\u8eab\u4efd\u8bc1\u539f\u4ef6\u53ca\u52a0\u76d6\u516c\u7ae0\u590d\u5370\u4ef6\uff1b\u5982\u62a5\u540d\u4eba\u4e3a\u6388\u6743\u4ee3\u7406\u4eba\uff1a\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u59d4\u6258\u4e66\u539f\u4ef6\uff08\u5185\u5bb9\u81ea\u62df\uff0c\u4f46\u6388\u6743\u4e8b\u9879\u5fc5\u987b\u5305\u542b\u9488\u5bf9\u672c\u9879\u76ee\u62a5\u540d\u4e8b\u5b9c\uff09\u3001\u672c\u4eba\u8eab\u4efd\u8bc1\u539f\u4ef6\u53ca\u52a0\u76d6\u516c\u7ae0\u590d\u5370\u4ef6\u3002</p><p style=\"margin: 0cm 0cm 0pt 78pt; line-height: 150%; text-indent: -78pt;\">\u63a5\u53d7\u6295\u6807\u65f6\u95f4\uff1a2018\u5e7410\u670825\u65e5\u4e0b\u534814:00\uff0d14:30\uff08\u5317\u4eac\u65f6\u95f4\uff09</p><p style=\"line-height: 150%;\">\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a2018\u5e7410\u670825\u65e5\u4e0b\u534814:30\uff08\u5317\u4eac\u65f6\u95f4\uff09\uff0c\u903e\u671f\u9001\u8fbe\u6216\u8005\u672a\u6309\u7167\u62db\u6807\u6587\u4ef6\u8981\u6c42\u5bc6\u5c01\u7684\u6295\u6807\u6587\u4ef6\u6055\u4e0d\u63a5\u6536\u3002</p><p style=\"line-height: 150%;\">\u5f00\u6807\u65f6\u95f4\uff1a2018\u5e7410\u670825\u65e5\u4e0b\u534814:30\uff08\u5317\u4eac\u65f6\u95f4\uff09</p><p style=\"line-height: 150%;\">\u5f00\u6807\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u96c5\u5b9d\u8def12\u53f7\u534e\u58f0\u56fd\u9645\u5927\u53a61006\u5ba4</p><p style=\"margin: 0cm 0cm 0pt 96pt; line-height: 150%; text-indent: -96pt;\">\u8bc4\u6807\u65b9\u6cd5\uff1a\u7efc\u5408\u8bc4\u5206\u6cd5</p><p style=\"line-height: 150%;\">\u5f00\u6237\u540d\uff1a\u4e2d\u8bda\u8dc3\u65b0\uff08\u5317\u4eac\uff09\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p style=\"line-height: 150%;\">\u5f00\u6237\u884c\uff1a\u4e2d\u56fd\u94f6\u884c\u5317\u4eac\u96c5\u5b9d\u8def\u652f\u884c</p><p style=\"line-height: 150%;\">\u8d26\u53f7\uff1a329864994010</p><p style=\"line-height: 150%;\">\u9879\u76ee\u8d1f\u8d23\u4eba\uff1a\u82cf\u5973\u58eb</p><p style=\"line-height: 150%;\">\u7535 \u8bdd\uff1a010-51201619 13124797529 </p><p style=\"line-height: 150%;\">\u672c\u516c\u544a\u671f\u9650\u4e3a5\u4e2a\u5de5\u4f5c\u65e5</p><p align=\"left\" style=\"text-align: left; line-height: 150%;\">\u672c\u9879\u76ee\u516c\u544a\u4ec5\u53d1\u5e03\u4e8e\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51(www.ccgp.gov.cn/)\u53ca\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u7f51(www.ccgp-beijing.gov.cn/),\u8f6c\u8f7d\u65e0\u6548\u3002</p><p style=\"line-height: 150%;\"></p><p align=\"right\" style=\"text-align: right; line-height: 150%;\"> \u4e2d\u8bda\u8dc3\u65b0\uff08\u5317\u4eac\uff09\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p align=\"right\" style=\"text-align: right; line-height: 150%;\"> 2018\u5e749\u670830\u65e5</p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p style=\"line-height: 150%;\">1\u3001\u672c\u9879\u76ee\u975e\u4e13\u95e8\u9762\u5411\u4e2d\u578b\u3001\u5c0f\u578b\u3001\u5fae\u578b\u4f01\u4e1a\u91c7\u8d2d/\u975e\u4e13\u95e8\u9762\u5411\u76d1\u72f1\u4f01\u4e1a/\u975e\u4e13\u95e8\u9762\u5411\u6b8b\u75be\u4eba\u798f\u5229\u6027\u5355\u4f4d\u91c7\u8d2d\uff1b\u5bf9\u7b26\u5408\u89c4\u5b9a\u7684\u5c0f\u578b\u548c\u5fae\u578b\u4f01\u4e1a/\u76d1\u72f1\u4f01\u4e1a/\u6b8b\u75be\u4eba\u798f\u5229\u6027\u5355\u4f4d\u63d0\u4f9b\u7684\u8d27\u7269\u6216\u670d\u52a1\u4ef7\u683c\u7ed9\u4e88\u4e00\u5b9a\u7684\u6263\u9664\uff0c\u7528\u6263\u9664\u540e\u7684\u4ef7\u683c\u53c2\u4e0e\u8bc4\u5ba1\u3002</p><p style=\"line-height: 150%;\">2\u3001\u672c\u9879\u76ee\u672a\u7ecf\u4e13\u5bb6\u8bba\u8bc1\u53ef\u91c7\u8d2d\u8fdb\u53e3\u4ea7\u54c1\uff0c\u6545\u4f9b\u5e94\u5546\u6240\u63d0\u4f9b\u8bbe\u5907\u4ec5\u9650\u4ea7\u81ea\u4e2d\u56fd\u5883\u5185\u7684\u4ea7\u54c1\u3002</p><p style=\"line-height: 150%;\">3\u3001\u4f9b\u5e94\u5546\u6240\u63d0\u4f9b\u8bbe\u5907\u4e2d\u5982\u679c\u6d89\u53ca\u653f\u5e9c\u5f3a\u5236\u91c7\u8d2d\u8282\u80fd\u4ea7\u54c1\uff0c\u4ea7\u54c1\u987b\u4e3a\u8fdb\u5165\u8d22\u653f\u90e8\u3001\u56fd\u5bb6\u53d1\u5c55\u6539\u9769\u59d4\u53d1\u5e03\u7684\u6700\u65b0\u4e00\u671f\u7684\u300a\u8282\u80fd\u4ea7\u54c1\u653f\u5e9c\u91c7\u8d2d\u6e05\u5355\u300b\u4e2d\u7684\u4ea7\u54c1\uff1b\u4f9b\u5e94\u5546\u6240\u63d0\u4f9b\u8bbe\u5907\u4e2d\u5982\u6709\u8282\u80fd\u73af\u4fdd\u4ea7\u54c1\uff0c\u5219\u5bf9\u8282\u80fd\u73af\u4fdd\u4ea7\u54c1\u8fdb\u884c\u989d\u5916\u653f\u7b56\u6027\u52a0\u5206\u3002</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        