{"title": "[\u671d\u9633]\u5317\u4eac\u5174\u9686\u5fa1\u56ed\u56ed\u6797\u7eff\u5316\u53d1\u5c55\u6709\u9650\u516c\u53f8\u5174\u9686\u516c\u56ed\u666f\u89c2\u63d0\u5347\u6539\u9020\u5de5\u7a0b\u4e8c\u671f\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5b8f\u6e90\u5408\u6b63\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5174\u9686\u5fa1\u56ed\u56ed\u6797\u7eff\u5316\u53d1\u5c55\u6709\u9650\u516c\u53f8\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5174\u9686\u516c\u56ed\u666f\u89c2\u63d0\u5347\u6539\u9020\u5de5\u7a0b\u4e8c\u671f\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5174\u9686\u516c\u56ed\u666f\u89c2\u63d0\u5347\u6539\u9020\u5de5\u7a0b\u4e8c\u671f</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>HYHZ2018533</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u9633</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-62386599</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5174\u9686\u5fa1\u56ed\u56ed\u6797\u7eff\u5316\u53d1\u5c55\u6709\u9650\u516c\u53f8</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u9ad8\u7891\u5e97\u4e61\u5174\u9686\u5e84\u75328\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-85761310 </p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u5b8f\u6e90\u5408\u6b63\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a010-62386599</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u897f\u57ce\u533a\u5317\u4e09\u73af\u4e2d\u8def\u753229\u53f73\u53f7\u697c\u534e\u9f99\u5927\u53a6A\u5ea71901</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u91c7\u8d2d\u5185\u5bb9\uff1a\u6539\u9020\u5de5\u7a0b</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font face=\"\u5b8b\u4f53\"><font color=\"#000000\">\u91c7\u8d2d\u6570\u91cf\uff1a<span lang=\"EN-US\">1</span></font><font color=\"#000000\">\u9879</font></font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u91c7\u8d2d\u65b9\u5f0f\uff1a\u516c\u5f00\u62db\u6807</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u9009\u62e9\u672c\u62db\u6807\u65b9\u5f0f\u7684\u539f\u56e0\uff1a\u9002\u7528</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u91c7\u8d2d\u7528\u9014\uff1a\u6539\u9020\u5de5\u7a0b</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font face=\"\u5b8b\u4f53\"><font color=\"#000000\">\u7b80\u8981\u6280\u672f\u8981\u6c42<span lang=\"EN-US\">/</span></font><font color=\"#000000\">\u62db\u6807\u9879\u76ee\u6027\u8d28\uff1a\u5de5\u7a0b\u65bd\u5de5\uff0c\u8be6\u89c1\u62db\u6807\u6587\u4ef6</font></font></span></p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>1.\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u5408\u6cd5\u6ce8\u518c\u7684\uff0c\u5177\u6709\u72ec\u7acb\u6cd5\u4eba\u8d44\u683c\uff1b2.\u5177\u5907\u5efa\u7b51\u5de5\u7a0b\u65bd\u5de5\u603b\u627f\u5305\u4e09\u7ea7\u53ca\u4ee5\u4e0a\u7ea7\u8d44\u8d28\uff1b3\u5177\u6709\u5728\u6709\u6548\u671f\u5185\u7684\u5b89\u5168\u751f\u4ea7\u8bb8\u53ef\u8bc1\uff1b4.\u9879\u76ee\u7ecf\u7406\u5177\u5907\u8d30\u7ea7\u53ca\u4ee5\u4e0a\u6ce8\u518c\u5efa\u9020\u5e08\u8d44\u683c\uff1b5. \u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\uff1b6. \u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002 </p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a236.166714 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670811\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5317\u4e09\u73af\u4e2d\u8def\u753229\u53f73\u53f7\u697c\u534e\u9f99\u5927\u53a6A\u5ea71901</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u9886\u53d6</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 10:00</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 10:00</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5317\u4e09\u73af\u4e2d\u8def\u753229\u53f73\u53f7\u697c\u534e\u9f99\u5927\u53a6A\u5ea71901</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><font color=\"#000000\"><font face=\"\u5b8b\u4f53\"><span lang=\"EN-US\" style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\">1.</span><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\">\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u7535\u8bdd\u3001\u4f20\u771f\u3001\u7535\u5b50\u90ae\u4ef6\u7b49\u5f62\u5f0f\u7684\u6295\u6807\u62a5\u540d\uff0c\u8bf7\u6309\u89c4\u5b9a\u5728\u62a5\u540d\u65f6\u643a\u5e26\u5982\u4e0b\u6750\u6599\uff1a</span></font></font></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u2460\u4f01\u4e1a\u8425\u4e1a\u6267\u7167\u526f\u672c\u539f\u4ef6\uff08\u73b0\u573a\u6838\u9a8c\uff09\u53ca\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\uff1b</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u2461\u4f01\u4e1a\u8d44\u8d28\u8bc1\u4e66\u526f\u672c\u539f\u4ef6\uff08\u73b0\u573a\u6838\u9a8c\uff09\u53ca\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\uff1b</font></span></p><p style=\"margin: 0cm 0cm 0pt; line-height: 150%; -ms-layout-grid-mode: char;\"><span style=\"line-height: 150%; font-size: 12pt; font-weight: normal;\"><font color=\"#000000\" face=\"\u5b8b\u4f53\">\u2462\u4f01\u4e1a\u5b89\u5168\u751f\u4ea7\u8bb8\u53ef\u8bc1\u526f\u672c\u539f\u4ef6\uff0