{"title": "[\u623f\u5c71]\u5317\u4eac\u5e02\u623f\u5c71\u533a\u57ce\u5e02\u7ba1\u7406\u59d4\u5458\u4f1a\u62f1\u8fb0\u5317\u5927\u8857\u7167\u660e\u5de5\u7a0b\u4e2d\u6807\u5019\u9009\u4eba\u516c\u793a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5929\u8bda\u6668\u5174\u5546\u52a1\u670d\u52a1\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u623f\u5c71\u533a\u57ce\u5e02\u7ba1\u7406\u59d4\u5458\u4f1a\u7684\u59d4\u6258\uff0c\u5c31\u5317\u4eac\u5e02\u623f\u5c71\u533a\u57ce\u5e02\u7ba1\u7406\u59d4\u5458\u4f1a\u62f1\u8fb0\u5317\u5927\u8857\u7167\u660e\u5de5\u7a0b\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aTCCX-2018-099\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aTCCX-2018-099</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u623f\u5c71\u533a\u57ce\u5e02\u7ba1\u7406\u59d4\u5458\u4f1a\u62f1\u8fb0\u5317\u5927\u8857\u7167\u660e\u5de5\u7a0b</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u738b\u5148\u751f  </p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-69351968 </p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u623f\u5c71\u533a\u57ce\u5e02\u7ba1\u7406\u59d4\u5458\u4f1a</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u623f\u5c71\u533a\u826f\u4e61\u62f1\u8fb0\u5317\u5927\u885711\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u674e\u5973\u58eb010-81387930</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p style=\"text-indent: -52.5pt; margin: 1em 0px 1em 52.5pt\">\u9879\u76ee\u7528\u9014\uff1a\u5317\u4eac\u5e02\u623f\u5c71\u533a\u57ce\u5e02\u7ba1\u7406\u59d4\u5458\u4f1a\u62f1\u8fb0\u5317\u5927\u8857\u7167\u660e\u5de5\u7a0b</p><p style=\"text-indent: -52.5pt; margin: 1em 0px 1em 52.5pt\">\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u987b\u5177\u5907\u5efa\u8bbe\u884c\u653f\u4e3b\u7ba1\u90e8\u95e8\u9881\u53d1\u7684\u5e02\u653f\u516c\u7528\u5de5\u7a0b\u65bd\u5de5\u603b\u627f\u5305\u53c1\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u8d44\u8d28\u6216\u57ce\u5e02\u53ca\u9053\u8def\u7167\u660e\u5de5\u7a0b\u4e13\u4e1a\u627f\u5305\u53c1\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u8d44\u8d28\u7b49</p><p style=\"text-indent: -73.5pt; margin: 1em 0px 1em 73.5pt\"></p><p style=\"text-indent: -73.5pt; margin: 1em 0px 1em 73.5pt\">\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</p><p style=\"text-indent: 26.25pt; margin: 1em 0px\">\u8ba1\u5212\u5de5\u671f\uff1a14\u5929\uff08\u65e5\u5386\u65e5\uff09</p><p style=\"text-indent: 26.25pt; margin: 1em 0px\">\u8ba1\u5212\u5f00\u5de5\u65e5\u671f\uff1a2018\u5e7410\u670818\u65e5</p><p>\u8ba1\u5212\u7ae3\u5de5\u65e5\u671f\uff1a2018\u5e7410\u670831\u65e5</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u5929\u8bda\u6668\u5174\u5546\u52a1\u670d\u52a1\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u623f\u5c71\u533a\u826f\u4e61\u897f\u6f5e\u5357\u5927\u885718\u53f7\u9662\u897f\u4fa7\u4e00\u5c42</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u738b\u5148\u751f010-69351968 </p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670810\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7410\u670811\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a172.1824710 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td>\u5e8f\u53f7</td><td>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0</td><td>\u4e2d\u6807\u4f9b\u5e94\u5546\u8054\u7cfb\u5730\u5740</td><td>\u4e2d\u6807\u91d1\u989d(\u4e07\u5143)</td></tr><tr><td>1</td><td>\u5317\u4eac\u5e02\u5929\u5947\u4f1f\u4e1a\u5e02\u653f\u5de5\u7a0b\u6709\u9650\u516c\u53f8</td><td>\u5317\u4eac\u5e02\u623f\u5c71\u533a\u960e\u6751\u9547\u7126\u5e84\u6751\u6751\u59d4\u4f1a\u4e1c20\u7c73</td><td>172.182471</td></tr></tbody></table><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.22259 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u7ecf\u8d22\u653f\u8bc4\u5ba1\uff0c\u7531\u62db\u6807\u4eba\u652f\u4ed8</p><p></p><p>\u8bc4\u5ba1\u4e13\u5bb6\u540d\u5355\uff1a</p><p>\u9ec4\u745e\u5370\u3001\u90ed\u6167\u7b60\u3001\u7530\u743c\u3001\u6c6a\u671d\u6656\u3001\u5f20\u6625\u5f66</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</p><p></p><p style=\"margin: 1em 0px\">\u4e2d\u6807\u6807\u7684\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u623f\u5c71\u533a\u57ce\u5e02\u7ba1\u7406\u59d4\u5458\u4f1a\u62f1\u8fb0\u5317\u5927\u8857\u7167\u660e\u5de5\u7a0b</p><p>\u91c7\u8d2d\u5185\u5bb9\uff1a\u7535\u6c14\u5de5\u7a0b\u3001\u5e02\u653f\u5de5\u7a0b\u7b49</p><p></p><p><strong>\u516d\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin: 1em 0px\">\u62db\u6807\u65b9\u5f0f\uff1a\u516c\u5f00\u62db\u6807</p><p style=\"margin: 1em 0px\">\u9009\u62e9\u8be5\u91c7\u8d2d\u65b9\u5f0f\u7684\u539f\u56e0\uff1a\u623f\u8d22\u653f\u91c7[2018]434\u53f7</p><p>\u786e\u5b9a\u4e2d\u6807\u7684\u65b9\u6cd5\u548c\u6807\u51c6\uff1a\u7efc\u5408\u8bc4\u5206\u6cd5</p><p>\u8bc4\u6807\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p style=\"margin: 1em 0px\">\u4e2d\u6807\u5019\u9009\u4eba\u6392\u540d\u5982\u4e0b\uff1a<a name=\"_GoBack\"></a></p><p style=\"margin: 1em 0px\">\u7b2c\u4e00\u540d\uff1a\u5317\u4eac\u5e02\u5929\u5947\u4f1f\u4e1a\u5e02\u653f\u5de5\u7a0b\u6709\u9650\u516c\u53f8</p><p style=\"margin: 1em 0px\">\u7b2c\u4e8c\u540d\uff1a\u5317\u4eac\u946b\u5cf0\u5efa\u8bbe\u6295\u8d44\u6709\u9650\u516c\u53f8</p><p style=\"margin: 1em 0px\">\u7b2c\u4e09\u540d\uff1a\u5317\u4eac\u9f99\u5efa\u96c6\u56e2\u6709\u9650\u516c\u53f8</p><p style=\"margin: 1em 0px\">\u516c\u793a\u671f\u4e3a\u4e09\u4e2a\u5de5\u4f5c\u65e5\uff01</p><p style=\"margin: 1em 0px\">\u62db\u6807\u6587\u4ef6\u8be6\u89c1\u9644\u4ef6</p><p></p>    <p></p>     <p></p>       <p></p> <p></p> <p></p>       <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         