{"title": "[\u516c\u5f00]\u5317\u4eac\u5e02\u8ba1\u91cf\u68c0\u6d4b\u79d1\u5b66\u7814\u7a76\u96622018\u5e74\u8ba1\u91cf\u68c0\u6d4b\u80fd\u529b\u63d0\u5347\u9879\u76ee\uff08\u7b2c\u4e00\u3001\u4e8c\u3001\u56db\u3001\u516d\u3001\u4e03\uff09\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u7ecf\u56fd\u9645\u62db\u6807\u96c6\u56e2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u8ba1\u91cf\u68c0\u6d4b\u79d1\u5b66\u7814\u7a76\u9662\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf92018\u5e74\u8ba1\u91cf\u68c0\u6d4b\u80fd\u529b\u63d0\u5347\u9879\u76ee\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>2018\u5e74\u8ba1\u91cf\u68c0\u6d4b\u80fd\u529b\u63d0\u5347\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>XM-0000033230180821044</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u738b\u7ecf\u7406</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-68372937</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u8ba1\u91cf\u68c0\u6d4b\u79d1\u5b66\u7814\u7a76\u9662</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u671d\u9633\u533a\u5b89\u82d1\u4e1c\u91cc1\u533a12\u53f7\u300114\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u5218\u5148\u751f010-57521631</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u4e2d\u7ecf\u56fd\u9645\u62db\u6807\u96c6\u56e2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u738b\u7ecf\u7406010-68372937</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6ee8\u6cb3\u8def1\u53f7\uff0c\u822a\u5929\u4fe1\u606f\u5927\u697c8\u5c42821\u623f\u95f4</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p>\u4e2d\u80fdX\u5c04\u7ebf\u88c5\u7f6e\u7b49\u8bbe\u5907\u4e00\u6279\uff0c\u51715\u5305\uff1b</p><p>\u5177\u4f53\u60c5\u51b5\u8be6\u89c1\u9644\u4ef6</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>1\u3001\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u89c4\u5b9a\uff0c\u4e14\u987b\u4e3a\u672a\u88ab\u5217\u5165\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9(www.creditchina.gov.cn)\u3001\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51(www.ccgp.gov.cn)\u4fe1\u7528\u8bb0\u5f55\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u7684\u6295\u6807\u4eba\uff1b2\u3001\u672c\u6b21\u62db\u6807\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u5f62\u5f0f\u7684\u6295\u6807\u4eba\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a892.682 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 18:18\u81f32018\u5e7410\u670812\u65e5 16:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u7f51\u4e0a\u8d2d\u4e70\uff0c\u4ee5\u90ae\u4ef6\u5f62\u5f0f\u63d0\u4ea4\u8d44\u683c\u6587\u4ef6\uff0c\u7535\u6c47\u652f\u4ed8\u6807\u4e66\u6b3e\uff0c\u552e\u540e\u4e0d\u9000\u3002\uff08\u53ea\u63a5\u53d7\u5bf9\u516c\u8d26\u6237\u6c47\u6b3e\uff09</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u7f51\u4e0a\u8d2d\u4e70</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:00</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670822\u65e5 09:00</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u4e2d\u7ecf\u56fd\u9645\u62db\u6807\u96c6\u56e2\u6709\u9650\u516c\u53f8\uff0c\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6ee8\u6cb3\u8def1\u53f7\uff0c\u822a\u5929\u4fe1\u606f\u5927\u697c8\u5c42\u5f00\u6807\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">\u62db\u6807\u6587\u4ef6\u6bcf\u5305\u552e\u4ef7: \u4eba\u6c11\u5e01500\u5143\uff08\u542b\u7535\u5b50\u7248\uff09\uff0c<strong>\u4ee5\u90ae\u4ef6\u5f62\u5f0f\u63d0\u4ea4\u8d44\u683c\u6587\u4ef6\uff0c\u7535\u6c47\u652f\u4ed8\u6807\u4e66\u6b3e</strong><strong>\uff0c\u552e\u540e\u4e0d\u9000\u3002\uff08\u53ea\u63a5\u53d7\u5bf9\u516c\u8d26\u6237\u6c47\u6b3e\uff09</strong></p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u987b\u63d0\u4ea4\u4ee5\u4e0b\u8d44\u683c\u6587\u4ef6\uff1a</p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">1\u3001\u65b0\u7248\u8425\u4e1a\u6267\u7167\u526f\u672c\uff08\u4e09\u8bc1\u5408\u4e00\u7248\uff09\uff1b</p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">2\u3001\u6cd5\u4eba\u6388\u6743\u59d4\u6258\u4e66\uff08\u683c\u5f0f\u81ea\u62df\uff0c\u9644\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\uff09\uff1b</p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">3\u30012017\u5e7410\u6708\u81f32018\u5e7410\u6708\u4efb\u610f\u4e00\u4e2a\u6708\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u76f8\u5173\u8bc1\u660e\u6750\u6599\uff1b(\u987b\u63d0\u4f9b\u94f6\u884c\u7f34\u6b3e\u51ed\u8bc1\u590d\u5370\u4ef6\u5e76\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\uff0c\u7a0e\u6536\u7f34\u7eb3\u8bc1\u660e\u53ef\u63d0\u4f9b\u4ee5\u4e0b\u4efb\u610f\u4e00\u79cd\uff1a\u4f01\u4e1a\u6240\u5f97\u7a0e\u3001\u8425\u4e1a\u7a0e\u3001\u589e\u503c\u7a0e\u7f34\u7eb3\u51ed\u8bc1\uff1b\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u987b\u5305\u542b\u793e\u4fdd\u3001\u533b\u4fdd\u7f34\u7eb3\u51ed\u8bc1\uff0c\u53ef\u63d0\u4f9b\u7531\u793e\u4fdd\u4e2d\u5fc3\u51fa\u5177\u7684\u7f34\u7eb3\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u8bc1\u660e\u6587\u4ef6\u5e76\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\uff09</p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">4\u3001\u6295\u6807\u4eba\u5728\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9(www.creditchina.gov.cn)\u67e5\u8be2\u9875\u9762\u622a\u56fe\uff1b</p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">5\u3001\u6295\u6807\u4eba\u5728\u201c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u201d(www.ccgp.gov.cn) \u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u67e5\u8be2\u9875\u9762\u622a\u56fe\uff1b</p><p style=\"margin: 1em 0px; text-indent: 13.5pt\">\u53ea\u6709\u8d2d\u4e70\u4e86\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6295\u6807\u4eba\u624d\u6709\u8d44\u683c\u53c2\u4e0e\u6295\u6807\u3002</p><p> <strong>\u4ee5\u4e0a\u6587\u4ef6\u987b\u63d0\u4f9b\u539f\u4ef6\u7684\u590d\u5370\u4ef6\u5e76\u52a0\u76d6\u516c\u7ae0\uff0c\u672a\u9012\u4ea4\u8d44\u683c\u6587\u4ef6\u6216\u8d44\u683c\u6587\u4ef6\u4e0d\u7b26\u5408\u8981\u6c42\u7684\u6295\u6807\u4eba\u5c06\u4e0d\u4e88\u67e5\u9605\u548c\u51fa\u552e\u62db\u6807\u6587\u4ef6\u3002\uff08\u672c\u9879\u76ee\u91c7\u7528\u7f51\u4e0a\u63d0\u4ea4\u8d44\u683c\u6587\u4ef6\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u7684\u65b9\u5f0f\uff0c\u987b\u5c06\u8d44\u683c\u6587\u4ef6\u626b\u63cf\u4ef6\u3001\u6c47\u6b3e\u5e95\u5355\u626b\u63cf\u4ef6\u53ca\u62a5\u540d\u4fe1\u606f\u90ae\u4ef6\u6b63\u6587\u53d1\u9001\u81f3ceitcl@163.com\uff0c\u8d44\u683c\u6587\u4ef6\u53ca\u6c47\u6b3e\u5e95\u5355\u683c\u5f0f\uff1aword\u6587\u6863\u3001\u56fe\u7247\u6216PDF\uff0c\u6295\u6807\u4eba\u63d0\u4ea4\u7684\u62a5\u540d\u4fe1\u606f\u90ae\u4ef6\u6b63\u6587\u4e2d\u987b\u5199\u660e\u6295\u6807\u4eba\u540d\u79f0\u3001\u8054\u7cfb\u4eba\u3001\u8054\u7cfb\u7535\u8bdd\u3001\u9879\u76ee\u540d\u79f0\u3001\u9879\u76ee\u7f16\u53f7\u3001\u5305\u53f7\u3001\u6295\u6807\u4eba\u7eb3\u7a0e\u4eba\u8bc6\u522b\u53f7\u6216\u7edf\u4e00\u793e\u4f1a\u4fe1\u7528\u4ee3\u7801\uff0c\u7535\u6c47\u6807\u4e66\u6b3e\u987b\u9644\u8a00\u9879\u76ee\u7f16\u53f7\u53ca\u5305\u53f7\uff0c\u626b\u63cf\u4ef6\u4e2d\u7684\u516c\u7ae0\u90e8\u5206\u987b\u4e3a\u9c9c\u7ae0\u7684\u989c\u8272\uff0c\u672a\u6309\u4ee5\u4e0a\u8981\u6c42\u63d0\u4ea4\u76f8\u5173\u6587\u4ef6\u5c06\u5bfc\u81f4\u6295\u6807\u4eba\u62a5\u540d\u4e0d\u6210\u529f\u3002\u53d1\u9001\u90ae\u4ef6\u540e\u987b\u8054\u7cfb010-68372939\uff0c\u786e\u8ba4\u6211\u516c\u53f8\u662f\u5426\u6536\u5230\u76f8\u5173\u6587\u4ef6\uff0c\u6211\u516c\u53f8\u6536\u5230\u76f8\u5173\u6587\u4ef6\u53ca\u6c47\u6b3e\u540e\uff0c\u7ecf\u5ba1\u67e5\u5408\u683c\u540e\u5c06\u62db\u6807\u6587\u4ef6\u53d1\u9001\u81f3\u6295\u6807\u4eba\uff08\u62a5\u540d\u6210\u529f\uff09\u3002\u6295\u6807\u62a5\u540d\u6709\u6548\u6027\uff1a\u4ee5\u6295\u6807\u62a5\u540d\u622a\u6b62\u65f6\u95f4\u524d\u6536\u5230\u5168\u90e8\u6b63\u786e\u7684\u62a5\u540d\u4fe1\u606f\u3001\u8d44\u683c\u6587\u4ef6\u53ca\u6807\u4e66\u6b3e\u6c47\u6b3e\u5e95\u5355\u4e3a\u51c6\u3002\uff09</strong></p><p style=\"margin: 1em 0px\"> \u6536\u6b3e\u5355\u4f4d\uff1a\u5317\u4eac\u4e2d\u7ecf\u62db\u6807\u6709\u9650\u516c\u53f8<br> \u5f00\u6237\u94f6\u884c\uff1a\u5efa\u8bbe\u94f6\u884c\u5317\u4eac\u65b0\u534e\u652f\u884c<br> \u94f6\u884c\u8d26\u53f7\uff1a11050162500000000304</p><p align=\"left\" style=\"text-align: left; margin: 1em 0px\"><strong>\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u8054\u7cfb\u4eba\uff1a\u738b\u5973\u58eb</strong></p><p><strong>\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u8054\u7cfb\u7535\u8bdd\uff1a010-68372939</strong></p><p style=\"margin: 1em 0px\">\u62db\u6807\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u738b\u7ecf\u7406</p><p style=\"margin: 1em 0px\">\u7535 \u8bdd\uff1a010-68372937</p><p style=\"margin: 1em 0px\">\u7535\u5b50\u4fe1\u7bb1\uff1aceitcl@163.com</p><p style=\"margin: 1em 0px\"><strong>\u62db\u6807\u516c\u544a\u516c\u793a\u671f\u9650\uff1a</strong>\u672c\u516c\u544a\u53d1\u5e03\u4e4b\u65e5\u8d775\u4e2a\u5de5\u4f5c\u65e5\u3002</p><p style=\"margin: 1em 0px\"><strong>\u62db\u6807\u7f16\u53f7\uff1a</strong>CEITCL-BJ15-1809115-01/02/04/06/07\uff08\u62a5\u540d\u8bf7\u4ee5\u6b64\u7f16\u53f7\u4e3a\u51c6\uff01\uff09</p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u653f\u5e9c\u5f3a\u5236\u91c7\u8d2d\u7684\u8282\u80fd\u4ea7\u54c1\u3001\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u3001\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\u3001\u653f\u5e9c\u91c7\u8d2d\u9879\u76ee\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\u3001\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a\u3001\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\u7b49\u76f8\u5173\u653f\u7b56\u8be6\u89c1\u62db\u6807\u6587\u4ef6\u3002</p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     