{"title": "[\u671d\u9633]\u5317\u4eac\u5e02\u5782\u6768\u67f3\u533b\u96622018\u5e74\u7b2c\u4e94\u6279\u8bbe\u5907\u91c7\u8d2d3\u9879\u76ee\uff08\u7b2c12\u5305\uff09\u66f4\u6b63\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4eac\u5e02\u5782\u6768\u67f3\u533b\u96622018\u5e74\u7b2c\u4e94\u6279\u8bbe\u5907\u91c7\u8d2d3\u9879\u76ee\uff08\u7b2c11\u5305-\u7b2c15\u5305\uff09\u62db\u6807\u516c\u544a</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>0686-1841Q1531231Z</p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u6731\u8389  \u6881\u9a70</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-65041195</p><p></p><p><strong>\u4e8c\u3001\u539f\u516c\u544a\u540d\u79f0\u53ca\u5730\u5740\u65f6\u95f4\u7b49\uff1a</strong></p><p>\u9996\u6b21\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670821\u65e5</p><p>\u672c\u6b21\u53d8\u66f4\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u539f\u516c\u544a\u9879\u76ee\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u5782\u6768\u67f3\u533b\u96622018\u5e74\u7b2c\u4e94\u6279\u8bbe\u5907\u91c7\u8d2d3\u9879\u76ee\uff08\u7b2c11\u5305-\u7b2c15\u5305\uff09\u62db\u6807\u516c\u544a\u516c\u5f00\u62db\u6807\u516c\u544a</p><p>\u539f\u516c\u544a\u5730\u5740\uff1ahttp://www.ccgp-beijing.gov.cn/xxgg/qjzfcggg/t20180921_1029827.html</p><p></p><p><strong>\u4e09\u3001\u66f4\u6b63\u4e8b\u9879\u3001\u5185\u5bb9\uff1a</strong></p><p></p><p style=\"line-height: 22pt; text-indent: 24.1pt\"><strong>\u5bf9\u539f\u62db\u6807\u6587\u4ef6\u7b2c\u4e8c\u518c \u7b2c\u516b\u7ae0 \u7b2c\u4e8c\u8282\u6280\u672f\u89c4\u683c \u505a\u51fa\u4fee\u8ba2\u3002\uff08\u8be6\u89c1\u516c\u544a\u9644\u4ef6\uff09</strong></p><p style=\"line-height: 19pt; text-indent: 24.05pt\"><strong>\u5f00\u6807\u65f6\u95f4\u3001\u5730\u70b9\u66f4\u6b63\u5982\u4e0b\uff1a</strong></p><p style=\"line-height: 19pt; margin: 0cm 21pt 0pt 0cm\">\u63a5\u53d7\u6295\u6807\u65f6\u95f4\u4e3a\uff1a2018\u5e749\u670816\u65e5\u4e0b\u534813\u65f630\u5206\u81f314\u65f600\u5206\uff08\u5317\u4eac\u65f6\u95f4\uff09</p><p style=\"line-height: 19pt; margin: 0cm 21pt 0pt 0cm\">\u6295\u6807\u622a\u6b62\u65f6\u95f4\u4e3a\uff1a2018\u5e749\u670816\u65e5\u4e0b\u534814\u65f600\u5206\uff08\u5317\u4eac\u65f6\u95f4\uff09\uff0c\u903e\u671f\u9001\u8fbe\u6216\u4e0d\u7b26\u5408\u89c4\u5b9a\u7684\u6295\u6807\u6587\u4ef6\u6055\u4e0d\u63a5\u53d7\u3002</p><p style=\"line-height: 19pt; margin: 0cm 21pt 0pt 0cm\">\u5f00\u6807\u65f6\u95f4\u4e3a\uff1a2018\u5e749\u670816\u65e5\u4e0b\u534814\u65f600\u5206\uff08\u5317\u4eac\u65f6\u95f4\uff09</p><p style=\"line-height: 19pt; margin: 0cm 21pt 0pt 0cm\">\u5f00\u6807\u5730\u70b9\uff1a\u5317\u4eac\u56fd\u9645\u8d38\u6613\u516c\u53f8\u4e00\u5c42106\u4f1a\u8bae\u5ba4\u3002</p><p><strong>\u6ce8\uff1a\u672c\u6b21\u6587\u4ef6\u4fee\u8ba2\u4ec5\u9650\u4e8e\u62db\u6807\u6587\u4ef6\u7b2c\u4e8c\u518c\uff0c\u7b2c\u4e00\u518c\u4e0d\u53d8\u3002</strong></p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p></p><p><strong>\u4e94\u3001\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u5782\u6768\u67f3\u533b\u9662</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u5782\u6768\u67f3\u5357\u88572\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a010-67712975</p><p></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u56fd\u9645\u8d38\u6613\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u5efa\u56fd\u95e8\u5916\u5927\u8857\u75323\u53f7</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a010-65041195</p><p></p><p></p>           <p></p>                                    