{"title": "[\u671d\u9633]\u5317\u4eac\u5e02\u671d\u9633\u533a\u536b\u751f\u548c\u8ba1\u5212\u751f\u80b2\u59d4\u5458\u4f1a\u671d\u9633120\u6307\u6325\u8c03\u5ea6\u5e73\u53f0\u5347\u7ea7\u6539\u9020\u9879\u76ee\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u7ecf\u56fd\u9645\u62db\u6807\u96c6\u56e2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u671d\u9633\u533a\u536b\u751f\u548c\u8ba1\u5212\u751f\u80b2\u59d4\u5458\u4f1a\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u671d\u9633120\u6307\u6325\u8c03\u5ea6\u5e73\u53f0\u5347\u7ea7\u6539\u9020\u9879\u76ee\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u671d\u9633120\u6307\u6325\u8c03\u5ea6\u5e73\u53f0\u5347\u7ea7\u6539\u9020\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>CEITCL-BJ10-1809112</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a \u5f20\u78ca</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a 010-56106819</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u536b\u751f\u548c\u8ba1\u5212\u751f\u80b2\u59d4\u5458\u4f1a</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u751c\u6c34\u56ed\u4e1c\u91cc\u75321\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u674e\u4eae18901028316</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u4e2d\u7ecf\u56fd\u9645\u62db\u6807\u96c6\u56e2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u5f20\u78ca010-56106819</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6ee8\u6cb3\u8def1\u53f7\u822a\u5929\u4fe1\u606f7\u5c42</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin: auto auto auto 5.4pt; border: currentColor; border-image: none; border-collapse: collapse;\" width=\"595\"><tbody><tr style=\"height: 4px;\"><td style=\"padding: 0cm 5.4pt; border: 1pt solid windowtext; border-image: none; width: 208px; height: 4px;\"><p align=\"center\" style=\"text-align: center;\"><strong>\u8bbe\u5907\u540d\u79f0</strong></p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 66px; height: 4px;\"><p align=\"center\" style=\"text-align: center;\"><strong>\u5305\u6570</strong></p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 76px; height: 4px;\"><p align=\"center\" style=\"text-align: center;\"><strong>\u9879\u76ee\u5185\u5bb9</strong></p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 76px; height: 4px;\"><p align=\"center\" style=\"text-align: center;\"><strong>\u7528\u9014</strong></p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 66px; height: 4px;\"><p align=\"center\" style=\"text-align: center;\"><strong>\u6570\u91cf</strong></p></td><td style=\"border-width: 1pt 1pt 1pt 0px; border-style: solid solid solid none; padding: 0cm 5.4pt; border-image: none; width: 104px; height: 4px;\"><p align=\"center\" style=\"text-align: center;\"><strong>\u662f\u5426\u5141\u8bb8\u91c7\u8d2d</strong></p><p align=\"center\" style=\"text-align: center;\"><strong>\u8fdb\u53e3\u4ea7\u54c1</strong></p></td></tr><tr style=\"height: 12px;\"><td style=\"border-width: 0px 1pt 1pt; border-style: none solid solid; padding: 0cm 5.4pt; border-image: none; width: 208px; height: 12px;\"><p align=\"center\" style=\"text-align: center;\">\u671d\u9633120\u6307\u6325\u8c03\u5ea6\u5e73\u53f0\u5347\u7ea7\u6539\u9020\u9879\u76ee</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 66px; height: 12px;\"><p align=\"center\" style=\"text-align: center;\">1</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 76px; height: 12px;\"><p align=\"center\" style=\"text-align: center;\">\u5347\u7ea7</p><p align=\"center\" style=\"text-align: center;\">\u6539\u9020</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 76px; height: 12px;\"><p align=\"center\" style=\"text-align: center;\">\u533b\u7528</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 66px; height: 12px;\"><p align=\"center\" style=\"text-align: center;\">\u4e00\u6279</p></td><td style=\"border-width: 0px 1pt 1pt 0px; border-style: none solid solid none; padding: 0cm 5.4pt; width: 104px; height: 12px;\"><p align=\"center\" style=\"text-align: center;\">\u5426</p></td></tr></tbody></table><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>14.1.\u4f9b\u5e94\u5546\u987b\u5177\u5907\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c22\u6761\u89c4\u5b9a\u7684\u6761\u4ef6\uff1b14.2.\u4f9b\u5e94\u5546\u5e94\u5728\u4e2d\u56fd\u5883\u5185\u6ce8\u518c\uff0c\u62e5\u6709\u6295\u6807\u4ea7\u54c1\u7684\u5408\u6cd5\u7ecf\u8425\u6743\u300214.3.\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a189.9275 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:30\u81f32018\u5e7410\u670812\u65e5 15:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6ee8\u6cb3\u8def1\u53f7\u822a\u5929\u4fe1\u606f\u5927\u53a6815\u62db\u6807\u5341\u90e8\uff0c\u586b\u5199\u6295\u6807\u7533\u8bf7\u8868\u683c\uff0c\u5e76\u4e8e\u4e03\u5c42\u8d22\u52a1\u90e8\u7f34\u8d39\u3002</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670823\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u6ee8\u6cb3\u8def1\u53f7\u822a\u5929\u4fe1\u606f\u5927\u53a68\u5c42\u8bc4\u6807\u5ba41</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p align=\"left\" style=\"margin: 0cm 0cm 0pt 18.3pt; text-align: left; text-indent: -18pt;\">\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u65f6\u9700\u643a\u5e26:</p><p align=\"left\" style=\"margin: 0cm 0cm 0pt 14.05pt; text-align: left; text-indent: 0.1pt;\">1)\u8425\u4e1a\u6267\u7167\u3001\u7ec4\u7ec7\u673a\u6784\u4ee3\u7801(\u53d6\u5f97\u4e09\u8bc1\u5408\u4e00\u7684\u9664\u5916)\u3001\u7a0e\u52a1\u767b\u8bb0\u8bc1(\u53d6\u5f97\u4e09\u8bc1\u5408\u4e00\u7684\u9664\u5916)\u3001\u63d0\u4f9b\u5728\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9(www.creditchina.gov.cn)\u548c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51(www.ccgp.gov.cn)\u67e5\u8be2\u7684\u672c\u5355\u4f4d\u4fe1\u7528\u8bb0\u5f55\u7684\u7f51\u9875\u622a\u56fe(\u67e5\u8be2\u65e5\u671f\u5728\u62db\u6807\u516c\u544a\u53d1\u5e03\u4e4b\u65e5\u540e\uff08\u542b\u5f53\u5929\uff09\uff0c\u4e14\u80fd\u591f\u663e\u793a\u672a\u88ab\u4fe1\u7528\u4e2d\u56fd\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u3001\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.cn\uff09\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355)\u3002(\u4ee5\u4e0a\u8d44\u6599\u67e5\u9605\u53ca\u9886\u53d6\u62db\u6807\u6587\u4ef6\u65f6\u8bf7\u643a\u5e26\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\u7684\u590d\u5370\u4ef6)</p><p align=\"left\" style=\"margin: 0cm 0cm 0pt 14.05pt; text-align: left; text-indent: 0.1pt;\">2\uff09\u8fd1\u4e09\u4e2a\u6708\u7f34\u7eb3\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u6709\u6548\u7968\u636e\u51ed\u8bc1\u6216\u7531\u793e\u4fdd\u4e2d\u5fc3\u51fa\u5177\u7684\u7f34\u7eb3\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u8bc1\u660e\u3001\u6700\u8fd1\u534a\u5e74\u5185\u4efb\u610f\u4e09\u4e2a\u6708\u7684\u7eb3\u7a0e\u6709\u6548\u51ed\u636e\uff08\u6309\u6708\u7eb3\u7a0e\uff09\uff0c\u6216\u4e0a\u5e74\u5ea6\u7eb3\u7a0e\u7684\u6709\u6548\u51ed\u636e\uff08\u6309\u5e74\u7eb3\u7a0e\uff09\u6216\u76f8\u5173\u90e8\u95e8\u51fa\u5177\u7684\u4f9d\u6cd5\u7eb3\u7a0e\u6709\u6548\u8bc1\u660e\u6587\u4ef6\u3001\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u4e66\u3001\u672c\u4eba\u8eab\u4efd\u8bc1\u3002\uff08\u4ee5\u4e0a\u8d44\u6599\u62a5\u540d\u65f6\u643a\u5e26\u539f\u4ef6\u548c\u52a0\u76d6\u6295\u6807\u4eba\u516c\u7ae0\u7684\u590d\u5370\u4ef6\u5404\u4e00\u4efd\uff0c\u539f\u4ef6\u73b0\u573a\u5ba1\u67e5\u540e\u5f52\u8fd8\uff0c\u590d\u5370\u4ef6\u62db\u6807\u516c\u53f8\u7559\u5b58\uff09</p><p align=\"left\" style=\"margin: 0cm 0cm 0pt 14.05pt; text-align: left; text-indent: 0.1pt;\"><span style='color: black; font-family: \u5b8b\u4f53; font-size: 12pt; mso-ascii-font-family: \"Times New Roman\"; mso-hansi-font-family: \"Times New Roman\"; mso-bidi-font-family: \"Times New Roman\"; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;'>\u62db\u6807\u516c\u544a\u671f\u9650\uff1a\u672c\u516c\u544a\u53d1\u5e03\u4e4b\u65e5\u8d77</span><span lang=\"EN-US\" style='color: black; font-family: \"Times New Roman\",\"serif\"; font-size: 12pt; mso-fareast-font-family: \u5b8b\u4f53; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;'>5</span><span style='color: black; font-family: \u5b8b\u4f53; font-size: 12pt; mso-ascii-font-family: \"Times New Roman\"; mso-hansi-font-family: \"Times New Roman\"; mso-bidi-font-family: \"Times New Roman\"; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;'>\u4e2a\u5de5\u4f5c\u65e5</span></p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p><span style='font-family: \u5b8b\u4f53; font-size: 12pt; mso-bidi-font-size: 10.0pt; mso-ascii-font-family: \"Times New Roman\"; mso-bidi-font-family: \"Times New Roman\"; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;'><font color=\"#000000\">\u2460\u8282\u80fd\u4ea7\u54c1\u5f3a\u5236\u91c7\u8d2d\uff1b\u2461\u8282\u80fd\u4ea7\u54c1\u3001\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u4f18\u5148\u91c7\u8d2d\uff1b\u2462\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\uff1b\u2463\u653f\u5e9c\u91c7\u8d2d\u9879\u76ee\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\uff1b\u2464\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\uff1b\u2465\u8fdb\u53e3\u4ea7\u54c1\u7ba1\u7406\uff1b\u2466\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a\uff1b</font></sp