{"title": "[\u5ef6\u5e86]\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u5343\u5bb6\u5e97\u9547\u4eba\u6c11\u653f\u5e9c\u5343\u5bb6\u5e97\u9547\u4f4e\u6536\u5165\u6751\u5206\u5e03\u5f0f\u5149\u4f0f\u53d1\u7535\u9879\u76ee\u7ade\u4e89\u6027\u78cb\u5546", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5229\u541b\u8fbe\u5efa\u7b51\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u5343\u5bb6\u5e97\u9547\u4eba\u6c11\u653f\u5e9c\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5343\u5bb6\u5e97\u9547\u4f4e\u6536\u5165\u6751\u5206\u5e03\u5f0f\u5149\u4f0f\u53d1\u7535\u9879\u76ee\u8fdb\u884c\u7ade\u4e89\u6027\u78cb\u5546\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5343\u5bb6\u5e97\u9547\u4f4e\u6536\u5165\u6751\u5206\u5e03\u5f0f\u5149\u4f0f\u53d1\u7535\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>LJD-YQ-201809-035</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u738b\u5de5</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a69178683</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u5343\u5bb6\u5e97\u9547\u4eba\u6c11\u653f\u5e9c</p><p></p>  <p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u5343\u5bb6\u5e97\u9547\u540e\u6c9f\u675132\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u8303\u5e86\u7ae0</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u5229\u541b\u8fbe\u5efa\u7b51\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u738b\u5de5\uff0c010-69178683</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u81ea\u7531\u8857\u5317\u8857\u5546\u4e1a2\u53f7\u697c105\u53f7</p><p></p>       <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p>\u7b2c\u4e00\u5305\uff1a\u5343\u5bb6\u5e97\u9547\u4f4e\u6536\u5165\u6751\u5206\u5e03\u5f0f\u5149\u4f0f\u53d1\u7535\u9879\u76ee\u2014\u5343\u5bb6\u5e97\u9547\u653f\u5e9c<br>\u62db\u6807\u5185\u5bb9\uff1a 100KW\u5149\u4f0f\u53d1\u7535\u9879\u76ee\uff0c\u9884\u7b97\u91d1\u989d65\u4e07\u5143\uff0c\u63a7\u5236\u5355\u4ef76.5\u5143/W.<br>\u5efa\u8bbe\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u5343\u5bb6\u5e97\u9547\u4eba\u6c11\u653f\u5e9c<br>\u7b2c\u4e8c\u5305\uff1a\u5343\u5bb6\u5e97\u9547\u4f4e\u6536\u5165\u6751\u5206\u5e03\u5f0f\u5149\u4f0f\u53d1\u7535\u9879\u76ee\u2014\u82b1\u76c6\u6751<br>\u62db\u6807\u5185\u5bb9\uff1a 60KW\u5149\u4f0f\u53d1\u7535\u9879\u76ee\uff0c\u9884\u7b97\u91d1\u989d39\u4e07\u5143\uff0c\u63a7\u5236\u5355\u4ef76.5\u5143/W.<br>\u5efa\u8bbe\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u5343\u5bb6\u5e97\u9547\u82b1\u76c6\u6751<br>\u6bcf\u4e00\u6295\u6807\u4eba\u5bf9\u672c\u9879\u76ee\u4e2d\u7684\u5404\u5206\u5305\u5206\u522b\u8fdb\u884c\u6295\u6807\u3002<br>\u7b80\u8981\u6280\u672f\u9700\u6c42\uff1a<br>\u603b\u5efa\u8bbe\u89c4\u6a21160KW\uff0c\u603b\u9884\u7b97\u91d1\u989d\uff1a104\u4e07\u5143\u3002<br>\u6280\u672f\u8981\u6c42\uff1a\u7b26\u5408\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u73b0\u884c\u6709\u6548\u7684\u56fd\u5bb6\u89c4\u8303\u3001\u89c4\u7a0b\u548c\u6807\u51c6\u3002<br>\u627f\u5305\u65b9\u5f0f\uff1a\u5305\u62ec\uff1a\u81ea\u884c\u8bbe\u8ba1\uff0c\u5305\u5de5\u5305\u6599\uff0c\u627f\u529e\u524d\u671f\u5404\u9879\u5ba1\u6279\u624b\u7eed\uff08\u5982\u53d1\u6539\u59d4\u7acb\u9879\u3001\u4f9b\u7535\u5c40\u5e76\u7f51\u5ba1\u6279\u624b\u7eed\u7b49\uff09\u3002\u571f\u5efa\u5de5\u7a0b\u53ca\u8bbe\u5907\u7684\u4f9b\u5e94\u3001\u5b89\u88c5\u3001\u8c03\u8bd5\u3001\u57f9\u8bad\u53ca\u6b63\u5f0f\u9a8c\u6536\u524d\u7684\u8bd5\u8fd0\u884c\u3001\u4fdd\u4fee\u7ef4\u62a4\u3001\u552e\u540e\u670d\u52a1\u7b49\u3002\uff08\u5305\u62ec\u8bbe\u5907\u3001\u4eba\u5de5\u3001\u6750\u6599\u53ca\u6240\u6709\u9644\u4ef6\u7684\u5236\u9020\u3001\u68c0\u9a8c\u3001\u5305\u88c5\u3001\u8fd0\u8f93\u53ca\u4fdd\u9669\u3001\u7a0e\u8d39\u3001\u88c5\u5378\u3001\u5b89\u88c5\u3001\u8bd5\u9a8c\u53ca\u8bd5\u8fd0\u8f6c\u3001\u9a8c\u6536\u7b49\u5b8c\u6210\u5168\u90e8\u5de5\u7a0b\u53ca\u5e76\u7f51\u8fd0\u884c\u6240\u9700\u7684\u4e00\u5207\u9879\u76ee\uff09\u3002<br>\u8bbe\u8ba1\u8981\u6c42\uff1a1\u3001\u7efc\u5408\u8003\u8651\u5c4b\u9876\u6761\u4ef6\uff0c\u4fdd\u969c\u7ecf\u6d4e\u3001\u9002\u7528\u3001\u73af\u4fdd\u3001\u7f8e\u89c2\uff0c\u4fbf\u4e8e\u5b89\u88c5\u548c\u7ef4\u62a4\uff1b2\u3001\u5149\u4f0f\u53d1\u7535\u7cfb\u7edf\u5fc5\u987b\u6ee1\u8db3\u5b89\u5168\u4e0e\u53ef\u9760\u8981\u6c42\uff1b3\u3001\u5149\u4f0f\u53d1\u7535\u7cfb\u7edf\u8f93\u51fa\u7535\u529b\u7684\u7535\u80fd\u8d28\u91cf\u7b26\u5408\u56fd\u5bb6\u73b0\u884c\u6807\u51c6\u89c4\u5b9a\uff1b4\u3001\u5fc5\u987b\u5b89\u88c5\u5f53\u5730\u8d28\u91cf\u6280\u672f\u76d1\u7ba1\u673a\u6784\u8ba4\u53ef\u7684\u8ba1\u91cf\u88c5\u7f6e\uff1b5\u3001\u4e0d\u5f97\u964d\u4f4e\u76f8\u90bb\u5efa\u7b51\u7269\u7684\u65e5\u7167\u6807\u51c6\uff1b6\u3001\u9700\u8981\u901a\u8fc7\u5b89\u5168\u7684\u901a\u8baf\u94fe\u8def\u4e0a\u4f20\u53d1\u7535\u91cf\u7b49\u6570\u636e\uff1b7\u3001\u5fc5\u987b\u8fdb\u884c\u5efa\u7b51\u7269\u7ed3\u6784\u548c\u7535\u6c14\u7684\u5b89\u5168\u7b26\u5408\uff0c\u5e76\u6ee1\u8db3\u5efa\u7b51\u7269\u7ed3\u6784\u548c\u7535\u6c14\u5b89\u5168\u6027\u8981\u6c42\u3002<br>\u6280\u672f\u8981\u6c42:\u7b26\u5408\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u73b0\u884c\u6709\u6548\u7684\u56fd\u5bb6\u89c4\u8303\u3001\u89c4\u7a0b\u548c\u6807\u51c6\u3002</p><p><strong>\u4e8c\u3001\u5bf9\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\uff08\u4f9b\u5e94\u5546\u8d44\u683c\u6761\u4ef6\uff09:</strong></p><p>(\u4e00)\u5fc5\u987b\u662f\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u6ce8\u518c\u7684\u4f01\u4e1a\uff0c\u5177\u6709\u72ec\u7acb\u6cd5\u4eba\u8d44\u683c\u4e14\u5177\u6709\u6709\u6548\u8425\u4e1a\u6267\u7167\uff1b(\u4e8c)\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u53ca\u5176\u4ed6\u6587\u4ef6\u7684\u76f8\u5173\u89c4\u5b9a\uff1b1\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b2\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b3\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b4\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b5\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b6\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\uff1b7\uff09\u6295\u6807\u4eba\u987b\u5177\u6709\u7535\u529b\u5de5\u7a0b\u65bd\u5de5\u603b\u627f\u5305\u4e09\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u8d44\u8d28\uff0c\u5728\u4eba\u5458\u3001\u8d44\u91d1\u3001\u8d28\u91cf\u4fdd\u8bc1\u7b49\u65b9\u9762\uff0c\u5177\u6709\u5706\u6ee1\u5b8c\u6210\u672c\u9879\u76ee\u7684\u80fd\u529b\uff1b8\uff09\u9879\u76ee\u7ecf\u7406\u5177\u5907\u7535\u529b\u5de5\u7a0b\u6216\u673a\u7535\u5de5\u7a0b\u4e8c\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u5efa\u9020\u5e08\u6ce8\u518c\u6267\u4e1a\u8d44\u683c\uff1b9\uff09\u672c\u6b21\u6295\u6807\u8981\u6c42\u751f\u4ea7\u5382\u5bb6\u5fc5\u987b\u4e3a\u5ef6\u5e86\u533a\u53d1\u5c55\u548c\u6539\u9769\u59d4\u5458\u4f1a\u5907\u6848\u7684\u751f\u4ea7\u5382\u5bb6\uff1b10\uff09\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u5e94\u7b26\u5408\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u89c4\u5b9a\u7684\u76f8\u5e94\u6280\u672f\u3001\u8282\u80fd\u3001\u5b89\u5168\u3001\u73af\u4fdd\u6807\u51c6\uff0c\u5982\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u5bf9\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u6709\u5f3a\u5236\u6027\u89c4\u5b9a\u6216\u8981\u6c42\u7684\uff0c\u5219\u6295\u6807\u4eba\u7684\u6295\u6807\u4ea7\u54c1\u5fc5\u987b\u7b26\u5408\u76f8\u5e94\u89c4\u5b9a\u6216\u8981\u6c42\uff1b\uff08\u4e09\uff09  \u672a\u88ab\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u3001\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.gov.cn\uff09\u4e2d\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\uff1b\u6ce8\uff1a1\uff09\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\uff1b2\uff09\u6295\u6807\u4eba\u5fc5\u987b\u5411\u62db\u6807\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\uff0c\u672a\u5411\u62db\u6807\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6f5c\u5728\u6295\u6807\u4eba\u5747\u65e0\u8d44\u683c\u53c2\u52a0\u672c\u6b21\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u78cb\u5546\u548c\u54cd\u5e94\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9\u7b49:</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a104.0 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 09:00</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670811\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u81ea\u7531\u8857\u5317\u8857\u5546\u4e1a2\u53f7\u697c105\u53f7</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65b9\u5f0f\uff1a\u73b0\u573a\u8d2d\u4e70</p><p>\u78cb\u5546\u6587\u4ef6\u552e\u4ef7\uff1a500.0  \u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 08:00\u81f32018\u5e7410\u670816\u65e5 09:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u81ea\u7531\u8857\u5317\u8857\u5546\u4e1a2\u53f7\u697c105\u53f7\u4e8c\u697c\u4f1a\u8bae\u5ba4</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7410\u670816\u65e5 09:00</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u81ea\u7531\u8857\u5317\u8857\u5546\u4e1a2\u53f7\u697c105\u53f7\u4e8c\u5c42\u4f1a\u8bae\u5ba4</p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p style=\"line-height: 21pt;\"><strong>\u5907\u6ce8\uff1a</strong>\u6f5c\u5728\u6295\u6807\u4eba\u5728\u8d2d\u4e70\u7ade\u4e89\u6027\u78cb\u5546\u6587\u4ef6\u65f6\u987b\u643a\u5e26\u516c\u53f8\u8425\u4e1a\u6267\u7167\u3001\u8d44\u8d28\u8bc1\u4e66\u3001\u5b89\u5168\u751f\u4ea7\u8bb8\u53ef\u8bc1\u526f\u672c\u3001\u9879\u76ee\u7ecf\u7406\u6ce8\u518c\u8d44\u683c\u8bc1\u4e66\u53ca\u5b89\u5168\u751f\u4ea7\u8003\u6838\u5408\u683c\u8bc1\u4e66\u3001\u8bbe\u5907\u751f\u4ea7\u5382\u5bb6\u5907\u6848\u622a\u56fe\u3001\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\u7684\u8bc1\u660e\uff08\u539f\u4ef6\u52a0\u76d6\u516c\u7ae0\u3001\u6cd5\u4eba\u7ae0\u5e76\u7531\u6cd5\u5b9a\u4ee3\u8868\u4eba\u7b7e\u5b57\uff09\u3001\u4fe1\u7528\u4e2d\u56fd\u3001\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u7f51\u9875\u622a\u56fe\uff08\u6253\u5370\u540e\u76d6\u516c\u7ae0\uff09\u3001\u6cd5\u4eba\u6388\u6743\u59d4\u6258\u4e66\uff08\u539f\u4ef6\u52a0\u76d6\u516c\u7ae0\uff09\uff0c\u7ecf\u529e\u4eba\u8eab\u4efd\u8bc1\uff08\u539f\u4ef6\u3001\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\uff09\u3002</p><p style=\"margin: 6pt 0cm 6pt 23.85pt; line-height: 21pt; -ms-layout-grid-mode: char;\">\uff08\u4ee5\u4e0a\u8d44\u6599\u987b\u643a\u5e26\u539f\u4ef6\u4f9b\u67e5\u9a8c\uff0c\u540c\u65f6\u63d0\u4f9b\u52a0\u76d6\u5355\u4f4d\u516c\u7ae0\u7684\u590d\u5370\u4ef61\u4efd\u5907\u6848\u3002\u53ea\u6709\u7ecf\u8d44\u683c\u5ba1\u67e5\u5408\u683c\u7684\u6295\u6807\u4eba\uff0c\u65b9\u53ef\u8d2d\u4e70\u78cb\u5546\u6587\u4ef6\uff0c\u552e\u540e\u4e0d\u9000\uff0c\u4e0d\u529e\u7406\u90ae\u5bc4\u3002\uff09</p><p>\u5404\u6f5c\u5728\u6295\u6807\u4eba\u62a5\u540d\u65f6\u8bf7\u63d0\u524d\u7535\u8bdd\u8054\u7cfb\uff01</p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u738b\u5de5</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a69178683</p><p></p><p><strong>\u516d\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51</p><p></p><p></p>    <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      