{"title": "[\u6d77\u6dc0]\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u73af\u5883\u536b\u751f\u670d\u52a1\u4e2d\u5fc3\u6d77\u6dc0\u73af\u536b\u4e2d\u5fc3\u5395\u6240\u9769\u547d\u2014100\u5ea7\u516c\u5171\u536b\u751f\u95f4\u670d\u52a1\u54c1\u8d28\u63d0\u5347\u6539\u9020\u9879\u76ee\uff08\u76d1\u7406\uff09\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6cdb\u534e\u56fd\u91d1\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u73af\u5883\u536b\u751f\u670d\u52a1\u4e2d\u5fc3\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u6d77\u6dc0\u73af\u536b\u4e2d\u5fc3\u5395\u6240\u9769\u547d\u2014100\u5ea7\u516c\u5171\u536b\u751f\u95f4\u670d\u52a1\u54c1\u8d28\u63d0\u5347\u6539\u9020\u9879\u76ee\uff08\u76d1\u7406\uff09\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u6d77\u6dc0\u73af\u536b\u4e2d\u5fc3\u5395\u6240\u9769\u547d\u2014100\u5ea7\u516c\u5171\u536b\u751f\u95f4\u670d\u52a1\u54c1\u8d28\u63d0\u5347\u6539\u9020\u9879\u76ee\uff08\u76d1\u7406\uff09</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>FG-DLP-2018-0919</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u8d75\u4e95</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a88504133-8026</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u73af\u5883\u536b\u751f\u670d\u52a1\u4e2d\u5fc3</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u6d77\u6dc0\u5357\u8def36\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u91c7\u8d2d\u4eba\u8054\u7cfb\u4eba\uff1a\u4e54\u90e8\u957f   010-82653956</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u6cdb\u534e\u56fd\u91d1\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u8d75\u4e95  88504133-8026</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u961c\u5916\u4eae\u7532\u5e971\u53f7\u6069\u6d4e\u897f\u56ed\u4ea7\u4e1a\u56ed16\u53f7\u697cA\u5ea7</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p align=\"left\" style=\"background: white; text-align: left; line-height: 24.75pt; -ms-word-break: break-all;\">\u91c7\u8d2d\u6570\u91cf\uff1a1\u9879</p><p align=\"left\" style=\"background: white; text-align: left; line-height: 24.75pt; -ms-word-break: break-all;\">\u7528\u9014\uff1a\u4e3a\u6d77\u6dc0\u73af\u536b\u4e2d\u5fc3\u5395\u6240\u9769\u547d-100\u5ea7\u516c\u5171\u536b\u751f\u95f4\u670d\u52a1\u54c1\u8d28\u63d0\u5347\u6539\u9020\u9879\u76ee\u63d0\u4f9b\u76d1\u7406\u670d\u52a1</p><p>\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u5de5\u671f61\u5929</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>\uff081\uff09\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c22\u6761\u8981\u6c42\uff1b\uff082\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b\uff083\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b\uff084\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b\uff085\uff09\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b\uff086\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b\uff087\uff09\u6295\u6807\u4eba\u5fc5\u987b\u4e3a\u672a\u88ab\u5217\u5165\u4fe1\u7528\u4e2d\u56fd\u7f51\u7ad9( www.creditchina.gov.cn)\u3001\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51( www.ccgp.gov.cn)\u6e20\u9053\u4fe1\u7528\u8bb0\u5f55\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u7684\u54cd\u5e94\u4eba\uff1b\uff088\uff09\u5177\u6709\u623f\u5c4b\u5efa\u7b51\u5de5\u7a0b\u4e13\u4e1a\u4e59\u7ea7\u53ca\u4ee5\u4e0a\u8d44\u8d28\uff1b\u9879\u76ee\u603b\u76d1\u5e94\u5177\u6709\u5177\u6709\u56fd\u5bb6\u76d1\u7406\u5de5\u7a0b\u5e08\u6ce8\u518c\u8bc1\u4e66\u53ca\u603b\u76d1\u8058\u4efb\u4e66\u3002\uff089\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\uff1b\uff0810\uff09\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a270.063735 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 17:00\u81f32018\u5e7410\u670812\u65e5 17:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u8bf7\u767b\u5f55\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u516c\u5171\u8d44\u6e90\u4ea4\u6613\u4fe1\u606f\u7f51 (http://ggzyjy.bjhd.gov.cn/)\u514d\u8d39\u4e0b\u8f7d</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe50.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u8bf7\u767b\u5f55\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u516c\u5171\u8d44\u6e90\u4ea4\u6613\u4fe1\u606f\u7f51 (http://ggzyjy.bjhd.gov.cn/)\u514d\u8d39\u4e0b\u8f7d</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670829\u65e5 09:30</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670829\u65e5 09:30</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u4e1c\u5317\u65fa\u5357\u8def29\u53f7\u96624\u53f7\u697c\uff08\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u653f\u52a1\u670d\u52a1\u7ba1\u7406\u529e\u516c\u5ba4\uff09\u516d\u5c42\u897f\u4fa7\u7b2c\u4e00\u5f00\u6807\u5ba4</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p style=\"line-height: 150%;\"><strong>1.</strong><strong>\u6839\u636e\u300a\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\u6682\u884c\u529e\u6cd5\u300b\uff08\u8d22\u5e93</strong><strong>[2011]181</strong><strong>\u53f7\uff09\u7684\u89c4\u5b9a\uff0c\u5bf9\u6ee1\u8db3\u4ef7\u683c\u6263\u9664\u6761\u4ef6\u4e14\u5728\u6295\u6807\u6587\u4ef6\u4e2d\u63d0\u4ea4\u4e86\u300a\u6295\u6807\u4eba\u4f01\u4e1a\u7c7b\u578b\u58f0\u660e\u51fd\u300b\uff0c\u5e76\u63d0\u4f9b\u76f8\u5e94\u8bc1\u660e\u6750\u6599\uff0c\u8bc1\u660e\u5176\u6ee1\u8db3\u76f8\u5173\u89c4\u5b9a\u7684\u6295\u6807\u4eba\uff0c\u5176\u6295\u6807\u62a5\u4ef7\u6263\u9664</strong><strong>6%</strong><strong>\u540e\u53c2\u4e0e\u8bc4\u5ba1\uff08\u5982\u9002\u7528\uff09\u3002</strong></p><p style=\"line-height: 150%;\"><strong>2.</strong><strong>\u76d1\u72f1\u4f01\u4e1a\u89c6\u540c\u5c0f\u578b\u3001\u5fae\u578b\u4f01\u4e1a\uff0c\u76d1\u72f1\u4f01\u4e1a\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u65f6\uff0c\u5e94\u5f53\u63d0\u4f9b\u7531\u7701\u7ea7\u4ee5\u4e0a\u76d1\u72f1\u7ba1\u7406\u5c40\u3001\u6212\u6bd2\u7ba1\u7406\u5c40</strong><strong>(</strong><strong>\u542b\u65b0\u7586\u751f\u4ea7\u5efa\u8bbe\u5175\u56e2</strong><strong>)</strong><strong>\u51fa\u5177\u7684\u5c5e\u4e8e\u76d1\u72f1\u4f01\u4e1a\u7684\u8bc1\u660e\u6587\u4ef6\u590d\u5370\u4ef6\u5e76\u52a0\u76d6\u516c\u7ae0\uff0c\u5176\u6295\u6807\u62a5\u4ef7\u6263\u9664</strong><strong>6%</strong><strong>\u540e\u53c2\u4e0e\u8bc4\u5ba1\uff0c\u5426\u5219\u5c06\u4e0d\u4e88\u8ba4\u5b9a\u3002</strong></p><p align=\"left\" style=\"text-align: left; line-height: 150%;\"><strong>3.</strong><strong>\u6b8b\u75be\u4eba\u798f\u5229\u6027\u5355\u4f4d\u89c6\u540c\u5c0f\u578b\u3001\u5fae\u578b\u4f01\u4e1a\uff0c\u5728\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u65f6\uff0c\u5e94\u5f53\u63d0\u4f9b\u300a\u6b8b\u75be\u4eba\u798f\u5229\u6027\u58f0\u660e\u51fd\u300b\uff0c\u5e76\u5bf9\u58f0\u660e\u51fd\u7684\u771f\u5b9e\u6027\u8d1f\u8d23\uff0c\u5176\u6295\u6807\u62a5\u4ef7\u6263\u9664</strong><strong>6%</strong><strong>\u540e\u53c2\u4e0e\u8bc4\u5ba1\uff0c\u5426\u5219\u5c06\u4e0d\u4e88\u8ba4\u5b9a\u3002</strong></p>  <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            