{"title": "[\u987a\u4e49]\u987a\u4e49\u533a\u6ba1\u4eea\u9986\u5c3e\u6c14\u9664\u5c18\u8bbe\u5907\u7ef4\u62a4\u4fdd\u517b\u9879\u76ee\u516c\u5f00\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u6570\u5723\u5de5\u7a0b\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u987a\u4e49\u533a\u6ba1\u4eea\u9986\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u987a\u4e49\u533a\u6ba1\u4eea\u9986\u5c3e\u6c14\u9664\u5c18\u8bbe\u5907\u7ef4\u62a4\u4fdd\u517b\u9879\u76ee\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u987a\u4e49\u533a\u6ba1\u4eea\u9986\u5c3e\u6c14\u9664\u5c18\u8bbe\u5907\u7ef4\u62a4\u4fdd\u517b\u9879\u76ee</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>BJZB2018-SZC073</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5d14\u5143\u660a</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-89477580</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u6ba1\u4eea\u9986</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u5f20\u9547\u9f99\u51e4\u5c71\u8def\u75321\u53f7</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u4e8e\u632f\u4e1c 010-89470999</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u6570\u5723\u5de5\u7a0b\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u5d14\u5143\u660a\u3001\u5e9e\u5c11\u5e05</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u987a\u4e49\u533a\u5317\u73af\u8def90\u53f7\u9662\u7b2c\u4e8c\u5e62\u4e8c\u5c42</p><p></p><p></p>   <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p><p></p>  <p></p><p style=\"margin-left:14.1500pt;line-height:150%;\">2.\u91c7\u8d2d\u5185\u5bb9\u3001\u91c7\u8d2d\u7528\u9014\u53ca\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a</p><p style=\"margin-left:25.2000pt;line-height:150%;\">\uff081\uff09\u91c7\u8d2d\u5185\u5bb9\uff1a\u5305\u62ec\u706b\u5316\u673a\u5c3e\u6c14\u9664\u5c18\u8bbe\u59074\u5957,\u711a\u70e7\u7089\u53ca\u796d\u5960\u7089\u5c3e\u6c14\u9664\u5c18\u8bbe\u59073\u5957\u3002\u6d3e\u4eba\u957f\u671f\u8fdb\u9a7b\u9986\u5185\uff0c\u8d1f\u8d23\u8bbe\u5907\u7684\u65e5\u5e38\u6e05\u7406\u3001\u7ef4\u62a4\u3001\u4fdd\u517b\uff1b\u53ca\u65f6\u53d1\u73b0\u3001\u5904\u7406\u6613\u635f\u4ef6\u3001\u6d88\u8017\u54c1\u51fa\u73b0\u7684\u95ee\u9898\uff0c\u4fdd\u6301\u8bbe\u5907\u7684\u826f\u597d\u5de5\u51b5\u3002\u8d1f\u8d23\u66f4\u6362\u5e03\u888b\u3001\u6dfb\u52a0\u6c22\u6c27\u5316\u9499\u4ee5\u53ca\u65e5\u5e38\u4fdd\u517b\u7b49\u6d88\u8017\u54c1\u3002\u8d1f\u8d23\u5c3e\u6c14\u8bbe\u5907\u66f4\u6362\u98ce\u673a\u3001\u53d8\u9891\u5668\uff0cPLC\u3001\u89e6\u6478\u5c4f\u3001\u5404\u79cd\u9600\u95e8\uff0c\u6c34\u6cf5\u3001\u7a7a\u6c14\u538b\u7f29\u673a\u3001\u7535\u5668\u6613\u635f\u90e8\u4ef6\u7b49\u8bbe\u5907\u91cd\u8981\u96f6\u4ef6\u548c\u6613\u635f\u96f6\u4ef6\u7684\u4fdd\u517b\u3001\u68c0\u4fee\uff0c\u4ee5\u53ca\u6309\u9700\u66f4\u6362\u7b49\u5185\u5bb9\u3002</p><p style=\"margin-left:25.2000pt;line-height:150%;\">\uff082\uff09\u91c7\u8d2d\u7528\u9014\uff1a\u786e\u4fdd\u706b\u5316\u673a\u5c3e\u6c14\u9664\u5c18\u8bbe\u5907\uff0c\u711a\u70e7\u7089\u53ca\u796d\u5960\u7089\u5c3e\u6c14\u9664\u5c18\u8bbe\u5907\u7684\u6b63\u5e38\u8fd0\u884c\u5e76\u4e14\u8fbe\u5230\u73af\u4fdd\u8d28\u91cf\u5408\u683c\u6807\u51c6\u3002</p><p style=\"margin-left:25.2000pt;line-height:150%;\">\uff083\uff09\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u5fc5\u987b\u8fbe\u5230\u73b0\u884c\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u53ca\u5317\u4eac\u5e02\u3001\u884c\u4e1a\u7684\u6709\u5173\u6cd5\u89c4\u3001\u89c4\u8303\u7684\u8981\u6c42\u53ca\u76f8\u5173\u6587\u4ef6\u8981\u6c42\u7684\u8d28\u91cf\u6807\u51c6\u3002</p><p style=\"margin-left:25.2000pt;line-height:150%;\">\uff084\uff09\u8d44\u91d1\u6765\u6e90\uff1a\u8d22\u653f\u6027\u8d44\u91d1\uff08\u5e74\u521d\u6279\u590d[2018]\u7b2c0302\u53f7\uff09</p><p style=\"margin-left:25.2000pt;line-height:150%;\">\uff085\uff09\u6700\u9ad8\u6295\u6807\u9650\u4ef7\uff1a1150000\u5143\u3002</p><p style=\"margin-left:25.2000pt;line-height:150%;\">\uff086\uff09\u670d\u52a1\u671f\uff1a\u4e00\u5e74\uff08\u5177\u4f53\u4ee5\u5b9e\u9645\u7b7e\u8ba2\u5408\u540c\u65e5\u671f\u4e3a\u51c6\uff09</p><p></p><p><strong>\u4e8c\u3001\u6295\u6807\u4eba\u7684\u8d44\u683c\u8981\u6c42\uff1a</strong></p><p>3.\u5408\u683c\u6295\u6807\u4eba\u7684\u8d44\u683c\u6761\u4ef6\uff1a\uff081\uff09\u5728\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u5883\u5185\u5408\u6cd5\u6ce8\u518c\u7684\uff0c\u5177\u6709\u72ec\u7acb\u6cd5\u4eba\u8d44\u683c\uff0c\u7ecf\u8425\u8303\u56f4\u7b26\u5408\u672c\u6b21\u62db\u6807\u8981\u6c42\uff1b\uff082\uff09\u6ee1\u8db3\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u89c4\u5b9a\u7684\u6240\u6709\u6761\u4ef6\uff1b\uff083\uff09\u672a\u88ab\u4fe1\u7528\u4e2d\u56fd\u7f51\u7ad9\uff08www.creditchina.gov.cn\uff09\u53ca\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\uff08www.ccgp.gov.cn\uff09\u5217\u5165\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\uff1b \uff084\uff09\u9075\u5b88\u56fd\u5bb6\u6709\u5173\u6cd5\u5f8b\u3001\u6cd5\u89c4\u3001\u89c4\u7ae0\u548c\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u6709\u5173\u7684\u89c4\u7ae0\uff0c\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\u3002\u5728\u6cd5\u5f8b\u4e0a\u548c\u8d22\u52a1\u4e0a\u72ec\u7acb\u3001\u5408\u6cd5\u8fd0\u4f5c\u5e76\u72ec\u7acb\u4e8e\u91c7\u8d2d\u4eba\u548c\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4e4b\u5916\uff1b\uff085\uff09\u6295\u6807\u6587\u4ef6\u4e2d\u987b\u63d0\u4f9b\u4e2d\u56fd\u88c1\u5224\u6587\u4e66\u7f51\u4e0a\u7684\u884c\u8d3f\u72af\u7f6a\u6863\u6848\u67e5\u8be2\u7ed3\u679c\u7f51\u9875\u7248\u622a\u56fe\uff08\u52a0\u76d6\u5355\u4f4d\u516c\u7ae0\uff09\u4e14\u65e0\u884c\u8d3f\u72af\u7f6a\u8bb0\u5f55\uff1b\uff086\uff09\u672c\u6b21\u62db\u6807\u91c7\u7528\u8d44\u683c\u540e\u5ba1\uff1b\uff087\uff09\u6295\u6807\u4eba\u5fc5\u987b\u5411\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\uff0c\u672a\u5411\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6f5c\u5728\u6295\u6807\u4eba\u5747\u65e0\u8d44\u683c\u53c2\u52a0\u672c\u6b21\u6295\u6807\u3002</p><p></p><p><strong>\u4e09\u3001\u62db\u6807\u6587\u4ef6\u7684\u53d1\u552e\u65f6\u95f4\u53ca\u5730\u70b9\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a115.0 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u65f6\u95f4\uff1a2018\u5e7410\u670808\u65e5 09:00\u81f32018\u5e7410\u670812\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u5317\u73af\u8def90\u53f7\u9662\u7b2c\u4e8c\u5e62\u4e8c\u5c42</p><p>\u62db\u6807\u6587\u4ef6\u552e\u4ef7\uff1a\uffe5500.0 \u5143\uff0c\u672c\u516c\u544a\u5305\u542b\u7684\u62db\u6807\u6587\u4ef6\u552e\u4ef7\u603b\u548c</p><p>\u62db\u6807\u6587\u4ef6\u83b7\u53d6\u65b9\u5f0f\uff1a\u73b0\u573a\u83b7\u53d6</p><p></p><p><strong>\u56db\u3001\u6295\u6807\u622a\u6b62\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670831\u65e5 09:00</p><p><strong>\u4e94\u3001\u5f00\u6807\u65f6\u95f4\uff1a</strong>2018\u5e7410\u670831\u65e5 09:00</p><p><strong>\u516d\u3001\u5f00\u6807\u5730\u70b9\uff1a</strong></p><p>\u5317\u4eac\u5e02\u987a\u4e49\u533a\u5317\u73af\u8def90\u53f7\u9662\u7b2c\u4e8c\u5e62\u4e00\u5c42\u5f00\u6807\u5ba4\uff08\u5982\u6709\u53d8\u52a8\u53e6\u884c\u901a\u77e5\uff09\u3002</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin-left:14.1500pt;line-height:150%;\">1.\u91c7\u8d2d\u4eba\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u6ba1\u4eea\u9986</p><p style=\"margin-left:25.8500pt;line-height:150%;\">\u91c7\u8d2d\u4eba\u5730\u5740\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u5f20\u9547\u9f99\u51e4\u5c71\u8def\u75321\u53f7</p><p style=\"margin-left:25.8500pt;line-height:150%;\">\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u4e8e\u632f\u4e1c</p><p style=\"margin-left:25.8500pt;line-height:150%;\">\u91c7\u8d2d\u4eba\u7535\u8bdd\uff1a010-89470999</p><p style=\"margin-left:25.8500pt;line-height:150%;\">\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u6570\u5723\u5de5\u7a0b\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p style=\"margin-left:25.8500pt;line-height:150%;\">\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u5317\u73af\u8def90\u53f7\u9662\u7b2c\u4e8c\u5e62\u4e8c\u5c42</p><p style=\"margin-left:25.8500pt;line-height:150%;\">\u9879\u76ee\u8054\u7cfb\u4eba:\u5d14\u5143\u660a\u3001\u5e9e\u5c11\u5e05</p><p style=\"margin-left:25.8500pt;line-height:150%;\">\u8054\u7cfb\u7535\u8bdd:010-89477580 \u4f20\u771f:010-89477580</p><p style=\"margin-left:14.1500pt;line-height:150%;\">4.\u62a5\u540d\u65f6\u9700\u643a\u5e26\u8d44\u6599\uff1a</p><p style=\"margin-left:28.3500pt;line-height:150%;\">\uff081\uff09\u6cd5\u4eba\u8425\u4e1a\u6267\u7167\u526f\u672c\u3002\uff08<strong>\u9700\u63d0\u4f9b\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\u3002</strong>\uff09</p><p style=\"margin-left:28.3500pt;line-height:150%;\">\uff082\uff09\u88ab\u6388\u6743\u4eba\u6301\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u4e66\u539f\u4ef6\u53ca\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\u590d\u5370\u4ef6\uff0c\u88ab\u6388\u6743\u4eba\u5728\u672c\u5355\u4f4d\u7684\u7f34\u7eb3\u793e\u4fdd\u8bc1\u660e\uff08\u8fd11\u4e2a\u6708\uff08\u542b\u4ee5\u4e0a\uff09\uff08<strong>\u9700\u63d0\u4f9b\u539f\u4ef6\u6838\u9a8c\u5e76\u63d0\u4f9b\u4e00\u5957\u590d\u5370\u4ef6\u52a0\u76d6\u516c\u7ae0\u3002</strong>\uff09</p><p style=\"margin-left:14.1500pt;line-height:150%;\">5.\u62a5\u540d\u53ca\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e74<u>10</u>\u6708<u>08</u>\u65e5\u8d77\u81f32018\u5e74<u>10</u>\u6708<u>12</u>\u65e5\u6b62\uff0c\u6bcf\u5929\u4e0a\u53489:00-11\uff1a00\uff0c\u4e0b\u534814:00-16:00(\u5317\u4eac\u65f6\u95f4)\u3002\u672c\u9879\u76ee\u62db\u6807\u4ec5\u63a5\u53d7\u73b0\u573a\u62a5\u540d\uff0c\uff08\u53ea\u6709\u5df2\u7ecf\u62a5\u540d\u5e76\u767b\u8bb0\u5907\u6848\u7684\u6295\u6807\u4eba\u624d\u80fd\u8d2d\u4e70\u62db\u6807\u6587\u4ef6\uff09\u3002</p><p style=\"margin-left:28.3500pt;line-height:150%;\"><strong>\u62db\u6807\u6587\u4ef6\u552e\u4ef7500\u5143/\u672c\uff0c\u552e\u540e\u4e0d\u9000</strong></p><p style=\"margin-left:14.1500pt;line-height:150%;\">6. \u62a5\u540d\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u5317\u73af\u8def90\u53f7\u9662\u7b2c\u4e8c\u5e62\u4e8c\u5c42\uff08\u62db\u6807\u90e8\uff09\u3002</p><p style=\"margin-left:14.1500pt;line-height:150%;\">7.\u9012\u4ea4\u6295\u6807\u6587\u4ef6\u622a\u6b62\u65f6\u95f4\uff1a2018\u5e74<u>10</u>\u6708<u>31</u>\u65e5\u4e0a\u5348<u>09\uff1a00</u>\uff08\u5317\u4eac\u65f6\u95f4\uff09\u3002</p><p style=\"margin-left:14.1500pt;line-height:150%;\">8.\u6295\u6807\u622a\u6b62\u3001\u5f00\u6807\u65f6\u95f4\uff1a2018\u5e74<u>10</u>\u6708<u>31</u>\u65e5\u4e0a\u5348<u>09\uff1a00</u>\uff08\u5317\u4eac\u65f6\u95f4\uff09\uff0c\u903e\u671f\u6536\u5230\u6216\u4e0d\u7b26\u5408\u89c4\u5b9a\u7684\u6295\u6807\u6587\u4ef6\u6055\u4e0d\u63a5\u53d7\u3002</p><p style=\"margin-left:14.1500pt;line-height:150%;\">9.\u6295\u6807\u548c\u5f00\u6807\u5730\u70b9\uff1a<u>\u5317\u4eac\u5e02\u987a\u4e49\u533a</u><u>\u5317\u73af\u8def90\u53f7\u9662\u7b2c\u4e8c\u5e62\u4e00\u5c42\u5f00\u6807\u5ba4</u>\uff08\u5982\u6709\u53d8\u52a8\u53e6\u884c\u901a\u77e5\uff09\u3002</p><p style=\"margin-left:14.1500pt;line-height:150%;\">10.\u8bc4\u6807\u65b9\u6cd5\uff1a\u7efc\u5408\u8bc4\u5206\u6cd5\uff0c\u8be6\u89c1\u62db\u6807\u6587\u4ef6\u3002</p><p style=\"margin-left:14.1500pt;line-height:150%;\">11.\u53d1\u5e03\u5a92\u4ecb\uff1a\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u3001\u5317\u4eac\u5e02\u653f\u5e9c\u91c7\u8d2d\u7f51\u3001\u987a\u4e49\u533a\u653f\u5e9c\u91c7\u8d2d\u7f51\u3002</p><p style=\"margin-left:14.1500pt;line-height:150%;\">12.\u672c\u516c\u544a\u516c\u793a\u671f\uff1a2018\u5e7410\u670808\u65e5\u81f32018\u5e7410\u670812\u65e5\uff085\u4e2a\u5de5\u4f5c\u65e5\uff09</p><p></p><p><strong>\u516b\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p style=\"margin-left:14.1500pt;line-height:150%;\">1\uff09\u6267\u884c\u300a\u8d22\u653f\u90e8 \u56fd\u5bb6\u53d1\u5c55\u6539\u9769\u59d4\u5173\u4e8e\u5370\u53d1\u3008\u8282\u80fd\u4ea7\u54c1\u653f\u5e9c\u91c7\u8d2d\u5b9e\u65bd\u610f\u89c1\u3009\u7684\u901a\u77e5\u300b\uff08\u8d22\u5e93[2004]185\u53f7\uff09\uff1b</p><p style=\"margin-left:14.1500pt;line-height:150%;\">2\uff09\u6267\u884c\u300a\u8d22\u653f\u90e8 \u73af\u4fdd\u603b\u5c40\u5173\u4e8e\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u653f\u5e9c\u91c7\u8d2d\u5b9e\u65bd\u7684\u610f\u89c1\u300b\uff08\u8d22\u5e93[2006]90\u53f7\uff09\uff1b</p><p style=\"margin-left:14.1500pt;line-height:150%;\">3\uff09\u6267\u884c\u300a\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\u6682\u884c\u529e\u6cd5\u300b\uff08\u8d22\u5e93[2011]181\u53f7\uff09\uff1b</p><p style=\"margin-left:14.1500pt;line-height:150%;\">4\uff09\u6267\u884c\u300a\u8d22\u653f\u90e8\u5173\u4e8e\u5f00\u5c55\u653f\u5e9c\u91c7\u8d2d\u4fe1\u7528\u62c5\u4fdd\u8bd5