{"title": "[\u660c\u5e73]\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4eba\u529b\u8d44\u6e90\u548c\u793e\u4f1a\u4fdd\u969c\u5c402018\u5e74\u91cd\u9633\u8282\u9000\u4f11\u4eba\u5458\u8da3\u5473\u8fd0\u52a8\u4f1a\u5956\u54c1\u91c7\u8d2d\u6210\u4ea4\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u660c\u73f9\u5de5\u7a0b\u7ba1\u7406\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4eba\u529b\u8d44\u6e90\u548c\u793e\u4f1a\u4fdd\u969c\u5c40\u7684\u59d4\u6258\uff0c\u5c312018\u5e74\u91cd\u9633\u8282\u9000\u4f11\u4eba\u5458\u8da3\u5473\u8fd0\u52a8\u4f1a\u5956\u54c1\u91c7\u8d2d\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aJM-00004073\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u6210\u4ea4\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aJM-00004073</p><p>\u9879\u76ee\u540d\u79f0\uff1a2018\u5e74\u91cd\u9633\u8282\u9000\u4f11\u4eba\u5458\u8da3\u5473\u8fd0\u52a8\u4f1a\u5956\u54c1\u91c7\u8d2d</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u6653\u65ed</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a89717589</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4eba\u529b\u8d44\u6e90\u548c\u793e\u4f1a\u4fdd\u969c\u5c40</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u653f\u5e9c\u88573\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u738b\u9e7f\u539f010-69741318</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u660c\u73f9\u5de5\u7a0b\u7ba1\u7406\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u57ce\u5317\u8857\u9053\u5357\u90dd\u5e84\u8def3\u53f7</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u5f20\u6653\u65ed010-89717589</p><p></p><p><strong>\u56db\u3001\u6210\u4ea4\u4fe1\u606f</strong></p><p>\u62db\u6807\u6587\u4ef6\u7f16\u53f7\uff1aJM-00004073</p><p>\u672c\u9879\u76ee\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670820\u65e5</p><p>\u6210\u4ea4\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u6210\u4ea4\u91d1\u989d\uff1a98.6950000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p>                <p>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u5730\u5740\u53ca\u6210\u4ea4\u91d1\u989d\uff1a</p><p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td>\u5e8f\u53f7</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u8054\u7cfb\u5730\u5740</td><td>\u6210\u4ea4\u91d1\u989d(\u4e07\u5143)</td></tr><tr><td>1</td><td>\u5317\u4eac\u53f6\u6c0f\u53cc\u7fa4\u5546\u8d38\u4e2d\u5fc3</td><td>\u5317\u4eac\u5e02\u660c\u5e73\u533a\u57ce\u5317\u8857\u9053\u5e9c\u5b66\u8def16\u53f7\u91d1\u4e94\u661f\u670d\u88c5\u767e\u8d27\u6279\u53d1\u5e02\u573aF4-041</td><td>18.445000</td></tr><tr><td>2</td><td>\u6e56\u5357\u53ef\u5b5a\u533b\u7597\u79d1\u6280\u53d1\u5c55\u6709\u9650\u516c\u53f8</td><td>\u957f\u6c99\u5e02\u96e8\u82b1\u533a\u540c\u5347\u8857\u9053\u91d1\u6d77\u8def158\u53f7</td><td>80.250000</td></tr></tbody></table><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.4805 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u56fd\u5bb6\u8ba1\u59d4\u9881\u5e03\u7684\u300a\u62db\u6807\u4ee3\u7406\u670d\u52a1\u8d39\u7ba1\u7406\u6682\u884c\u529e\u6cd5\u300b\uff08\u8ba1\u4ef7\u683c[2002]1980\u53f7\uff09\u6536\u53d6\u3002</p><p></p><p>\u8c08\u5224\u5c0f\u7ec4\u3001\u8be2\u4ef7\u5c0f\u7ec4\u3001\u78cb\u5546\u5c0f\u7ec4\u6210\u5458\u540d\u5355\u53ca\u5355\u4e00\u6765\u6e90\u91c7\u8d2d\u4eba\u5458\u540d\u5355\uff1a</p><p>\u738b\u68ee\u3001\u7530\u4e3d\u534e\u3001\u8d3a\u7389\u840d</p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u9879\u76ee\u7528\u9014\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4eba\u529b\u8d44\u6e90\u548c\u793e\u4f1a\u4fdd\u969c\u5c402018\u5e74\u91cd\u9633\u8282\u9000\u4f11\u4eba\u5458\u8da3\u5473\u8fd0\u52a8\u4f1a\u5956\u54c1</p><p>\u5408\u540c\u5c65\u884c\u671f:15\u65e5\u5386\u5929</p><p></p><p><strong>\u516d\u3001\u6210\u4ea4\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</strong></p><p></p><p>\u6807\u7684\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u4eba\u529b\u8d44\u6e90\u548c\u793e\u4f1a\u4fdd\u969c\u5c402018\u5e74\u91cd\u9633\u8282\u9000\u4f11\u4eba\u5458\u8da3\u5473\u8fd0\u52a8\u4f1a\u5956\u54c1\u91c7\u8d2d\u6210\u4ea4\u516c\u544a</p><p>\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u4ef7\u683c\u3001\u670d\u52a1\u8981\u6c42\uff1a\u8be6\u89c1\u9644\u4ef6</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p></p><p></p>  <p></p> <p></p> <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               