{"title": "[\u660c\u5e73]\u5317\u4eac\u5e02\u660c\u5e73\u533a\u5317\u4e03\u5bb6\u9547\u4eba\u6c11\u653f\u5e9c\u5317\u4e03\u5bb6\u9547\u8857\u5df7\u80e1\u540c\u53ca\u76f8\u5173\u9053\u8def\u7a7a\u95f4\u6574\u6cbb\u63d0\u5347\u5de5\u7a0b\u62db\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5efa\u667a\u8fbe\u5de5\u7a0b\u7ba1\u7406\u80a1\u4efd\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u660c\u5e73\u533a\u5317\u4e03\u5bb6\u9547\u4eba\u6c11\u653f\u5e9c\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5317\u4e03\u5bb6\u9547\u8857\u5df7\u80e1\u540c\u53ca\u76f8\u5173\u9053\u8def\u7a7a\u95f4\u6574\u6cbb\u63d0\u5347\u5de5\u7a0b\u8fdb\u884c\u516c\u5f00\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4e03\u5bb6\u9547\u8857\u5df7\u80e1\u540c\u53ca\u76f8\u5173\u9053\u8def\u7a7a\u95f4\u6574\u6cbb\u63d0\u5347\u5de5\u7a0b</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>/</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u9a70</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-58547952</p><p></p> <p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u5317\u4e03\u5bb6\u9547\u4eba\u6c11\u653f\u5e9c</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u5317\u4e03\u5bb6\u9547</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u5f20\u5de5010-58547952</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u5efa\u667a\u8fbe\u5