{"title": "[\u5ef6\u5e86]\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u9999\u8425\u4e61\u7f8e\u4e3d\u4e61\u6751\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c1\u5305\uff09\u7ade\u4e89\u6027\u8c08\u5224\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u5927\u56fd\u4fe1\u5de5\u7a0b\u7ba1\u7406\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u9999\u8425\u4e61\u5c71\u5e95\u4e0b\u6751\u6c11\u59d4\u5458\u4f1a\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u9999\u8425\u4e61\u7f8e\u4e3d\u4e61\u6751\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c1\u5305\uff09\u8fdb\u884c\u7ade\u4e89\u6027\u8c08\u5224\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u9999\u8425\u4e61\u7f8e\u4e3d\u4e61\u6751\u5efa\u8bbe\u9879\u76ee\uff08\u7b2c1\u5305\uff09</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong>ZDGX2018-140</p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5218\u5de5</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a15801537992</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u9999\u8425\u4e61\u5c71\u5e95\u4e0b\u6751\u6c11\u59d4\u5458\u4f1a</p><p></p>  <p>\u5730\u5740\uff1a\u5317\u4eac\u5e02\u5ef6\u5e86\u533a\u9999\u8425\u4e61\u5c71\u5e95\u4e0b\u6751</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a\u8d75\u5148\u751f010-69189118</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u4e2d\u5927\u56fd\u4fe1\u5de5\u7a0b\u7ba1\u7406\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a\u5218\u5de5/15801537992</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u5f70\u5316\u8def138\u53f72\u53f7\u697c\u897f\u8363\u9601\u5199\u5b57\u697c\u4e94\u5c42</p><p></p>  <p></p><p><strong>\u4e00\u3001\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\u7b80\u8981\u8bf4\u660e:</strong></p><p>1\u3001\u5177\u6709\u72ec\u7acb\u6cd5\u4eba\u8d44\u683c\u53ca\u5de5\u5546\u884c\u653f\u7ba1\u7406\u90e8\u95e8\u6838\u53d1\u7684\u6709\u6548\u8425\u4e1a\u6267\u7167\uff1b2\u3001\u6f5c\u5728\u6295\u6807\u4eba\u987b\u5177\u6709\u5e02\u653f\u516c\u7528\u5de5\u7a0b\u65bd\u5de5\u603b\u627f\u5305\u4e09\u7ea7\uff08\u542b\uff09\u4ee5\u4e0a\u8d44\u8d28\uff1b3\u3001\u9879\u76ee\u7ecf\u7406\u987b\u5177\u5907\u5e02\u653f\u516c\u7528\u5de5\u7a0b\u4e8c\u7ea7\u5efa\u9020\u5e08\uff08\u542b\uff09\u4ee5\u4e0a\u6ce8\u518c\u6267\u4e1a\u8d44\u683c\uff1b\u30004\u3001\u4f01\u4e1a\u4fe1\u8a89\u548c\u8d22\u52a1\u72b6\u51b5\u826f\u597d\uff0c\u6709\u8db3\u591f\u7684\u8d44\u91d1\u80fd\u529b\u6765\u627f\u62c5\u672c\u9879\u76ee\u7684\u5b9e\u65bd\uff1b\u30005\u3001\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u987b\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b\u30006\u3001\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff0c\u6ca1\u6709\u5904\u4e8e\u88ab\u8d23\u4ee4\u505c\u4e1a\u6216\u6295\u6807\u8d44\u683c\u88ab\u53d6\u6d88\u8d22\u4ea7\u88ab\u63a5\u7ba1\u3001\u51bb\u7ed3\u7684\u72b6\u6001\uff1b7\u3001\u5177\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b8\u3001\u5177\u6709\u5efa\u8bbe\u884c\u653f\u4e3b\u7ba1\u90e8\u95e8\u6838\u53d1\u7684\u6709\u6548\u671f\u5185\u7684\u300a\u5b89\u5168\u751f\u4ea7\u8bb8\u53ef\u8bc1\u300b\uff1b9\u3001\u672a\u88ab\u201c\u4fe1\u7528\u4e2d\u56fd\u7f51\u7ad9\u201d\uff08www.creditchina.gov.cn\uff09\u3001\u201c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u201d\u5217\u5165\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\uff1b10\u3001\u672c\u5de5\u7a0b\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u62a5\u540d\u3001\u4e0d\u63a5\u53d7\u7f51\u4e0a\u62a5\u540d\uff1b\u672c\u6b21\u62db\u6807\u5bf9\u672a\u4e2d\u6807\u5355\u4f4d\u4e0d\u7ed9\u4e88\u7ecf\u6d4e\u8865\u507f\u3002</p><p></p><p><strong>\u4e8c\u3001\u83b7\u53d6\u8c08\u5224\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9:</strong></p><p>\u83b7\u53d6\u8c08\u5224\u6587\u4ef6\u7684\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670809\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p></p><p>\u83b7\u53d6\u8c08\u5224\u6587\u4ef6\u5730\u70b9\uff1a \u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u5f70\u5316\u8def138\u53f72\u53f7\u697c\u897f\u8363\u9601\u5199\u5b57\u697c\u4e94\u5c42</p><p></p><p><strong>\u4e09\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p></p><p><strong>\u56db\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5218\u5de5</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a15801537992</p><p></p><p><strong>\u4e94\u3001\u8c08\u5224\u65b9\u5f0f\u6587\u4ef6\u53ca\u552e\u4ef7\u7b49\uff1a</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a387.632 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u83b7\u53d6\u8c08\u5224\u6587\u4ef6\u65b9\u5f0f:\u8425\u4e1a\u6267\u7167\u526f\u672c\u3001\u8d44\u8d28\u8bc1\u4e66\u526f\u672c\u3001\u5b89\u5168\u751f\u4ea7\u8bb8\u53ef\u8bc1\u3001\u9879\u76ee\u7ecf\u7406\u6ce8\u518c\u8d44\u683c\u8bc1\u4e66\u53ca\u5b89\u5168\u751f\u4ea7\u8003\u6838\u5408\u683c\u8bc1\u4e66\u3001\u6cd5\u5b9a\u4ee3\u8868\u4eba\uff08\u6216\u6388\u6743\u59d4\u6258\u4eba\uff09\u8eab\u4efd\u8bc1\u3001\u6388\u6743\u59d4\u6258\u4e66\uff0c\u672a\u88ab\u201c\u4fe1\u7528\u4e2d\u56fd\u7f51\u7ad9\u201d\uff08www.creditchina.gov.cn\uff09\u3001\u201c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u201d\u5217\u5165\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u7684\u622a\u56fe\u8bc1\u660e\u3001\u5916\u5730\u4f01\u4e1a\u62a5\u540d\u9700\u6301\u300a\u4f01\u4e1a\u8fdb\u4eac\u5907\u6848\u8bc1\u4e66\u300b\u3002\u6ce8\uff1a\u5e94\u63d0\u4f9b\u4ee5\u4e0a\u6240\u6709\u8d44\u6599\u7684\u539f\u4ef6\u4ee5\u53ca\u52a0\u76d6\u5355\u4f4d\u516c\u7ae0\u7684\u590d\u5370\u4ef61\u5957\uff08\u622a\u56fe\u8bc1\u660e\u65e0\u9700\u539f\u4ef6\uff09\u3002</p><p>\u83b7\u53d6\u8c08\u5224\u6587\u4ef6\u6587\u4ef6\u552e\u4ef7\uff1a500.0 \u5143</p><p>\u8c08\u5224\u6587\u4ef6\u53d1\u552e\u8d77\u3001\u6b62\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670809\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7410\u670812\u65e5 14:00</p><p>\u8c08\u5224\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u622a\u6b62\u65f6\u95f4\uff1a2018\u5e7410\u670812\u65e5 14:00</p><p>\u8c08\u5224\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9:\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u5f70\u5316\u8def138\u53f72\u53f7\u697c\u897f\u8363\u9601\u5199\u5b57\u697c\u4e94\u5c42 </p><p>\u8c08\u5224\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7410\u670812\u65e5 14:00</p><p>\u8c08\u5224\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9:\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u5f70\u5316\u8def138\u53f72\u53f7\u697c\u897f\u8363\u9601\u5199\u5b57\u697c\u4e94\u5c42 </p><p></p><p><strong>\u516d\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p><span style='font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-fareast-font-family: \"Times New Roman\"; mso-ascii-font-family: \u5b8b\u4f53;'><font color=\"#000000\">\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a\u6276\u6301\u4e2d\u5c0f\u4f01\u4e1a\u53ca\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\uff0c\u9f13\u52b1\u8282\u80fd\u73af\u4fdd\u4ea7\u54c1\uff0c\u652f\u6301\u81ea\u4e3b\u521b\u65b0\u7b49\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\u3002</font></span></p><p></p><p><strong>\u4e03\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p></p><p>\u9053\u8def\u5de5\u7a0b\uff0c\u8be6\u89c1\u56fe\u7eb8\u53ca\u5de5\u7a0b\u91cf\u6e05\u5355\u8303\u56f4\u5185\u5168\u90e8\u5185\u5bb9\u3002</p>     <p></p><p></p>         <p></p>           <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 