{"title": "[\u671d\u9633]\u5317\u4eac\u5e02\u671d\u9633\u533a\u4eba\u6c11\u653f\u5e9c\u9152\u4ed9\u6865\u8857\u9053\u529e\u4e8b\u5904\u9152\u4ed9\u6865\u5730\u533a\u516c\u5171\u5b89\u5168\u89c6\u9891\u7cfb\u7edf\u7ade\u4e89\u6027\u78cb\u5546", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u5b8f\u6e90\u5408\u6b63\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u671d\u9633\u533a\u4eba\u6c11\u653f\u5e9c\u9152\u4ed9\u6865\u8857\u9053\u529e\u4e8b\u5904\u59d4\u6258\uff0c\u6839\u636e\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b49\u6709\u5173\u89c4\u5b9a\uff0c\u73b0\u5bf9\u9152\u4ed9\u6865\u5730\u533a\u516c\u5171\u5b89\u5168\u89c6\u9891\u7cfb\u7edf\u8fdb\u884c\u7ade\u4e89\u6027\u78cb\u5546\u62db\u6807\uff0c\u6b22\u8fce\u5408\u683c\u7684\u4f9b\u5e94\u5546\u524d\u6765\u6295\u6807\u3002</p><p></p><p><strong>\u9879\u76ee\u540d\u79f0\uff1a</strong>\u9152\u4ed9\u6865\u5730\u533a\u516c\u5171\u5b89\u5168\u89c6\u9891\u7cfb\u7edf</p><p><strong>\u9879\u76ee\u7f16\u53f7\uff1a</strong></p><p><strong>\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u9633</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-62386599</p><p></p><p></p><p><strong>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u4eba\u6c11\u653f\u5e9c\u9152\u4ed9\u6865\u8857\u9053\u529e\u4e8b\u5904</p><p></p>  <p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u9152\u4ed9\u6865\u516d\u8857\u574a\u516d\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a010-85838641</p><p></p><p></p><p><strong>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u4ee3\u7406\u673a\u6784\uff1a\u5317\u4eac\u5b8f\u6e90\u5408\u6b63\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u4eba\uff1a010-62386599</p><p>\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a \u5317\u4eac\u5e02\u897f\u57ce\u533a\u5317\u4e09\u73af\u4e2d\u8def\u753229\u53f73\u53f7\u697c\u534e\u9f99\u5927\u53a6A\u5ea71901</p><p></p>       <p></p><p><strong>\u4e00\u3001\u91c7\u8d2d\u9879\u76ee\u7684\u540d\u79f0\u3001\u6570\u91cf\u3001\u7b80\u8981\u89c4\u683c\u63cf\u8ff0\u6216\u9879\u76ee\u57fa\u672c\u6982\u51b5\u4ecb\u7ecd\uff1a</strong></p> <p>\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p><strong>\u4e8c\u3001\u5bf9\u4f9b\u5e94\u5546\u8d44\u683c\u8981\u6c42\uff08\u4f9b\u5e94\u5546\u8d44\u683c\u6761\u4ef6\uff09:</strong></p><p>1\u3001\u6295\u6807\u4eba\u8d44\u8d28\u548c\u80fd\u529b\u8981\u6c421.1 \u6295\u6807\u4eba\u5fc5\u987b\u7b26\u5408\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u7b2c\u4e8c\u5341\u4e8c\u6761\u7684\u89c4\u5b9a\uff1a1\uff09\u5177\u6709\u72ec\u7acb\u627f\u62c5\u6c11\u4e8b\u8d23\u4efb\u7684\u80fd\u529b\uff1b2\uff09\u5177\u6709\u826f\u597d\u7684\u5546\u4e1a\u4fe1\u8a89\u548c\u5065\u5168\u7684\u8d22\u52a1\u4f1a\u8ba1\u5236\u5ea6\uff1b3\uff09\u5177\u6709\u5c65\u884c\u5408\u540c\u6240\u5fc5\u9700\u7684\u8bbe\u5907\u548c\u4e13\u4e1a\u6280\u672f\u80fd\u529b\uff1b4\uff09\u5177\u6709\u4f9d\u6cd5\u7f34\u7eb3\u7a0e\u6536\u548c\u793e\u4f1a\u4fdd\u969c\u8d44\u91d1\u7684\u826f\u597d\u8bb0\u5f55\uff1b5\uff09\u53c2\u52a0\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u524d\u4e09\u5e74\u5185\uff0c\u5728\u7ecf\u8425\u6d3b\u52a8\u4e2d\u6ca1\u6709\u91cd\u5927\u8fdd\u6cd5\u8bb0\u5f55\uff1b6\uff09\u6cd5\u5f8b\u3001\u884c\u653f\u6cd5\u89c4\u89c4\u5b9a\u7684\u5176\u4ed6\u6761\u4ef6\uff1b7\uff09\u4f9d\u636e\u201c\u8d22\u653f\u90e8 \u5de5\u4e1a\u548c\u4fe1\u606f\u5316\u90e8\u5173\u4e8e\u5370\u53d1\u300a\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\u6682\u884c\u529e\u6cd5\u300b\u7684\u901a\u77e5\u201d\uff08\u8d22\u5e93\u30102011\u3011181 \u53f7\uff09\u53ca\u201c\u5317\u4eac\u5e02\u8d22\u653f\u5c40\u5317\u4eac\u5e02\u7ecf\u6d4e\u548c\u4fe1\u606f\u5316\u59d4\u5458\u4f1a\u8f6c\u53d1\u8d22\u653f\u90e8 \u5de5\u4e1a\u548c\u4fe1\u606f\u5316\u90e8\u5173\u4e8e\u5370\u53d1\u300a\u653f\u5e9c\u91c7\u8d2d\u4fc3\u8fdb\u4e2d\u5c0f\u4f01\u4e1a\u53d1\u5c55\u6682\u884c\u529e\u6cd5\u300b\u7684\u901a\u77e5\u201d\uff08\u4eac\u8d22\u91c7\u8d2d\u30102012\u301175 \u53f7\uff09\u6587\u4ef6\u7cbe\u795e\uff0c\u672c\u9879\u76ee\u5bf9\u5c0f\u578b\u5fae\u578b\u4f01\u4e1a(\u542b\u76d1\u72f1\u4f01\u4e1a)\u4ea7\u54c1\u7684\u4ef7\u683c\u7ed9\u4e88 6%\u7684\u6263\u9664\uff0c\u7528\u6263\u9664\u540e\u7684\u4ef7\u683c\u53c2\u4e0e\u8bc4\u5ba1\uff1b8\uff09\u5355\u4f4d\u8d1f\u8d23\u4eba\u4e3a\u540c\u4e00\u4eba\u6216\u8005\u5b58\u5728\u76f4\u63a5\u63a7\u80a1\u3001\u7ba1\u7406\u5173\u7cfb\u7684\u4e0d\u540c\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u53c2\u52a0\u540c\u4e00\u5408\u540c\u9879\u4e0b\u7684\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\u3002\u9664\u5355\u4e00\u6765\u6e90\u91c7\u8d2d\u9879\u76ee\u5916\uff0c\u4e3a\u91c7\u8d2d\u9879\u76ee\u63d0\u4f9b\u6574\u4f53\u8bbe\u8ba1\u3001\u89c4\u8303\u7f16\u5236\u6216\u8005\u9879\u76ee\u7ba1\u7406\u3001\u76d1\u7406\u3001\u68c0\u6d4b\u7b49\u670d\u52a1\u7684\u4f9b\u5e94\u5546\uff0c\u4e0d\u5f97\u518d\u53c2\u52a0\u8be5\u91c7\u8d2d\u9879\u76ee\u7684\u5176\u4ed6\u91c7\u8d2d\u6d3b\u52a8\uff1b1.2 \u6295\u6807\u4f01\u4e1a\u9700\u5177\u5907\u5b89\u9632\u5de5\u7a0b\u4f01\u4e1a\u8bbe\u8ba1\u65bd\u5de5\u7ef4\u62a4\u80fd\u529b\u8bc1\u4e66\u4e09\u7ea7\u53ca\u4ee5\u4e0a\u8d44\u8d28\uff1b1.3\u6295\u6807\u4eba\u7684\u6295\u6807\u8d27\u7269\u5e94\u7b26\u5408\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u89c4\u5b9a\u7684\u76f8\u5e94\u6280\u672f\u3001\u8282\u80fd\u3001\u5b89\u5168\u548c\u73af\u4fdd\u6807\u51c6\uff1b\u5982\u56fd\u5bb6\u6709\u5173\u90e8\u95e8\u5bf9\u6295\u6807\u4eba\u7684\u6295\u6807\u8d27\u7269\u6709\u5f3a\u5236\u6027\u89c4\u5b9a\u6216\u8981\u6c42\u7684\uff0c\u5219\u6295\u6807\u4eba \u7684\u6295\u6807\u8d27\u7269\u5fc5\u987b\u7b26\u5408\u76f8\u5e94\u89c4\u5b9a\u6216\u8981\u6c42\uff1b1.4\u6cd5\u5b9a\u4ee3\u8868\u4eba\u4e3a\u540c\u4e00\u4e2a\u4eba\u7684\u4e24\u4e2a\u53ca\u4e24\u4e2a\u4ee5\u4e0a\u6cd5\u4eba\uff0c\u6bcd\u516c\u53f8\u53ca\u5176\u5168\u8d44\u5b50\u516c\u53f8\u3001\u63a7\u80a1\u516c\u53f8\uff0c\u4e0d\u5f97\u540c\u65f6\u53c2\u52a0\u672c\u62db\u6807\u9879\u76ee\u6295\u6807\uff1b1.5\u4f9d\u636e\uff08\u8d22\u5e93\u30102016\u3011125 \u53f7\uff09\u6587\uff0c\u6295\u6807\u4eba\u8fd1\u4e09\u5e74\u88ab\u201c\u4fe1\u7528\u4e2d\u56fd\u201d\u7f51\u7ad9\u3001\u201c\u4e2d\u56fd\u653f\u5e9c\u91c7\u8d2d\u7f51\u201d\u7f51\u7ad9\u5217\u5165\u5931\u4fe1\u88ab\u6267\u884c\u4eba\u3001\u91cd\u5927\u7a0e\u6536\u8fdd\u6cd5\u6848\u4ef6\u5f53\u4e8b\u4eba\u540d\u5355\u3001\u653f\u5e9c\u91c7\u8d2d\u4e25\u91cd\u8fdd\u6cd5\u5931\u4fe1\u884c\u4e3a\u8bb0\u5f55\u540d\u5355\u7684\uff0c\u4e0d\u5f97\u53c2\u4e0e\u672c\u9879\u76ee\u7684\u653f\u5e9c\u91c7\u8d2d\u6d3b\u52a8\uff1b1.6\u672c\u9879\u76ee\u4e0d\u63a5\u53d7\u8054\u5408\u4f53\u62a5\u540d\u3002</p><p></p><p><strong>\u4e09\u3001\u78cb\u5546\u548c\u54cd\u5e94\u6587\u4ef6\u65f6\u95f4\u53ca\u5730\u70b9\u7b49:</strong></p><p>\u9884\u7b97\u91d1\u989d\uff1a289.3 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u8c08\u5224\u65f6\u95f4\uff1a2018\u5e7410\u670817\u65e5 14:30</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65f6\u95f4\uff1a2018\u5e7409\u670830\u65e5 09:00\u81f32018\u5e7410\u670811\u65e5 16:00(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5317\u4e09\u73af\u4e2d\u8def\u753229\u53f73\u53f7\u697c\u534e\u9f99\u5927\u53a6A\u5ea71901</p><p>\u83b7\u53d6\u78cb\u5546\u6587\u4ef6\u65b9\u5f0f\uff1a\u73b0\u573a\u9886\u53d6\uff0c\u9886\u53d6\u65f6\u9700\u643a\u5e26\u4ee5\u4e0b\u8d44\u6599\uff1a\u51e1\u6709\u610f\u53c2\u52a0\u6295\u6807\u8005\u8bf7\u4e8e\u516c\u544a\u6709\u6548\u671f\u5185\u6301\u5355\u4f4d\u6cd5\u5b9a\u4ee3\u8868\u4eba\u6388\u6743\u59d4\u6258\u4e66\u53ca\u88ab\u6388\u6743\u4eba\u8eab\u4efd\u8bc1\uff1b\u6709\u6548\u8425\u4e1a\u6267\u7167\u526f\u672c\uff1b\u8d44\u8d28\u8bc1\u4e66\u526f\u672c\u5230\u6307\u5b9a\u5730\u70b9\u62a5\u540d\uff08\u4ee5\u4e0a\u8d44\u6599\u5747\u987b\u643a\u5e26\u539f\u4ef6\u4f9b\u67e5\u9a8c\uff0c\u8d44\u8d28\u8bc1\u4e66\u9664\u5916\uff0c\u540c\u65f6\u63d0\u4f9b\u52a0\u76d6\u5355\u4f4d\u516c\u7ae0\u7684\u590d\u5370\u4ef6 1 \u5957\u5907\u6848\uff09</p><p>\u78cb\u5546\u6587\u4ef6\u552e\u4ef7\uff1a500.0  \u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u65f6\u95f4\uff1a2018\u5e7410\u670817\u65e5 14:00\u81f32018\u5e7410\u670817\u65e5 14:30(\u53cc\u4f11\u65e5\u53ca\u6cd5\u5b9a\u8282\u5047\u65e5\u9664\u5916)</p><p>\u54cd\u5e94\u6587\u4ef6\u9012\u4ea4\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5317\u4e09\u73af\u4e2d\u8def\u753229\u53f73\u53f7\u697c\u534e\u9f99\u5927\u53a6A\u5ea71901</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u65f6\u95f4\uff1a2018\u5e7410\u670817\u65e5 14:30</p><p>\u54cd\u5e94\u6587\u4ef6\u5f00\u542f\u5730\u70b9\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5317\u4e09\u73af\u4e2d\u8def\u753229\u53f73\u53f7\u697c\u534e\u9f99\u5927\u53a6A\u5ea71901</p><p></p><p><strong>\u56db\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c\uff1a</strong></p><p></p><p><strong>\uff1a\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u300b\u3001\u300a\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u653f\u5e9c\u91c7\u8d2d\u6cd5\u5b9e\u65bd\u6761\u4f8b\u300b\u3001\u300a\u653f\u5e9c\u91c7\u8d2d\u8d27\u7269\u548c\u670d\u52a1\u62db\u6807\u6295\u6807\u7ba1\u7406\u529e\u6cd5\u300b\uff08\u8d22\u653f\u90e8\u7b2c 87 \u53f7\u4ee4\uff09\u3001\u300a\u5173\u4e8e\u653f\u5e9c\u91c7\u8d2d\u8fdb\u53e3\u4ea7\u54c1\u7ba1\u7406\u6709\u5173\u95ee\u9898\u7684\u901a\u77e5\u300b\uff08\u8d22\u529e\u5e93\ufe5d2008\ufe5e248 \u53f7\uff09\u3001\u300a\u5de5\u4e1a\u548c\u4fe1\u606f\u5316\u90e8\u3001\u56fd\u5bb6\u7edf\u8ba1\u5c40\u3001\u56fd\u5bb6\u53d1\u5c55\u548c\u6539\u9769\u59d4\u5458\u4f1a\u3001\u8d22\u653f\u90e8\u5173\u4e8e\u5370\u53d1\u4e2d\u5c0f\u4f01\u4e1a\u5212\u578b\u6807\u51c6\u89c4\u5b9a\u7684\u901a\u77e5\u300b\uff08\u5de5\u4fe1\u90e8\u8054\u4f01\u4e1a [2011]300 \u53f7\uff09\u3001\u300a\u5173\u4e8e\u653f\u5e9c\u91c7\u8d2d\u652f\u6301\u76d1\u72f1\u4f01\u4e1a\u53d1\u5c55\u6709\u5173\u95ee\u9898\u7684\u901a\u77e5\u300b\uff08\u8d22\u5e93[2014]68 \u53f7\uff09\u3001\u300a\u8d22\u653f\u90e8\u6c11\u653f\u90e8\u4e2d\u56fd\u6b8b\u75be\u4eba\u8054\u5408\u4f1a\u5173\u5b50\u4fc3\u8fdb\u6b8b\u75be\u4eba\u5c31\u4e1a\u653f\u5e9c\u91c7\u8d2d \u653f\u7b56\u7684\u901a\u77e5)) (\u8d22\u5e93\u30102017\u301114\u53f7)\u3001\u300a\u4e2d\u5173\u6751\u56fd\u5bb6\u81ea\u4e3b\u521b\u65b0\u793a\u8303\u533a\u65b0\u6280\u672f\u65b0\u4ea7\u54c1\u653f\u5e9c\u9996\u8d2d\u548c\u8ba2\u8d2d\u5b9e\u65bd\u7ec6\u5219\u300b\uff08\u4eac\u8d22\u91c7\u8d2d\u30142015\u301543 \u53f7\uff09\u3001\u7b2c\u4e8c\u5341\u56db\u671f\u300a\u8282\u80fd\u4ea7\u54c1\u653f\u5e9c\u91c7\u8d2d\u6e05\u5355\u300b\u3001\u7b2c\u4e8c\u5341\u4e8c\u671f\u300a\u73af\u5883\u6807\u5fd7\u4ea7\u54c1\u653f\u5e9c\u91c7\u8d2d\u6e05\u5355\u300b\u53ca\u5176\u5b83\u76f8\u5173\u6cd5\u5f8b\u6cd5\u89c4\uff0c\u8be6\u89c1\u78cb\u5546\u6587\u4ef6</strong></p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u8054\u7cfb\u65b9\u5f0f\uff1a</strong></p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u5f20\u9633</p><p>\u9879\u76ee\u8054\u7cfb\u7535\u8bdd\uff1a010-62386599</p><p></p><p><strong>\u516d\u3001\u91c7\u8d2d\u9879\u76ee\u9700\u8981\u843d\u5b9e\u7684\u653f\u5e9c\u91c7\u8d2d\u653f\u7b56\uff1a</strong></p> <p></p><p>\u65e0</p><p></p><p></p>    <p></p>           <p></p>                                                                                                                                                                                                                                                                    