{"title": "[\u987a\u4e49]\u987a\u4e49\u533a\u7b2c\u4e8c\u671f\u201c\u68a7\u6850\u5de5\u7a0b--\u5e72\u90e8\u4eba\u624d\u5f15\u8fdb\u8ba1\u5212\u201d\u9879\u76ee\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5317\u4eac\u91d1\u8bda\u7acb\u4fe1\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u987a\u4e49\u533a\u603b\u90e8\u4f01\u4e1a\u548c\u4e34\u7a7a\u7ecf\u6d4e\u9ad8\u7aef\u4eba\u624d\u670d\u52a1\u4e2d\u5fc3\u7684\u59d4\u6258\uff0c\u5c31\u987a\u4e49\u533a\u7b2c\u4e8c\u671f\u201c\u68a7\u6850\u5de5\u7a0b--\u5e72\u90e8\u4eba\u624d\u5f15\u8fdb\u8ba1\u5212\u201d\u9879\u76ee\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aJclxzc-2018-020\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aJclxzc-2018-020</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u987a\u4e49\u533a\u7b2c\u4e8c\u671f\u201c\u68a7\u6850\u5de5\u7a0b--\u5e72\u90e8\u4eba\u624d\u5f15\u8fdb\u8ba1\u5212\u201d\u9879\u76ee</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u8881\u5973\u58eb</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-89457607</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u603b\u90e8\u4f01\u4e1a\u548c\u4e34\u7a7a\u7ecf\u6d4e\u9ad8\u7aef\u4eba\u624d\u670d\u52a1\u4e2d\u5fc3</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u987a\u4e49\u533a\u5efa\u65b0\u897f\u88573\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u674e\u5973\u58eb  010-89498007</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u8be6\u89c1\u62db\u6807\u6587\u4ef6</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5317\u4eac\u91d1\u8bda\u7acb\u4fe1\u9020\u4ef7\u54a8\u8be2\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u987a\u4e49\u533a\u4ed3\u4e0a\u88572\u53f7AMB\u5927\u53a6B\u5ea711\u5c42  </p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u8881\u5973\u58eb   010-89457607</p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670810\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a1282.2545480 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><p style=\"line-height: 150%; text-indent: -6pt;\">\u4e2d\u6807\u4eba\uff1a\u4e2d\u56fd\u5987\u5973\u65c5\u884c\u793e</p><p style=\"line-height: 150%; text-indent: -6pt;\">\u7edf\u4e00\u793e\u4f1a\u4fe1\u7528\u4ee3\u7801: 911100001000043839</p><p style=\"line-height: 150%; text-indent: -6pt;\">\u4e2d\u6807\u4eba\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e1c\u57ce\u533a\u4e1c\u56db\u5357\u5927\u8857103\u53f7</p><p>\u4e2d\u6807\u91d1\u989d\uff1a12822545.48\u5143</p><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a7.55 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u8c03\u6574\u540e\u7684\u62db\u6807\u4ee3\u7406\u670d\u52a1\u6536\u8d39\u6807\u51c6\uff08\u53d1\u6539\u4ef7\u683c[2011]534\u53f7\uff09</p><p></p><p>\u8bc4\u5ba1\u4e13\u5bb6\u540d\u5355\uff1a</p><p>\u8d3a\u5b9c\u5175\u3001\u9648\u5b97\u6c11\u3001\u5218\u5fae\u534e\u3001\u5218\u5360\u6e56\u3001\u738b\u91d1\u7389</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f