{"title": "[\u897f\u57ce]\u5317\u4eac\u5e02\u7b2c\u4e09\u4e2d\u5b66\u51b0\u573a\u8bbe\u5907\u8d2d\u7f6e\uff08\u4e0d\u542b\u51b0\u8f66\uff09\u4e2d\u6807\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u5fb7\u6c47\u5de5\u7a0b\u7ba1\u7406\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u7b2c\u4e09\u4e2d\u5b66\u7684\u59d4\u6258\uff0c\u5c31\u51b0\u573a\u8bbe\u5907\u8d2d\u7f6e\uff08\u4e0d\u542b\u51b0\u8f66\uff09\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aTAHP-2018-ZB-YY-457\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u4e2d\u6807\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aTAHP-2018-ZB-YY-457</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u51b0\u573a\u8bbe\u5907\u8d2d\u7f6e\uff08\u4e0d\u542b\u51b0\u8f66\uff09</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u6f58\u8679\u5370</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-68011052-6006</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u7b2c\u4e09\u4e2d\u5b66</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u897f\u57ce\u533a\u5bcc\u56fd\u88573\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u9648\u656c\u56fd010-66113989</p><p></p><p><strong>\u4e09\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u91c7\u8d2d\u7528\u9014\uff1a\u81ea\u7528</p><p>\u7b80\u8981\u6280\u672f\u8981\u6c42/\u62db\u6807\u9879\u76ee\u7684\u6027\u8d28\uff1a\u5305\u542b\u4e13\u7528\u5236\u51b0\u673a\u7ec4\uff08\u7bb1\u5f0f\uff09\u3001\u7acb\u5f0f\u9664\u6e7f\u673a\u3001\u4e59\u4e8c\u9187\u3001\u51b0\u9762\u7ed3\u6784\u3001\u51b0\u573a\u76d8\u7ba1\u7cfb\u7edf\u3001\u7535\u6c14\u7cfb\u7edf\u5b89\u88c5\u3001\u81ea\u63a7\u7cfb\u7edf\u5b89\u88c5\u3001\u51b0\u573a\u754c\u5899\u7b49\u3002</p><p>\u5408\u540c\u5c65\u884c\u671f\uff1a2018\u5e749\u670830\u65e5\u81f32018\u5e7410\u670830\u65e5</p><p></p><p></p><p><strong>\u56db\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u5fb7\u6c47\u5de5\u7a0b\u7ba1\u7406\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u4e30\u53f0\u533a\u79d1\u4e30\u6865\u4e1c\u6c7d\u8f66\u535a\u7269\u9986\u4e1c\u8def\u76c8\u5764\u4e16\u7eaaG\u5ea7702-707</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u6f58\u8679\u5370010-68011052-6006</p><p></p><p><strong>\u4e94\u3001\u4e2d\u6807\u4fe1\u606f</strong></p><p>\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670807\u65e5</p><p>\u4e2d\u6807\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u4e2d\u6807\u91d1\u989d\uff1a340.6534000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u8054\u7cfb\u5730\u5740\u53ca\u4e2d\u6807\u91d1\u989d\uff1a</p><p></p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u540d\u79f0\uff1a\u5317\u4eac\u5609\u4f53\u7acb\u5fb7\u5efa\u8bbe\u5de5\u7a0b\u6709\u9650\u516c\u53f8</p><p>\u4e2d\u6807\u4f9b\u5e94\u5546\u5730\u5740\uff1a\u5317\u4eac\u5e02\u901a\u5dde\u533a\u897f\u96c6\u9547\u4f01\u4e1a\u53d1\u5c55\u670d\u52a1\u4e2d\u5fc3244\u53f7</p><p>\u4e2d\u6807\u91d1\u989d\uff1a3406534\u5143</p><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a4.2442 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u4f9d\u636e\u56fd\u5bb6\u8ba1\u59d4\u5173\u4e8e\u5370\u53d1\u300a\u62db\u6807\u4ee3\u7406\u670d\u52a1\u6536\u8d39\u7ba1\u7406\u6682\u884c\u529e\u6cd5\u300b\u7684\u901a\u77e5\u300a\u62db\u6807\u4ee3\u7406\u670d\u52a1\u6536\u8d39\u7ba1\u7406\u6682\u884c\u529e\u6cd5\u300b\uff08\u8ba1\u4ef7\u683c[2002]1980\u53f7\uff09\u53ca\u4eac\u4ef7\u534f[2015]011\u53f7</p><p></p><p>\u8bc4\u5ba1\u4e13\u5bb6\u540d\u5355\uff1a</p><p>\u8a79\u6cf0\u76ca\u3001\u674e\u7ea2\u971e\u3001\u6797\u539f\u3001\u989c\u6653\u971e\u3001\u65bd\u60e0\u5b9d</p><p></p><p>\u4e2d\u6807\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</p><p></p><p>1\u3001\u4e13\u7528\u5236\u51b0\u673a\u7ec4\uff08\u7bb1\u5f0f\uff09\u3001\u89c4\u683c\u578b\u53f7\uff1aTWSD040.1BLG2E\u3001\u6570\u91cf\uff1a1\u7ec4\u3001\u5355\u4ef7\uff1a955000\u5143</p><p><span style=\"line-height: 22.4px;\">2\u3001</span>\u7acb\u5f0f\u9664\u6e7f\u673a<span style=\"line-height: 22.4px;\">\u3001\u89c4\u683c\u578b\u53f7\uff1a</span>MKZ-20L<span style=\"line-height: 22.4px;\">\u3001\u6570\u91cf\uff1a</span>4\u53f0<span style=\"line-height: 22.4px;\">\u3001\u5355\u4ef7\uff1a</span>35500<span style=\"line-height: 22.4px;\">\u5143</span></p><p><span style=\"line-height: 22.4px;\">3\u3001</span>\u4e59\u4e8c\u9187<span style=\"line-height: 22.4px;\">\u3001\u89c4\u683c\u578b\u53f7\uff1a</span>\u6da4\u7eb6\u7ea7<span style=\"line-height: 22.4px;\">\u3001\u6570\u91cf\uff1a</span>6\u5428<span style=\"line-height: 22.4px;\">\u3001\u5355\u4ef7\uff1a</span>11500<span style=\"line-height: 22.4px;\">\u5143</span></p><p>\u670d\u52a1\u9700\u6c42\uff1a\u9488\u5bf9\u672c\u9879\u76ee\u7ec4\u5efa\u672c\u5730\u5316\u670d\u52a1\u56e2\u961f\u53ca\u5bf9\u63a5\u670d\u52a1\uff0c\u63d0\u4f9b24\u4e2a\u6708\u514d\u8d39\u4fdd\u4fee\u671f\u3002</p><p></p><p><strong>\u516d\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p>\u65e0</p>    <p></p>     <p></p>       <p></p> <p></p> <p></p>       <p></p>           <p></p>                                                                                                                                                                                 