{"title": "[\u660c\u5e73]\u5317\u4eac\u5e02\u660c\u5e73\u533a\u6559\u5e08\u8fdb\u4fee\u5b66\u6821\u660c\u5e73\u533a\u6559\u80b2\u5e72\u90e8\u9886\u5bfc\u529b\u63d0\u5347\u9879\u76ee\u6210\u4ea4\u516c\u544a", "content": "<div align=\"left\" style=\"padding-left:30px;\"><p align=\"center\">                                                                                      </p>  <p></p><p>\u3000\u3000\u4e2d\u5929\u4fe1\u8fdc\u56fd\u9645\u62db\u6295\u6807\u54a8\u8be2\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8\u53d7\u5317\u4eac\u5e02\u660c\u5e73\u533a\u6559\u5e08\u8fdb\u4fee\u5b66\u6821\u7684\u59d4\u6258\uff0c\u5c31\u660c\u5e73\u533a\u6559\u80b2\u5e72\u90e8\u9886\u5bfc\u529b\u63d0\u5347\u9879\u76ee\u9879\u76ee\uff08\u9879\u76ee\u7f16\u53f7\uff1aZTXY-2018-F15489\uff09\u7ec4\u7ec7\u91c7\u8d2d\uff0c\u8bc4\u6807\u5de5\u4f5c\u5df2\u7ecf\u7ed3\u675f\uff0c\u6210\u4ea4\u7ed3\u679c\u5982\u4e0b\uff1a</p><p></p><p></p><p><strong>\u4e00\u3001\u9879\u76ee\u4fe1\u606f</strong></p><p>\u9879\u76ee\u7f16\u53f7\uff1aZTXY-2018-F15489</p><p>\u9879\u76ee\u540d\u79f0\uff1a\u660c\u5e73\u533a\u6559\u80b2\u5e72\u90e8\u9886\u5bfc\u529b\u63d0\u5347\u9879\u76ee</p><p>\u9879\u76ee\u8054\u7cfb\u4eba\uff1a\u8042\u5973\u58eb</p><p>\u8054\u7cfb\u65b9\u5f0f\uff1a010-53779915</p><p></p><p><strong>\u4e8c\u3001\u91c7\u8d2d\u5355\u4f4d\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u5355\u4f4d\u540d\u79f0\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u6559\u5e08\u8fdb\u4fee\u5b66\u6821</p><p>\u91c7\u8d2d\u5355\u4f4d\u5730\u5740\uff1a\u5317\u4eac\u5e02\u660c\u5e73\u533a\u5e9c\u5b66\u8def35\u53f7</p><p>\u91c7\u8d2d\u5355\u4f4d\u8054\u7cfb\u65b9\u5f0f\uff1a\u674e\u5148\u751f\uff1b010-69704720</p><p></p><p></p><p><strong>\u4e09\u3001\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u4fe1\u606f</strong></p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5168\u79f0\uff1a\u4e2d\u5929\u4fe1\u8fdc\u56fd\u9645\u62db\u6295\u6807\u54a8\u8be2\uff08\u5317\u4eac\uff09\u6709\u9650\u516c\u53f8</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u5730\u5740\uff1a\u5317\u4eac\u5e02\u671d\u9633\u533a\u5357\u78e8\u623f\u8def37\u53f7\u534e\u817e\u5317\u642a\u5546\u52a1\u5927\u53a61112\u5ba4</p><p>\u91c7\u8d2d\u4ee3\u7406\u673a\u6784\u8054\u7cfb\u65b9\u5f0f\uff1a\u8042\u5973\u58eb\u3001\u8c22\u5973\u58eb\uff1b010-53779915</p><p></p><p><strong>\u56db\u3001\u6210\u4ea4\u4fe1\u606f</strong></p><p>\u62db\u6807\u6587\u4ef6\u7f16\u53f7\uff1aZTXY-2018-F15489</p><p>\u672c\u9879\u76ee\u62db\u6807\u516c\u544a\u65e5\u671f\uff1a2018\u5e7409\u670821\u65e5</p><p>\u6210\u4ea4\u65e5\u671f\uff1a2018\u5e7409\u670830\u65e5</p><p>\u603b\u6210\u4ea4\u91d1\u989d\uff1a71.0000000 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</p>                <p>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0\u3001\u5730\u5740\u53ca\u6210\u4ea4\u91d1\u989d\uff1a</p><p></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td>\u5e8f\u53f7</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u540d\u79f0</td><td>\u6210\u4ea4\u4f9b\u5e94\u5546\u8054\u7cfb\u5730\u5740</td><td>\u6210\u4ea4\u91d1\u989d(\u4e07\u5143)</td></tr><tr><td>1</td><td>\u5317\u4eac\u5e08\u8303\u5927\u5b66</td><td>\u5317\u4eac\u5e02\u6d77\u6dc0\u533a\u65b0\u8857\u53e3\u5916\u5927\u885719\u53f7\u5317\u4eac\u5e08\u8303\u5927\u5b66</td><td>71.000000</td></tr></tbody></table><p></p><p><b>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u603b\u91d1\u989d\uff1a1.065 \u4e07\u5143\uff08\u4eba\u6c11\u5e01\uff09</b></p><p>\u672c\u9879\u76ee\u4ee3\u7406\u8d39\u6536\u8d39\u6807\u51c6\uff1a</p><p>\u62db\u6807\u4ee3\u7406\u670d\u52a1\u8d39\u7531\u4e2d\u6807\u5355\u4f4d\u5728\u4e2d\u6807\u7ed3\u679c\u516c\u544a\u540e5\u4e2a\u5de5\u4f5c\u65e5\u5185\u652f\u4ed8\uff0c\u652f\u4ed8\u6807\u51c6\u6309\u7167\u56fd\u5bb6\u53d1\u5c55\u548c\u6539\u9769\u59d4\u5458\u4f1a\u9881\u53d1\u7684\u300a\u62db\u6807\u4ee3\u7406\u670d\u52a1\u6536\u8d39\u7ba1\u7406\u6682\u884c\u529e\u6cd5\u300b\u5373\uff08\u8ba1\u4ef7\u683c[2002]1980\u53f7\uff09\u62db\u6807\u6536\u8d39\u6807\u51c6\u548c\u56fd\u5bb6\u53d1\u5c55\u6539\u9769\u59d4\u529e\u516c\u5385\u5173\u4e8e\u62db\u6807\u4ee3\u7406\u670d\u52a1\u6536\u8d39\u6709\u5173\u95ee\u9898\u7684\u901a\u77e5\uff08\u53d1\u6539\u529e\u4ef7\u683c[2003]857\u53f7\uff09\u6267\u884c</p><p></p><p>\u8c08\u5224\u5c0f\u7ec4\u3001\u8be2\u4ef7\u5c0f\u7ec4\u3001\u78cb\u5546\u5c0f\u7ec4\u6210\u5458\u540d\u5355\u53ca\u5355\u4e00\u6765\u6e90\u91c7\u8d2d\u4eba\u5458\u540d\u5355\uff1a</p><p>\u738b\u96f7\u3001\u90d1\u695a\u548c\u3001\u674e\u5927\u9e64</p><p></p><p><strong>\u4e94\u3001\u9879\u76ee\u7528\u9014\u3001\u7b80\u8981\u6280\u672f\u8981\u6c42\u53ca\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a</strong></p><p></p><p>\u9879\u76ee\u7528\u9014\uff1a\u660c\u5e73\u533a\u6559\u80b2\u5e72\u90e8\u9886\u5bfc\u529b\u63d0\u5347\uff1b</p><p>\u7b80\u8981\u6280\u672f\u8981\u6c42\uff1a\u8be6\u89c1\u9644\u4ef6\uff1b</p><p>\u5408\u540c\u5c65\u884c\u65e5\u671f\uff1a\u8be6\u89c1\u5408\u540c\u3002</p><p></p><p><strong>\u516d\u3001\u6210\u4ea4\u6807\u7684\u540d\u79f0\u3001\u89c4\u683c\u578b\u53f7\u3001\u6570\u91cf\u3001\u5355\u4ef7\u3001\u670d\u52a1\u8981\u6c42\uff1a</strong></p><p></p><p>\u8be6\u89c1\u9644\u4ef6</p><p></p><p><strong>\u4e03\u3001\u5176\u5b83\u8865\u5145\u4e8b\u5b9c</strong></p><p></p><p style=\"margin: 0cm 0cm 10pt 74.45pt; line-height: 12pt; text-indent: -74.45pt; -ms-layout-grid-mode: both;\">\u672c\u4e2d\u6807\u7ed3\u679c\u516c\u544a\u671f\u9650\u4e3a1\u4e2a\u5de5\u4f5c\u65e5</p><p></p><p></p>  <p></p> <p></p> <p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            